/////// Assault carbines
L["eft_weapon_9a91"] = "9A-91"
L["eft_weapon_9a91_full"] = "Subkarabinek automatyczny KBP 9A-91 9 x 39"
L["eft_weapon_9a91_desc"] = "9A-91 to subkarabinek automatyczny kalibru 9 ×39 mm zaprojektowany jako bardziej zaawansowany technologicznie odpowiednik i konkurent karabinu szturmowego SR-3 Wichr. Wyprodukowany przez Biuro Konstrukcyjne KBP w Tule."

L["eft_weapon_adar215"] = "ADAR 2-15"
L["eft_weapon_adar215_full"] = "Karabinek ADAR 2-15 5,56 x 45"
L["eft_weapon_adar215_desc"] = "Rosyjski karabinek cywilny ADAR 2-15 bazuje na systemie AR-15. Jest produkowany w Petersburgu z użyciem izraelskich części oraz chromowanej lufy zrobionej przez firmę Molot Arms."

L["eft_weapon_avt40"] = "AWT-40"
L["eft_weapon_avt40_full"] = "Karabin automatyczny AWT-40 7,62 x 54 R"
L["eft_weapon_avt40_desc"] = "AWT-40 częściowo zrekompensował brak pistoletów i pistoletów maszynowych na początku II wojny światowej. AWT-40 jest podobny w swojej konstrukcji do SWT-40, ale dzięki obecności selektora ognia, którego rolę pełni bezpiecznik, może strzelać zarówno ogniem pojedynczym, jak i ciągłym."

L["eft_weapon_opsks"] = "OP-SKS"
L["eft_weapon_opsks_full"] = "Samopowtarzalny karabinek Molot Arms Simonow OP-SKS 7,62 x 39"
L["eft_weapon_opsks_desc"] = "Karabinek Mołot OP-SKS zasilany jest popularną amunicją 7,62 × 39 mm. Waga oraz wymiar sprawiają, że broń ta może być używana przez strzelca o dowolnym wzroście i wieku. Karabinek był używany podczas polowań w Rosji przez ponad 50 lat. Sprawdzony na drapieżnikach w Afryce, południowej Azji, Ameryce Centralnej oraz na Bliskim Wschodzie."

L["eft_weapon_rfb"] = "RFB"
L["eft_weapon_rfb_full"] = "Karabin Kel-Tec RFB 7,62 x 51"
L["eft_weapon_rfb_desc"] = "Kel-Tec RFB (Rifle, Forward-ejection, Bullpup) to bezkolbowy gazodynamiczny karabin samopowtarzalny kalibru 7,62 × 51 mm NATO / .308 Winchester. RFB używa metrycznych magazynków FAL, które wkłada się prosto do komory magazynka, nie trzeba nimi ruszać. Broń jest w pełni oburęczna, podobnie jak belgijski karabin F2000. RFB jest dostarczany bez celowników mechanicznych. Posiada szynę montażową Picatinny do montażu szerokiej gamy optyki i akcesoriów taktycznych. Wyprodukowany przez firmę Kel-Tec."

L["eft_weapon_sagak"] = "AK-545"
L["eft_weapon_sagak_full"] = "Karabinek SAG AK-545 5,45 x 39"
L["eft_weapon_sagak_desc"] = "Karabinek AK-545, oparty na współczesne platformy AK. Wyprodukowany przez firmę Sureshot Armament Group."

L["eft_weapon_sagakshort"] = "AK-545 subkarabinek"
L["eft_weapon_sagakshort_full"] = "Subkarabinek SAG AK-545 5,45 x 39"
L["eft_weapon_sagakshort_desc"] = "Subkarabinek AK-545, oparty na współczesne platformy AK. Wyprodukowany przez firmę Sureshot Armament Group."

L["eft_weapon_sks"] = "SKS"
L["eft_weapon_sks_full"] = "Samopowtarzalny karabinek TOZ Simonow SKS 7,62 x 39"
L["eft_weapon_sks_desc"] = "Radziecki karabinek samopowtarzalny zaprojektowany przez Siergieja Simonowa do amunicji 7,62 × 39 mm i znany za granicą jako SKS-45. Broń ta jest niezwykle popularna zarówno w krajach Wspólnoty Niepodległych Państw, jak i na Zachodzie, nadal używana jest w niektórych krajach w formie różnych kopii i modyfikacji. Ten szczególny model pochodzi z rozbudowanych zasobów magazynowych Fabryki Broni w Tule i nie został jeszcze poddany procedurze normalizacji broni cywilnej."

L["eft_weapon_sr3m"] = "SR-3M"
L["eft_weapon_sr3m_full"] = "Subkarabinek automatyczny SR-3M 9 x 39"
L["eft_weapon_sr3m_desc"] = "SR-3M to potężny karabinek automatyczny, charakteryzujący się bardzo kompaktowymi rozmiarami porównywalnymi z pistoletami maszynowymi, ale zauważalnie lepszy pod względem siły ognia dzięki zastosowaniu specjalnej amunicji przeciwpancernej. Głównym przeznaczeniem SR-3M jest wykorzystanie go jako ukrytej broni dla rosyjskich jednostek specjalnych. Opracowany w Instytucie Badawczym Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) i oparty na karabinku automatycznym AS Wał."

L["eft_weapon_svt40"] = "SWT-40"
L["eft_weapon_svt40_full"] = "Karabin SWT-40 7,62 x 54 R"
L["eft_weapon_svt40_desc"] = "SWT-40 był jedyną masowo produkowaną bronią osobistą we wczesnych latach II wojny światowej, zanim rozpoczęła się masowa produkcja pistoletów maszynowych. Żołnierze czule nazywali ten karabin „Świeta”. Kiedy „Świeta” trafiła do oddziałów, okazało się, że nie wszyscy żołnierze Armii Czerwonej byli w stanie naprawdę opanować tę broń. SWT był najlepiej wykorzystywany przez jednostki piechoty morskiej i snajperów. Produkcja SWT-40 trwała do końca wojny, a ten samopowtarzalny karabin w znacznym stopniu przyczynił się do ogólnego zwycięstwa."

L["eft_weapon_tx15"] = "TX-15 DML"
L["eft_weapon_tx15_full"] = "Karabinek Lone Star TX-15 DML 5,56 x 45"
L["eft_weapon_tx15_desc"] = "Lone Star Armory TX15 Designated Marksman Light (DML) to precyzyjny cywilny karabinek wyborowy zaprojektowany na podstawie systemu AR-15 kalibru 5,56 × 45 mm."

L["eft_weapon_vpo101"] = "WPO-101 „Wiepr-Hunter”"
L["eft_weapon_vpo101_full"] = "Karabin Molot Arms WPO-101 „Wiepr-Hunter” 7,62 x 51"
L["eft_weapon_vpo101_desc"] = "Samopowtarzalny karabinek myśliwski. Powstał na platformie ręcznego karabinu maszynowego Kałasznikowa (RPK) i ma podobny wygląd, wagę i wymiary. Przeznaczony do profesjonalnych i amatorskich polowań na średnią i dużą zwierzynę, a także do użytku sportowego."

L["eft_weapon_vpo136"] = "WPO-136 „Wiepr-KM”"
L["eft_weapon_vpo136_full"] = "Karabinek Molot Arms WPO-136 „Wiepr-KM” 7,62 x 39"
L["eft_weapon_vpo136_desc"] = "Karabinek Wiepr-KM/WPO-136 oparty jest na znanym karabinku AKM Kałasznikowa i ma niemal identyczny wygląd, wagę i wymiary. Przeznaczony do polowań na średnią i dużą zwierzynę, a także do użytku sportowego. Wyprodukowany przez firmę Mołot-Orużje."

L["eft_weapon_vpo209"] = "WPO-209"
L["eft_weapon_vpo209_full"] = "Karabinek Molot Arms WPO-209 .366 TKM"
L["eft_weapon_vpo209_desc"] = "Karabinek Mołot WPO-209 oparty jest na znanym AKM Kałasznikowa i ma niemal identyczny wygląd, wagę oraz rozmiary. Posiada lufę o gładkim przekroju, przy czym ostatnie 120 mm lufy jest gwintowane (tzw. lufa „paradox”). WPO-209 jest w kalibrze .366 TKM, co w połączeniu z ryflowaniem „paradox” klasyfikuje broń jako strzelbę w świetle prawa rosyjskiego."

L["eft_weapon_vsk94"] = "WSK-94"
L["eft_weapon_vsk94_full"] = "Karabinek wyborowy KBP WSK-94 9 x 39"
L["eft_weapon_vsk94_desc"] = "WSK-94 (Wojskowyj Snajpierskij Kompleks – „Wojskowy Kompleks Snajperski”) to karabinek wyborowy zaprojektowany na bazie subkarabinka automatycznego 9A-91 jako tańsza alternatywa dla WSS Wintoriez. Tłumik, w przeciwieństwie do WSS, nie jest zintegrowany, co pozwala na użycie karabinka bez niego, jeśli zajdzie taka potrzeba. Wyprodukowany przez Biuro Konstrukcyjne KBP w Tule."

/////// Assault rifles
L["eft_weapon_ak12"] = "AK-12"
L["eft_weapon_ak12_full"] = "Karabinek automatyczny Kałasznikowa AK-12 5,45 x 39"
L["eft_weapon_ak12_desc"] = "Karabinek automatyczny Kałasznikow AK-12 5,45 to podstawowy model indywidualnej broni strzeleckiej dla piechoty jednostek zmotoryzowanych i innych jednostek rosyjskich sił zbrojnych. AK-12 jest częścią systemu wyposażenia Ratnik."

L["eft_weapon_ak74"] = "AK-74"
L["eft_weapon_ak74_full"] = "Karabinek automatyczny Kałasznikowa AK-74 5,45 x 39"
L["eft_weapon_ak74_desc"] = "Karabinek automatyczny AK-74 (Awtomat Kałasznikowa 74 – „karabinek automatyczny Kałasznikowa 74”) kalibru 5,45 × 39 mm, opracowany w 1970 roku przez M. T. Kałasznikowa jest dalszą ewolucją karabinka AKM spowodowaną przyjęciem przez wojsko nowej amunicji 5,45 × 39 mm. AK-74 wyposażono w nową kolbę, łoże (które zachowało miejsca na palce z AKM) i komorę gazową. Kolba ma nakładkę na ramię inną niż ta z AKM, która jest gumowa i chropowata dla lepszego usadowienia dla strzelającego. Dodatkowo po każdej stronie kolby są odchudzające nacięcia. Kolba, łoże i nakładka lufy były na początku produkowane z laminowanego drewna, później zmieniono je na syntetyczne włókno szklane w kolorze śliwkowym lub ciemnobrązowym."

L["eft_weapon_ak74m"] = "AK-74M"
L["eft_weapon_ak74m_full"] = "Karabinek automatyczny Kałasznikowa AK-74M 5,45 x 39"
L["eft_weapon_ak74m_desc"] = "Karabinek automatyczny AK-74M (Awtomat Kałasznikowa 74 Modiernizirowannyj – „zmodernizowany karabinek automatyczny Kałasznikowa 74”) kalibru 5,45 × 39 mm to produkowana na masową skalę zmodernizowana wersja karabinka automatycznego AK-74, która oferuje większą wszechstronność w porównaniu do swojego poprzednika. Poza kilkoma drobnymi ulepszeniami, jak np. lżejszy zespół suwadła w celu zmniejszenia siły tłoka gazowego i suwadła podczas strzelania, ten karabinek posiada nowe poliamidowe łoże, która zachowuje kształt oryginalnego zamontowanego na stałe łoża AK-74 z laminowanego drewna, ale składa się na bok w lewo, jak łoże szkieletowe AKS-74, a także boczne mocowanie na jaskółczy ogon do montażu różnych celowników. AK-74M jest głównym karabinem służbowym Federacji Rosyjskiej."

L["eft_weapon_ak74n"] = "AK-74N"
L["eft_weapon_ak74n_full"] = "Karabinek automatyczny Kałasznikowa AK-74N 5,45 x 39"
L["eft_weapon_ak74n_desc"] = "Karabinek automatyczny AK-74N (Awtomat Kałasznikowa 74 Nocznoj – „karabinek automatyczny Kałasznikowa 74 nocny”) 5,45 × 39 mm był opracowany w 1970 roku przez M. T. Kałasznikowa, jest dalszą ewolucją karabinka AKM w związku z przyjęciem nowej amunicji 5,45 × 39 mm przez wojsko. Jedyną cechą odróżniającą go od standardowego AK-74 jest boczna szyna montażowa (tzw. jaskółczy ogon, potocznie „jaskółka”) na przyrządy optyczne i noktowizyjne."

L["eft_weapon_ak101"] = "AK-101"
L["eft_weapon_ak101_full"] = "Karabinek automatyczny Kałasznikowa AK-101 5,56 x 45"
L["eft_weapon_ak101_desc"] = "Karabinek automatyczny AK-101 kalibru 5,56 × 45 mm to dalsza modyfikacja podstawy AK-74M. AK-101 wyposażony jest w składaną na bok kolbę oraz boczny montaż do celowników optycznych i noktowizyjnych. Karabinek jest przystosowany do strzelania amunicją 5,56 × 45 mm NATO i został zaprojektowany w całości na eksport. AK serii 100 produkowane są przez fabryki Iżmasz w Iżewsku w Rosji."

L["eft_weapon_ak102"] = "AK-102"
L["eft_weapon_ak102_full"] = "Karabinek automatyczny Kałasznikowa AK-102 5,56 x 45"
L["eft_weapon_ak102_desc"] = "Karabinek automatyczny AK-102 kalibru 5,56 × 45 mm to dalsza modyfikacja podstawy AK-74M, konkretniej to skrócona wersja karabinka automatycznego AK-101. Krótka kompaktowa wersja wyposażona jest w składaną na bok kolbę oraz boczny montaż do celowników optycznych i noktowizyjnych. Karabinek jest przystosowany do strzelania amunicją 5,56 × 45 mm NATO i został zaprojektowany w całości na eksport. AK serii 100 produkowane są przez fabryki Iżmasz w Iżewsku w Rosji."

L["eft_weapon_ak103"] = "AK-103"
L["eft_weapon_ak103_full"] = "Karabinek automatyczny Kałasznikowa AK-103 7,62 x 39"
L["eft_weapon_ak103_desc"] = "Karabinek automatyczny AK-103 kalibru 7,62 × 39 mm to dalsza modyfikacja podstawy AK-74M. AK-103 wyposażony jest w składaną na bok kolbę oraz boczny montaż do celowników optycznych i noktowizyjnych. AK serii 100 produkowane są przez fabryki Iżmasz w Iżewsku w Rosji."

L["eft_weapon_ak104"] = "AK-104"
