L["eft_weapon_ak104_desc"] = "Karabinek automatyczny AK-104 kalibru 7,62 × 39 mm to dalsza modyfikacja podstawy AK-74M, konkretniej to skrócona wersja karabinka automatycznego AK-103. Krótka kompaktowa wersja wyposażona jest w składaną na bok kolbę oraz boczny montaż do celowników optycznych i noktowizyjnych. AK serii 100 produkowane są przez fabryki Iżmasz w Iżewsku w Rosji."

