L["eft_weapon_ak105_desc"] = "Karabinek automatyczny AK-105 kalibru 5,45 × 39 mm to dalsza modyfikacja podstawy AK-74M. Krótka kompaktowa wersja wyposażona jest w składaną na bok kolbę oraz boczny montaż do celowników optycznych i noktowizyjnych. AK serii 100 produkowane są przez fabryki Iżmasz w Iżewsku w Rosji."

L["eft_weapon_akm"] = "AKM"
L["eft_weapon_akm_full"] = "Karabinek automatyczny Kałasznikowa AKM 7,62 x 39"
L["eft_weapon_akm_desc"] = "Karabinek automatyczny AKM (Awtomat Kałasznikowa Modiernizirowannyj – „zmodernizowany karabinek automatyczny Kałasznikowa”) 7,62 × 39 mm wprowadzony został w 1959 roku, by zastąpić AK w roli standardowej broni w armii radzieckiej. Główne różnice w porównaniu do AK to: większa celność; mniejsza waga; nowa kolba, spust, iglica, opóźniacz kurka oraz osłabiacz podrzutu. Wprowadzono też inne zmiany, które miały na celu poprawę skuteczności karabinka."

L["eft_weapon_akmn"] = "AKMN"
L["eft_weapon_akmn_full"] = "Karabinek automatyczny Kałasznikowa AKMN 7,62 x 39"
L["eft_weapon_akmn_desc"] = "Karabinek automatyczny AKMN (Awtomat Kałasznikowa Modiernizirowannyj Nocznoj – „zmodernizowany karabinek automatyczny Kałasznikowa nocny”) to system broni składający się ze zmodyfikowanego karabinka automatycznego AKM z montażem typu jaskółczy ogon do instalacji celowników noktowizyjnych z rodziny NSP – NSP-2/3/3A, NSPU i NSPU-M."

L["eft_weapon_akms"] = "AKMS"
L["eft_weapon_akms_full"] = "Karabinek automatyczny Kałasznikowa AKMS 7,62 x 39"
L["eft_weapon_akms_desc"] = "Karabinek automatyczny AKMS (Awtomat Kałasznikowa Modiernizirowannyj Składnoj – „zmodernizowany karabinek automatyczny Kałasznikowa ze składaną kolbą”) 7,62 × 39 mm (indeks GRAU 6P4) jest to wariant AKM ze składaną kolbą. Składa się do przodu-w dół, poniżej chwytu. Zaprojektowany szczególnie dla wojsk powietrznodesantowych."

L["eft_weapon_akmsn"] = "AKMSN"
L["eft_weapon_akmsn_full"] = "Karabinek automatyczny Kałasznikowa AKMSN 7,62 x 39"
L["eft_weapon_akmsn_desc"] = "Karabinek automatyczny AKMSN (Awtomat Kałasznikowa Modiernizirowannyj Składnoj Nocznoj – „zmodernizowany karabinek automatyczny Kałasznikowa nocny ze składaną kolbą”) 7,62 × 39 mm to wariant AKMS z szyną montażową typu jaskółczy ogon do instalacji lunet noktowizyjnych rodziny NSP – NSP-2/3/3A, NSPU, NSPU-M."

L["eft_weapon_aks74"] = "AKS-74"
L["eft_weapon_aks74_full"] = "Karabinek automatyczny Kałasznikowa AKS-74 5,45 x 39"
L["eft_weapon_aks74_desc"] = "Karabinek automatyczny AKS-74 (Awtomat Kałasznikowa Składnoj 74 – „skrócony karabinek automatyczny Kałasznikowa 74”) kalibru 5,45 × 39 mm to wariant karabinku automatycznego AK-74 wyposażony w składaną na bok metalową kolbą zaprojektowany głównie do użytku przez piechotę szturmową i opracowany równolegle z podstawowym AK-74. Łoże AKS-74 jest wykonane z wytłoczonych z blachy rozpórek, sprasowanych maszynowo w kształt litery „U” i zmontowanych za pomocą wykrojnika i spawania."

L["eft_weapon_aks74n"] = "AKS-74N"
L["eft_weapon_aks74n_full"] = "Karabinek automatyczny Kałasznikowa AKS-74N 5,45 x 39"
L["eft_weapon_aks74n_desc"] = "Karabinek automatyczny AKS-74N (Awtomat Kałasznikowa Składnoj 74 Nocznoj – „karabinek automatyczny Kałasznikowa 74 nocny ze składaną kolbą”) 5,45 × 39 mm ze składaną na bok metalową kolbą zaprojektowany głównie do użytku w piechocie szturmowej. Jedyną cechą odróżniającą go od standardowego AKS-74 jest boczna szyna montażowa (tzw. jaskółczy ogon, potocznie „jaskółka”) na przyrządy optyczne i noktowizyjne."

L["eft_weapon_aks74u"] = "AKS-74U"
L["eft_weapon_aks74u_full"] = "Karabinek automatyczny Kałasznikowa AKS-74U 5,45 x 39"
L["eft_weapon_aks74u_desc"] = "Karabinek automatyczny AKS-74U (Awtomat Kałasznikowa Składnoj 74 Ukoroczennyj – „skrócony karabinek automatyczny Kałasznikowa 74 ze składaną kolbą”) to skrócona wersja karabinka automatycznego AKS-74, opracowana we wczesnych latach 80. dla załóg pojazdów bojowych i oddziałów powietrznych. Stała się bardzo popularna wśród organów ścigania i sił specjalnych ze względu na niewielkie rozmiary."

L["eft_weapon_aks74ub"] = "AKS-74UB"
L["eft_weapon_aks74ub_full"] = "Karabinek automatyczny Kałasznikowa AKS-74UB 5,45 x 39"
L["eft_weapon_aks74ub_desc"] = "Specjalna wersja karabinka automatycznego AKS-74U, modyfikacja B (Biesszumnyj – „wyciszony”) z montażem typu jaskółczy ogon, tłumikiem i specjalnymi celownikami przystosowanymi do strzelania amunicją poddźwiękową."

L["eft_weapon_aks74un"] = "AKS-74UN"
L["eft_weapon_aks74un_full"] = "Karabinek automatyczny Kałasznikowa AKS-74UN 5,45 x 39"
L["eft_weapon_aks74un_desc"] = "Karabinek automatyczny AKS-74UN (Awtomat Kałasznikowa Składnoj 74 Ukoroczennyj Nocznoj – „skrócony karabinek automatyczny Kałasznikowa 74 nocny ze składaną kolbą”) to skrócona wersja karabinka AKS-74 opracowana we wczesnych latach 80. dla załóg pojazdów bojowych i oddziałów powietrznych. Stała się bardzo popularna wśród organów ścigania i sił specjalnych ze względu na niewielkie rozmiary. Wersja N (Nocznoj – „nocny”) jest wyposażona w boczną szynę do montażu celowników noktowizyjnych."

L["eft_weapon_asval"] = "AS Wał"
L["eft_weapon_asval_full"] = "Karabinek automatyczny AS Wał 9 x 39"
L["eft_weapon_asval_desc"] = "AS Wał (Awtomat Spiecyalnyj Wał – „specjalny karabinek automatyczny Wał”) to wyciszony karabinek automatyczny z integralnym tłumikiem przeznaczony dla jednostek sił specjalnych. Opracowany w Instytucie Badawczym Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) i oparty na platformie WSS Wintoriez."

L["eft_weapon_ash12"] = "ASz-12"
L["eft_weapon_ash12_full"] = "Karabin automatyczny ASz-12 12,7 x 55"
L["eft_weapon_ash12_desc"] = "Karabin automatyczny ASz-12.7 („Awtomat Szturmowoj 12” – „Karabin automatyczny 12”) jest zaprojektowany do walki na krótkim dystansie/w warunkach miejskich zaprojektowany przez CKIB SOO (Centralne Biura Projektów i Badań Broni Sportowej i Myśliwskiej), oddział Biura Konstrukcyjnego KBP w Tule, na zlecenie rosyjskiego FSB (Federalna Służba Bezpieczeństwa). Broń została zaprojektowana, aby posiadać niesamowitą mocą obalającą na krótkim dystansie z myślą o działaniach oddziałów FSB."

L["eft_weapon_auga1"] = "AUG A1"
L["eft_weapon_auga1_full"] = "Karabinek automatyczny Steyr AUG A1 5,56 x 45"
L["eft_weapon_auga1_desc"] = "Bezkolbowy karabinek automatyczny Steyr AUG A1 kalibru 5,56 × 45 mm. AUG znany jest z dobrej ergonomii, przyzwoitej celności, niskiego odrzutu i wystarczającej niezawodności. Karabinek wyróżnia się również futurystycznym designem. Wyprodukowany przez firmę Steyr-Daimler-Puch."

L["eft_weapon_auga3"] = "AUG A3"
L["eft_weapon_auga3_full"] = "Karabinek automatyczny Steyr AUG A3 5,56 x 45"
L["eft_weapon_auga3_desc"] = "Bezkolbowy karabinek automatyczny Steyr AUG A3 kalibru 5,56 × 45 mm. AUG znany jest z dobrej ergonomii, przyzwoitej celności, niskiego odrzutu i wystarczającej niezawodności. Karabinek wyróżnia się również futurystycznym designem. Wersja A3 posiada przycisk zatrzasku zamka. Wyprodukowany przez firmę Steyr-Daimler-Puch."

L["eft_weapon_mdr556"] = "MDR"
L["eft_weapon_mdr556_full"] = "Karabinek automatyczny Desert Tech MDR 5,56 x 45"
L["eft_weapon_mdr556_desc"] = "Bezkolbowy karabinek automatyczny MDR kalibru 5,56 × 45 mm zaprojektowany i produkowany przez Desert Tech LLC. Modułowa broń wielokalibrowa o kompaktowym bezkolbowym układzie, przeznaczona do użytku przez policję i wojskowe siły specjalne. Długości luf i kalibry mogą być zmieniane przez użytkownika w ciągu kilku minut przy użyciu minimalnej ilości narzędzi."

L["eft_weapon_mdr762"] = "MDR"
L["eft_weapon_mdr762_full"] = "Karabin automatyczny Desert Tech MDR 7,62 x 51"
L["eft_weapon_mdr762_desc"] = "Bezkolbowy karabinek automatyczny MDR kalibru 7,62 × 51 mm (.308) zaprojektowany i produkowany przez Desert Tech LLC. Modułowa broń wielokalibrowa o kompaktowym bezkolbowym układzie, przeznaczona do użytku przez policję i wojskowe siły specjalne. Długości luf i kalibry mogą być zmieniane przez użytkownika w ciągu kilku minut przy użyciu minimalnej ilości narzędzi."

L["eft_weapon_g36"] = "G36"
L["eft_weapon_g36_full"] = "Karabinek automatyczny HK G36 5,56 x 45"
L["eft_weapon_g36_desc"] = "Karabinek automatyczny G36 kalibru 5,56 × 45 mm zaprojektowany na początku lat 90. przez niemiecką firmę Heckler & Koch jako zamiennik cięższego karabinu automatycznego G3 kalibru 7,62 × 51 mm. Został przyjęty do służby w Bundeswehrze w 1997 roku, zastępując G3. Od tego czasu stał się również popularnym przedmiotem eksportu, a G36 był aktywnie wykorzystywany w jednostkach wojskowych i policyjnych w kilku krajach, w tym w Niemczech, Hiszpanii i Wielkiej Brytanii."

L["eft_weapon_hk416a5"] = "HK416A5"
L["eft_weapon_hk416a5_full"] = "Karabinek automatyczny HK416A5 5,56 x 45"
L["eft_weapon_hk416a5_desc"] = "HK416 A5 jest rozwinięciem karabinka HK416 na amunicję 5,56 × 45 mm NATO. Najbardziej widoczne zmiany w porównaniu do poprzednich wersji, jak i dostępnych na rynku konstrukcji opartych na systemie AR, to ulepszony i nie wymagający narzędzi regulator ciśnienia gazu do użycia z tłumikami, przeprojektowana, bardziej przyjazna dla użytkownika komora spustowa, która umożliwia w pełni oburęczną obsługę broni i zapewniają zgodność magazynków, a także wiele poprawek technicznych, aby zapewnić operatorowi bezpieczeństwo, niezawodność broni, zgodność amunicji i wytrzymałość w trudnych warunkach."

L["eft_weapon_m4a1"] = "M4A1"
L["eft_weapon_m4a1_full"] = "Karabinek automatyczny Colt M4A1 5,56 x 45"
L["eft_weapon_m4a1_desc"] = "Karabinek automatyczny Colt M4A1 jest w pełni automatycznym wariantem podstawowego karabinka automatycznego M4 i został zaprojektowany głównie do użytku w operacjach specjalnych.\nJednakże Dowództwo Operacji Sił Specjalnych Stanów Zjednoczonych (USSOCOM) wkrótce zaadoptowało M4A1 dla prawie wszystkich jednostek operacji specjalnych, a później nastąpiło ogólne wprowadzenie M4A1 do służby w armii USA oraz Korpusie Piechoty Morskiej."

L["eft_weapon_mcx"] = "MCX .300 BLK"
L["eft_weapon_mcx_full"] = "Karabinek automatyczny SIG MCX .300 Blackout"
L["eft_weapon_mcx_desc"] = "Linia MCX .300 Blackout, zaprojektowana i produkowana przez firmę SIG Sauer, jest dostępna zarówno w wersji samopowtarzalnej, jak i automatycznej i posiada system tłoka gazowego o krótkim skoku, który jest odziedziczony po wcześniejszym pistolecie maszynowymi SIG MPX. Amunicja .300 Blackout oraz MCX są kompatybilne ze wszystkimi magazynkami AR-15."

L["eft_weapon_mcxspear"] = "SPEAR 6,8"
L["eft_weapon_mcxspear_full"] = "Karabin automatyczny MCX SPEAR 6,8 x 51"
L["eft_weapon_mcxspear_desc"] = "MCX SPEAR to wielokalibrowy karabin automatyczny zaprojektowany i wyprodukowany przez firmę SIG Sauer w oparciu o karabinek automatyczny MCX. Głównie w kalibrze na nową amunicję 6,8 × 51 mm (.277 FURY). Zaprojektowany specjalnie dla wojska USA w celu zastąpienia karabinka M4."

L["eft_weapon_mk47"] = "Mk47"
L["eft_weapon_mk47_full"] = "Karabinek automatyczny CMMG Mk47 Mutant 7,62 x 39"
L["eft_weapon_mk47_desc"] = "CMMG Mk47 Mutant to amerykański karabinek automatyczny kalibru 7,62 × 39 mm, wyprodukowany przez firmę CMMG Inc. Współpracuje ze wszystkimi typami magazynków AK, w tym stalowymi, polimerowymi i bębnowymi. Karabinek wykazał się wyjątkową niezawodnością, co w połączeniu z klasyczną ergonomią systemu AR daje doskonały przykład broni palnej. Ten wariant posiada w pełni automatyczny tryb strzelania, tylko do użytku przez służby porządkowe i wojsko."

L["eft_weapon_rd704"] = "RD-704"
L["eft_weapon_rd704_full"] = "Karabinek automatyczny Rifle Dynamics RD-704 7,62 x 39"
L["eft_weapon_rd704_desc"] = "Karabinek automatyczny Rifle Dynamics 704 kalibru 7,62 × 39 mm – ulepszona wersja systemu AK produkowana przez firmę Rifle Dynamics. Główna różnica w stosunku do standardowego AK: konstrukcja części przedniej przesuwa środek ciężkości bliżej komory zamkowej, co znacznie poprawia sterowność broni."

L["eft_weapon_sa58"] = "SA-58"
L["eft_weapon_sa58_full"] = "Karabin automatyczny DS Arms SA-58 7,62 x 51"
L["eft_weapon_sa58_desc"] = "SA-58 OSW (Operations Specialist Weapon) produkowany w amerykańskich zakładach DSA (albo DS Arms – David Selveggio Arms) jest legalną kopią karabinu FAL. Wykonany przy pomocy tego samego wyposażenia linii produkcyjnej firmy Steyr-Daimler-Puch co karabin StG-58. Dostępny z lufami różnej długości, komorą spustową wykonaną ze stopu aluminium oraz ulepszonymi nylonowymi okładzinami wypełnionymi szkłem. Cywilne modele strzelają ogniem pojedynczym, jednak wojskowi i policyjni klienci mogą zamówić wersję z przełącznikiem ognia, umożliwiającą strzelanie ogniem ciągłym o szybkostrzelności 750 pocisków na minutę. DSA-58 może używać dowolnych magazynków od karabinka FAL."

L["eft_weapon_scarh"] = "Mk 17"
L["eft_weapon_scarh_full"] = "Karabin automatyczny FN SCAR-H 7,62 x 51"
L["eft_weapon_scarh_desc"] = "Karabinek automatyczny FN SCAR-H (Special Operations Forces Combat Assault Rifle – Heavy) kalibru 7,62 × 51 mm NATO, został zaadoptowany przez US SOCOM jako Mk 17. Posiada składaną na bok polimerową kolbę i swobodną, kutą na zimno chromowaną lufę. W pełni oburęczne elementy obsługi pozwalają dostosować SCAR do każdego użytkownika i każdej pozycji strzeleckiej. Zintegrowana w komorze zamkowej szyna optyczna oraz trzy szyny akcesoryjne umożliwiają montaż szerokiej gamy lunet, celowników elektronicznych, latarek taktycznych i laserów. Wyprodukowany przez Fabrique Nationale Herstal."

L["eft_weapon_scarhx17"] = "X-17"
L["eft_weapon_scarhx17_full"] = "FN SCAR-H X-17 7.62x51 assault rifle"
L["eft_weapon_scarhx17_desc"] = "The FN SCAR-H (Special Operations Forces Combat Assault Rifle - Heavy) assault rifle chambered in 7.62x51 NATO rounds, was adopted by the US SOCOM as the Mk 17. Features a side-folding polymer stock and a free-floating, cold hammer-forged Mil-Spec barrel with hardchromed bore. Fully-ambidextrous operating controls instantly adapt the SCAR to any user or any shooting position. The receiver-integrated optical rail plus three accessory rails enable mounting of a wide variety of scopes, electronic sights, tactical lights and lasers. The X-17 lower receiver allows the installation of AR-10 magazines. Manufactured by Fabrique Nationale Herstal and X Products."

L["eft_weapon_scarl"] = "Mk 16"
L["eft_weapon_scarl_full"] = "Karabinek automatyczny FN SCAR-L 5,56 x 45"
L["eft_weapon_scarl_desc"] = "Karabinek automatyczny FN SCAR-L (Special Operations Forces Combat Assault Rifle – Light) kalibru 5,56 × 45 mm NATO, został zaadoptowany przez US SOCOM jako Mk 16. Posiada składaną na bok polimerową kolbę i swobodną, kutą na zimno chromowaną lufę. W pełni oburęczne elementy obsługi pozwalają dostosować SCAR do każdego użytkownika i każdej pozycji strzeleckiej. Zintegrowana w komorze zamkowej szyna optyczna oraz trzy szyny akcesoryjne umożliwiają montaż szerokiej gamy lunet, celowników elektronicznych, latarek taktycznych i laserów. Wyprodukowany przez Fabrique Nationale Herstal."

L["eft_weapon_velociraptor"] = "Velociraptor .300 BLK"
L["eft_weapon_velociraptor_full"] = "Aklys Defense Velociraptor .300 Blackout assault rifle"
L["eft_weapon_velociraptor_desc"] = "A special modification based on the AK assault rifle chambered in .300 Blackout caliber, manufactured by Aklys Defense. It replaces the standard barrel assembly with a modified integrally suppressed barrel, which allowed to achieve a significantly reduced sound signature."

/////// Bolt-action rifles
L["eft_weapon_dvl10"] = "DWL-10"
L["eft_weapon_dvl10_full"] = "Powtarzalny karabin wyborowy Lobaev Arms DWL-10 7,62 x 51"
L["eft_weapon_dvl10_desc"] = "DWL-10 jest lekkim, kompaktowym i wytłumionym karabinem wyborowym, obecnie w użyciu przez wojsko w poddźwiękowych kalibrach. Opracowany do zadań specjalnych i misji bojowych, gdzie wymagana jest precyzja działania oraz zasięg. Wyposażony w standardową składaną kolbę Lobaev Arms oraz precyzyjną lufę ze stali nierdzewnej Lobaev Hummer Barrels."

L["eft_weapon_m700"] = "M700"
L["eft_weapon_m700_full"] = "Powtarzalny karabin wyborowy Remington Model 700 7,62 x 51"
L["eft_weapon_m700_desc"] = "Remington Model 700 to seria powtarzalnych karabinów wyborowych centralnego zapłonu produkowanych przez firmę Remington Arms od 1962 roku."

L["eft_weapon_mosininf"] = "Mosin piechoty"
L["eft_weapon_mosininf_full"] = "Karabin powtarzalny Mosina 7,62 x 54 R (piechoty)"
L["eft_weapon_mosininf_desc"] = "Karabin Mosina to jeden z najbardziej znanych rosyjskich karabinów, który był powszechnie używany przez rosyjskich żołnierzy podczas II wojny światowej. Opracowany w latach 1882-1891, był używany przez siły zbrojne Imperium Rosyjskiego, Związku Radzieckiego i różnych innych narodów. Jest to jeden z najbardziej masowo produkowanych wojskowych karabinów powtarzalnych w historii – od 1891 roku wyprodukowano ponad 37 milionów sztuk. Pomimo swojego wieku, jest on używany w różnych konfliktach na całym świecie aż do dnia dzisiejszego."

L["eft_weapon_mosinsnip"] = "Mosin snajperski"
L["eft_weapon_mosinsnip_full"] = "Karabin powtarzalny Mosina 7,62 x 54 R (snajperski)"
L["eft_weapon_mosinsnip_desc"] = "Mosin-Nagant M91/30 PU jest to wariant snajperski słynnego rosyjskiego karabinu, który był powszechnie używany przez rosyjskich snajperów w trakcie II wojny światowej."

L["eft_weapon_sv98"] = "SW-98"
L["eft_weapon_sv98_full"] = "Powtarzalny karabin wyborowy SW-98 7,62 x 54 R"
L["eft_weapon_sv98_desc"] = "SW-98 to rosyjski karabin wyborowy opracowany w latach 1998-2000 przez grupę inżynierów pod kierownictwem Władimira Strońskiego. Seryjnie produkowany przez zakłady Iżmasz. Jest to broń powtarzalna z zamkiem czterotaktowym, zasilana z wymiennego magazynka, zaprojektowana do eliminowania piechoty na dystansie do 1000 m."

L["eft_weapon_t5000m"] = "T-5000M"
L["eft_weapon_t5000m_full"] = "Powtarzalny karabin wyborowy ORSIS T-5000M 7,62 x 51"
L["eft_weapon_t5000m_desc"] = "ORSIS T-5000M to rosyjski powtarzalny karabin wyborowy. Był to pierwszy produkt opracowany przez firmę ORSIS i jest produkowany w ich moskiewskiej fabryce. Karabin został zaprezentowany w 2011 roku na międzynarodowej wystawie rosyjskiej broni w mieście Niżny Tagił i jest całkowicie oryginalny, nie wykorzystuje żadnych komponentów innych firm. Karabin zapewnia maksymalny komfort użytkownika podczas celowania i strzelania, charakteryzuje się szybkim powrotem do linii celowania, wysoką niezawodnością i ergonomią. Lufa wykonana ze stali nierdzewnej posiada gwint umożliwiający zamontowanie hamulca wylotowego lub tłumika dźwięku. Wyposażony hamulec wylotowy skutecznie zmniejsza odrzut i pozwala na najbardziej komfortowe radzenie sobie z nim."

L["eft_weapon_trgm10"] = "TRG M10"
L["eft_weapon_trgm10_full"] = "Sako TRG M10 .338 LM bolt-action sniper rifle"
L["eft_weapon_trgm10_desc"] = "The TRG M10 is a precision bolt-action sniper rifle chambered for the .338 Lapua Magnum cartridge. The TRG M10 is an extremely versatile platform: it easily converts from a proper long-range rifle to a more compact weapon. The rifle is designed to be used by army, police and various special forces of several countries. Manufactured by Sako, which is part of Beretta Defense Technologies holding company."

L["eft_weapon_vpo215"] = "WPO-215 „Gornostaj”"
L["eft_weapon_vpo215_full"] = "Karabinek powtarzalny Molot Arms WPO-215 „Gornostaj” .366 TKM"
L["eft_weapon_vpo215_desc"] = "WPO-215 „Gornostaj” („Gronostaj”) kalibru .336 TKM to rosyjski powtarzalny karabinek przeznaczony do polowań i strzelań sportowych. Wyprodukowany przez firmę Molot Arms."

/////// Designated marksman rifles
L["eft_weapon_g28"] = "G28"
L["eft_weapon_g28_full"] = "Karabin wyborowy HK G28 7,62 x 51"
L["eft_weapon_g28_desc"] = "Karabin automatyczny HK G28 został opracowany przez firmę Heckler & Koch specjalnie dla Bundeswehry jako broń wsparcia dla małych jednostek piechoty. G28 bazuje na HK MR308, który z kolei jest cywilną wersją karabinu automatycznego HK 417. Pomimo kilku różnic, HK G28 jest w 75% wymienny z HK 417. Karabin ten został zaprojektowany do strzelania na odległości niedostępne dla standardowych karabinów automatycznych kalibru 5,56 mm."

L["eft_weapon_m1a"] = "M1A"
L["eft_weapon_m1a_full"] = "Karabin Springfield Armory M1A 7,62 x 51"
L["eft_weapon_m1a_desc"] = "M1A to cywilna wersja karabinu M14 zaprojektowana i produkowana przez Springfield Armory, Inc. W przeważającej części jest ona identyczna z M14. Najbardziej zauważalną różnicą jest usunięcie przełącznika selektora ognia w M14, czyniąc karabin na stałe samopowtarzalnym. Z broni usunięto również zaczep bagnetu."

L["eft_weapon_mk18"] = "Mk-18 Mjölnir"
L["eft_weapon_mk18_full"] = "Karabin wyborowy SWORD International Mk-18 .338 LM"
L["eft_weapon_mk18_desc"] = "Mk-18 Mod 1 Extreme Distance Capable Semi-Automatic Rifle została zaprojektowany tak, aby wykorzystać możliwości balistyczne nabojów .338 Lapua Magnum, .338 Norma Magnum i .300 Norma Magnum. Pozwala to strzelać na ekstremalnie dalekie odległości w lekkiej i mobilnej półautomatycznej platformie. Dzięki zastosowaniu opracowanego przez SWORD systemu „short-stroke piston” karabin jest precyzyjny, niezawodny i trwały. Mk-18 jest doskonałym wyborem dla zapalonych myśliwych, entuzjastów długich dystansów i strzelców sportowych."

L["eft_weapon_rsass"] = "RSASS"
L["eft_weapon_rsass_full"] = "Karabin wyborowy Remington R11 RSASS 7,62 x 51"
L["eft_weapon_rsass_desc"] = "Niezwykle celny i umożliwiający szybkie prowadzenie ognia karabin wyborowy R11 RSASS (Remington Semi Automatic Sniper System) jest efektem współpracy pomiędzy Remington Arms i JP Enterprises. Możliwość prowadzenia samopowtarzalnego ognia, w połączeniu ze skutecznym zasięgiem wynoszącym 800 metrów, daje ogromną przewagę taktyczną na polu bitwy."

L["eft_weapon_sr25"] = "SR-25"
L["eft_weapon_sr25_full"] = "Karabin wyborowy Knight's Armament Company SR-25 7,62 x 51"
L["eft_weapon_sr25_desc"] = "SR-25 Precision Rifle jest najnowszą ewolucją precyzyjnego samopowtarzalnego karabinu kalibru 7,62 mm × 51 mm NATO. Oburęczny zwalniacz zamka, selektor i zwalniacz magazynka oferuje leworęcznym użytkownikom ergonomiczne zalety charakterystyczne dla AR-15, jak również daje praworęcznym użytkownikom alternatywne metody manipulacji w celu zwiększenia efektywności ruchu. Dwustopniowy spust „Drop-In” służy jako pomoc w precyzyjnym strzelaniu na długich dystansach. Zamek i system gazowy E2 zapewniają najwyższą niezawodność działania zarówno w wersji wytłumionej jak i niewytłumionej."

L["eft_weapon_svds"] = "SWDS"
L["eft_weapon_svds_full"] = "Karabin wyborowy SWDS 7,62 x 54 R"
L["eft_weapon_svds_desc"] = "Powtarzalny karabin wyborowy SWDS (Snajpierskaja Wintowka Dragunowa Składnaja – „karabin wyborowy Dragunowa ze składaną kolbą”) kalibru 7,62 × 54 mm R został zaprojektowany specjalnie dla rosyjskich spadochroniarzy i jednostek sił specjalnych. Wyposażony w tubularną metalową kolbę, składaną na prawą stronę komory zamkowej (wyposażona w nakładkę z tworzywa i stałą bakę) oraz chwyt pistoletowy z tworzywa. Oprócz tego lufa jest masywniejsza, wzmocniono miejsce na komorę zamkową, poprawiono blok komory gazowej i zastosowano krótszy stożkowy tłumik płomienia."

L["eft_weapon_vss"] = "WSS Wintoriez"
L["eft_weapon_vss_full"] = "Karabinek wyborowy WSS Wintoriez 9 x 39"
L["eft_weapon_vss_desc"] = "WSS (Wintowka Snajpierskaja Spiecyalnaja – „specjalny karabinek wyborowy”) to integralnie tłumiony karabinek wyborowy zaprojektowany w latach 80. w Instytucie Badawczym Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) na potrzeby zespołów specjalnego przeznaczenia i grup zadaniowych."

/////// Grenade launchers
L["eft_weapon_fn40gl"] = "FN40GL"
L["eft_weapon_fn40gl_full"] = "Granatnik FN40GL Mk2"
L["eft_weapon_fn40gl_desc"] = "Samodzielny zespół kolby z dołączonym granatnikiem FN40GL Mk2. Przeznaczony jest do użycia pełnej gamy granatów 40 mm w standardzie NATO. Wyprodukowany przez Fabrique Nationale Herstal."

L["eft_weapon_m32a1"] = "MSGL"
L["eft_weapon_m32a1_full"] = "Granatnik M32A1 MSGL 40 mm"
L["eft_weapon_m32a1_desc"] = "Sześciostrzałowy granatnik M32A1 MSGL 40 mm wyprodukowany przez Milkor USA. Granatnik ten wykorzystuje dobrze znaną zasadę działania rewolweru do uzyskania dużej szybkostrzelności, którą można szybko skierować na cel."

/////// Light machine guns
L["eft_weapon_m60e4"] = "Mk 43 Mod 1"
L["eft_weapon_m60e4_full"] = "Lekki karabin maszynowy U.S. Ordnance M60E4 7,62 x 51"
L["eft_weapon_m60e4_desc"] = "M60E4 (Mk 43 Mod 1) to lekki karabin maszynowy kalibru 7,62 × 51 mm, będący modyfikacją M60E3 z bardziej niezawodnym mechanizmem spustowym, możliwością dołączenia optyki i szeregiem innych ulepszeń. M60 otrzymał przydomek „świnia” ze względu na swoje nieporęczne rozmiary i wady konstrukcyjne. Pomimo swoich wad, warianty M60 są nadal używane w niektórych jednostkach wojskowych. Wyprodukowany przez firmę U.S. Ordnance."

L["eft_weapon_m60e6"] = "M60E6"
L["eft_weapon_m60e6_full"] = "Lekki karabin maszynowy U.S. Ordnance M60E6 7,62 x 51"
L["eft_weapon_m60e6_desc"] = "M60E6 to lekki karabin maszynowy kalibru 7,62 × 51 mm, będący modyfikacją M60E4. M60 otrzymał przydomek „świnia” ze względu na swoje nieporęczne rozmiary i wady konstrukcyjne. Pomimo swoich wad, warianty M60 są nadal używane w niektórych jednostkach wojskowych. Wyprodukowany przez firmę U.S. Ordnance."

L["eft_weapon_pkm"] = "PKM"
L["eft_weapon_pkm_full"] = "Karabin maszynowy Kałasznikowa PKM 7,62 x 54 R"
L["eft_weapon_pkm_desc"] = "PKM (Pulemiot Kałasznikowa Modiernizirowannyj – „Zmodernizowany karabin maszynowy Kałasznikowa”) to zmodernizowana wersja karabinu maszynowego PK Kałasznikowa, działająca na amunicję 7,62 × 54 mm R. PKM okazał się potężną, prostą, niezawodną i skuteczną bronią. Był poszukiwany przez wiele dziesięcioleci, począwszy od późnych lat 60. ubiegłego wieku aż do chwili obecnej. Wyprodukowany przez zakłady W.A. Diegtiariowa."

L["eft_weapon_pkp"] = "PKP"
L["eft_weapon_pkp_full"] = "Karabin maszynowy Kałasznikowa PKP 7,62 x 54 R"
L["eft_weapon_pkp_desc"] = "Karabin maszynowy kalibru 7,62 mm PKP „Pieczenieg” jest powszechnie znany ze swojej niezawodności i siły ognia. Sprawdzone rozwiązania techniczne, umiejętnie połączone z zaawansowanym podejściem do ergonomii, pozwoliły zwiększyć nie tylko mobilność strzelca na polu walki, ale także celność ognia na dystansie do 1 500 m, eliminując efekt mirażu termicznego poprzez wyposażenie karabinu maszynowego w chwyt transportowy nad lufą."

L["eft_weapon_rpd"] = "RPD"
L["eft_weapon_rpd_full"] = "Karabinek maszynowy Diegtiariowa RPD 7,62 x 39"
L["eft_weapon_rpd_desc"] = "Ręczny karabinek maszynowy Diegtiariowa kalibru 7,62 × 39 mm. Ten karabin maszynowy został przyjęty przez Armię Radziecką i był używany jako środek wzmocnienia oddziałów i plutonów piechoty od końca lat czterdziestych do początku lat sześćdziesiątych. RPD jest elegancko zaprojektowany, dzięki czemu jest kompaktową, niezawodną i dość potężną bronią wsparcia ogniowego. Wyprodukowany przez zakłady W.A. Diegtiariowa."

L["eft_weapon_rpdn"] = "RPDN"
L["eft_weapon_rpdn_full"] = "Karabinek maszynowy Diegtiariowa RPDN 7,62 x 39"
L["eft_weapon_rpdn_desc"] = "Ręczny karabinek maszynowy Diegtiariowa kalibru 7,62 × 39 mm. Ten karabin maszynowy został przyjęty przez Armię Radziecką i był używany jako środek wzmocnienia oddziałów i plutonów piechoty od końca lat czterdziestych do początku lat sześćdziesiątych. RPD jest elegancko zaprojektowany, dzięki czemu jest kompaktową, niezawodną i dość potężną bronią wsparcia ogniowego. Wariant RPDN jest wyposażony w odchylany montaż typu jaskółczy ogon do instalacji optyki. Wyprodukowany przez zakłady W.A. Diegtiariowa."

L["eft_weapon_rpk16"] = "RPK-16"
L["eft_weapon_rpk16_full"] = "Ręczny karabin maszynowy RPK-16 5,45 x 39"
L["eft_weapon_rpk16_desc"] = "Ręczny karabin maszynowy RPK-16 (Rucznoj Pulemiot Kałasznikowa 16 – „ręczny karabin maszynowy Kałasznikowa 16”) to najnowszy rosyjski ręczny karabin maszynowy kalibru 5,45 × 39 mm. Niektóre kluczowe cechy tej nowej broni to szybko odłączane lufy, poprawiona ergonomia oraz szyny Weaver na łożu i pokrywie komory zamkowej."

/////// Shotguns
L["eft_weapon_aa12gen1"] = "AA-12 Gen 1"
L["eft_weapon_aa12gen1_full"] = "Strzelba automatyczna MPS Auto Assault-12 Gen 1 12 ga"
L["eft_weapon_aa12gen1_desc"] = "AA-12 (Auto Assault-12) to niezawodna w pełni automatyczna strzelba 12 gauge. Pierwsza generacja posiada wysoko zamontowane wbudowane przyrządy celownicze. Strzelba ta wyróżnia się akumulacją impulsu odrzutu, co sprawia, że odrzut jest płynny bez poświęcania szybkostrzelności i mocy obalającej. AA-12 jest przeznaczona dla jednostek wojskowych i policyjnych. Wyprodukowana przez firmę Military Police Systems."

L["eft_weapon_aa12gen2"] = "AA-12 Gen 2"
L["eft_weapon_aa12gen2_full"] = "Strzelba automatyczna MPS Auto Assault-12 Gen 2 12 ga"
L["eft_weapon_aa12gen2_desc"] = "AA-12 (Auto Assault-12) to niezawodna w pełni automatyczna strzelba 12 gauge. Druga generacja posiada montaż do instalacji optyki. Strzelba ta wyróżnia się akumulacją impulsu odrzutu, co sprawia, że odrzut jest płynny bez poświęcania szybkostrzelności i mocy obalającej. AA-12 jest przeznaczona dla jednostek wojskowych i policyjnych. Wyprodukowana przez firmę Military Police Systems."

L["eft_weapon_ks23"] = "KS-23M"
L["eft_weapon_ks23_full"] = "Strzelba powtarzalna TOZ KS-23M 23 x 75"
L["eft_weapon_ks23_desc"] = "KS-23 to rosyjska strzelba powtarzalna, choć ze względu na zastosowanie lufy gwintowanej jest oficjalnie oznaczana przez rosyjskie wojsko jako karabinek. KS to skrót od Karabin Spiecyalnyj, „karabinek specjalny”. Słynie z dużego kalibru, wystrzeliwując nabój 23 mm, co odpowiada 6,27 gauge przy zastosowaniu brytyjskich i amerykańskich standardów miar śrutowych i około 4 gauge przy zastosowaniu obecnych standardów europejskich (opartych na metrycznych tabelach CIP), co czyni ją największą strzelbą gładkolufową obecnie używaną."

L["eft_weapon_m3super90"] = "M3 Super 90"
L["eft_weapon_m3super90_full"] = "Strzelba Benelli M3 Super 90 dual-mode 12 ga"
L["eft_weapon_m3super90_desc"] = "Benelli M3 S90 to strzelba z dwoma trybami, zaprojektowana i wyprodukowana przez firmę Benelli. Model M3 wyróżnia się tym, że pozwala użytkownikowi na wybór pomiędzy trybem półautomatycznym a powtarzalnym. Strzelby Benelli wykazują doskonałe parametry balistyczne, a wykończenie i staranne wykonanie są uosobieniem tradycyjnego włoskiego stylu."

L["eft_weapon_m590a1"] = "590A1"
L["eft_weapon_m590a1_full"] = "Strzelba powtarzalna Mossberg 590A1 12 ga"
L["eft_weapon_m590a1_desc"] = "Mossberg 500 Series to jedna z najbardziej znanych i rozpowszechnionych strzelb powtarzalnych na świecie. Chroni twój trawnik od 1961 roku."

L["eft_weapon_m870"] = "M870"
L["eft_weapon_m870_full"] = "Strzelba powtarzalna Remington Model 870 12 ga"
L["eft_weapon_m870_desc"] = "Strzelba powtarzalna Remington Model 870. Powszechnie dostępna i wykorzystywana do strzelectwa sportowego, łowiectwa i samoobrony oraz wykorzystywana przez organy ścigania i organizacje wojskowe na całym świecie. Wyprodukowana przez firmę Remington Arms Company, LLC."

L["eft_weapon_mp18"] = "MP-18"
L["eft_weapon_mp18_full"] = "Karabin jednostrzałowy MP-18 7,62 x 54 R"
L["eft_weapon_mp18_desc"] = "MP-18 to legendarny radziecki karabin jednostrzałowy. Karabin ten zachowuje się doskonale w każdych warunkach pogodowych, nigdy nie stwierdzono żadnych awarii czy usterek."

L["eft_weapon_mp431c"] = "MP-43-1C"
L["eft_weapon_mp431c_full"] = "Strzelba dwulufowa MP-43-1C 12 ga"
L["eft_weapon_mp431c_desc"] = "Marzenie każdego myśliwego. Klasyczna, dwulufowa ślicznotka, prosta i elegancka. Zasilana amunicją 12 gauge."

L["eft_weapon_mp133"] = "MP-133"
L["eft_weapon_mp133_full"] = "Strzelba powtarzalna MP-133 12 ga"
L["eft_weapon_mp133_desc"] = "Wielostrzałowa powtarzalna strzelba MP-133 produkowana przez zakłady Iżmech. Jest ewolucją starszej strzelby powtarzalnej IŻ-81 i jest przeznaczona głównie na rynek cywilny i ochrony. Uznawana za wyjątkową w swojej klasie przez mechanizm zatrzymania suwadła w tylnej pozycji po wystrzeleniu ostatniego pocisku."

L["eft_weapon_mp153"] = "MP-153"
L["eft_weapon_mp153_full"] = "Strzelba samopowtarzalna MP-153 12 ga"
L["eft_weapon_mp153_desc"] = "Gładkolufowa wielostrzałowa strzelba samopowtarzalna MP-153, produkowana przez zakłady Iżmech. Niezawodna i praktyczna broń służąca do polowań oraz samoobrony."

L["eft_weapon_mp155"] = "MP-155"
L["eft_weapon_mp155_full"] = "Strzelba samopowtarzalna MP-155 12 ga"
L["eft_weapon_mp155_desc"] = "Rosyjska samopowtarzalna strzelba gładkolufowa MP-155 kalibru 12 gauge. Pistolet waży mniej niż jego poprzednik MP-153 i charakteryzuje się zwiększoną ergonomią oraz łatwym do wymiany mechanizmem lufy. Nowa konstrukcja ułatwia również obsługę dla osób leworęcznych. Wyprodukowana przez zakłady Iżmech."

L["eft_weapon_mts25512"] = "MC-255-12"
L["eft_weapon_mts25512_full"] = "Strzelba MC-255 12 ga"
L["eft_weapon_mts25512_desc"] = "MC-255-12 to unikalna dla rynku rosyjskiego strzelba rewolwerowa kalibru 12 gauge."

L["eft_weapon_saiga12k"] = "Sajga-12K"
L["eft_weapon_saiga12k_full"] = "Strzelba samopowtarzalna Sajga-12K wer.10 12 ga"
L["eft_weapon_saiga12k_desc"] = "Strzelba samopowtarzalna Sajga kalibru 12 gauge ze składanym magazynkiem, wyposażona w blokadę bezpieczeństwa mechanizmu strzelania, która umożliwia oddanie strzału tylko z pozycji rozłożonego magazynka. Posiada krótką lufę o długości 430 mm."

L["eft_weapon_saiga12kfa"] = "Saiga-12K FA"
L["eft_weapon_saiga12kfa_full"] = "Saiga-12K 12ga automatic shotgun"
L["eft_weapon_saiga12kfa_desc"] = "A modification of the Saiga-12K smoothbore shotgun, enabling fully automatic fire. Hell of a beast."

L["eft_weapon_toz106"] = "TOZ-106"
L["eft_weapon_toz106_full"] = "Strzelba powtarzalna TOZ-106 20 ga"
L["eft_weapon_toz106_desc"] = "Jednolufowa strzelba myśliwska z przesuwnym ryglem zamka, kaliber 20 gauge. Znana także jako „Śmierć Przewodniczącego” ze względu na swoje niewielkie rozmiary."

/////// Submachine guns
L["eft_weapon_mp5"] = "MP5"
L["eft_weapon_mp5_full"] = "Pistolet maszynowy HK MP5 9 x 19 (Navy, 3-nabojowa seria)"
L["eft_weapon_mp5_desc"] = "Pistolet maszynowy HK MP5 w wersji z trybem ognia Navy 3 Round Burst, który cechuje się serią 3 pocisków. Doceniany przez wielu model pistoletu maszynowego, znany głównie jako broń jednostki GSG 9 (i podobnych jej na całym świecie). Broń zyskała na popularności dzięki wykorzystaniu w wielu filmach czy grach wideo."

L["eft_weapon_mp5kn"] = "MP5K-N"
L["eft_weapon_mp5kn_full"] = "Pistolet maszynowy HK MP5K-N 9 x 19"
L["eft_weapon_mp5kn_desc"] = "HK MP5K-N (K od niemieckiego słowa Kurz – „krótki” a N od Navy oznaczającego konfigurację z 3-nabojową serią, przyjętego dla United States Navy) jest krótszą wersją pistoletu maszynowego MP5, która została zaprojektowana do walki w ciasnych pomieszczeniach na użytek służb specjalnych."

L["eft_weapon_mp7a1"] = "MP7A1"
L["eft_weapon_mp7a1_full"] = "Pistolet maszynowy HK MP7A1 4,6 x 30"
L["eft_weapon_mp7a1_desc"] = "Pistolet maszynowy HK MP7 jest niezwykle kompaktowy, lekki, może być używany w ciasnych przestrzeniach i praktycznie nie ma odrzutu. Może być noszony przez długi czas, co czyni go idealną bronią do obrony osobistej każdego żołnierza. Uzbrojeni w tę broń operatorzy są przygotowani na wiele operacji. Wyprodukowany przez firmę Heckler & Koch."

L["eft_weapon_mp7a2"] = "MP7A2"
L["eft_weapon_mp7a2_full"] = "Pistolet maszynowy HK MP7A2 4,6 x 30"
L["eft_weapon_mp7a2_desc"] = "Pistolet maszynowy MP7A2 jest kolejną modyfikacją pistoletu maszynowego MP7A1. Kluczową cechą tego pistoletu maszynowego jest zastąpienie standardowego składanego chwytu przedniego na szynę Picatinny, umożliwiającą montaż różnych pionowych chwytów przednich. Wyprodukowany przez firmę Heckler & Koch."

L["eft_weapon_mp9"] = "MP9"
L["eft_weapon_mp9_full"] = "Pistolet maszynowy B&T MP9 9 x 19"
L["eft_weapon_mp9_desc"] = "MP9 (Maschinenpistole 9 mm, niem. pistolet maszynowy) to pistolet maszynowy kalibru 9 × 19 mm Parabellum zaprojektowany i produkowany przez firmę Brügger & Thomet ze Szwajcarii. Doskonały wybór na Broń Ochrony Osobistej (PDW)."

L["eft_weapon_mp9n"] = "MP9-N"
L["eft_weapon_mp9n_full"] = "Pistolet maszynowy B&T MP9-N 9 x 19"
L["eft_weapon_mp9n_desc"] = "MP9-N to dalsza modyfikacja pistoletu maszynowego MP9, który został dopracowany i zoptymalizowany we współpracy z jednostkami specjalnymi policji i wojska. MP9-N jest obecnie w służbie zespołów ochrony osobistej, a także zespołów SWAT na całym świecie. Jest to również doskonały wybór jako Broń Ochrony Osobistej (PDW)."

L["eft_weapon_mpx"] = "MPX"
L["eft_weapon_mpx_full"] = "Pistolet maszynowy SIG MPX 9 x 19"
L["eft_weapon_mpx_desc"] = "Pistolet maszynowy SIG Sauer MPX może pochwalić się niespotykaną szybkością działania w podobnej formie, jak karabinki systemu AR. Krótki skok tłoczyska pozwala broni wykorzystać całą gamę amunicji 9 mm, bez żadnych korekt zaworu gazowego. Pełnowymiarowy montaż zapewnia możliwość instalacji szerokiej gamy celowników optycznych oraz kolimatorowych."

L["eft_weapon_p90"] = "P90"
L["eft_weapon_p90_full"] = "Pistolet maszynowy FN P90 5,7 x 28"
L["eft_weapon_p90_desc"] = "Pistolet maszynowy FN P90, znany również jako FN Project 1990, to kompaktowa Broń Ochrony Osobistej (PDW) zaprojektowana i produkowana przez FN Herstal w Belgii. Stworzony jako odpowiedź na zapotrzebowanie NATO jako zastępstwo broni opartych o kaliber 9 × 19 mm Parabellum, P90 został zaprojektowany jako kompaktowa, ale potężna broń palna dla załóg pojazdów, operatorów broni zespołowej, personelu wsparcia, sił specjalnych oraz grup antyterrorystycznych."

L["eft_weapon_pp9"] = "PP-9 „Klin”"
L["eft_weapon_pp9_full"] = "Pistolet maszynowy PP-9 „Klin” 9 x 18 PMM"
L["eft_weapon_pp9_desc"] = "Pistolet maszynowy PP-9 Klin jest dalszą ewolucją pistoletu maszynowego Kedr. Posiada większą szybkostrzelność, a jego komora została przystosowana do użycia naboju 9 × 18 mm PMM. Produkowany był w latach 1996-2002 na zlecenie Ministerstwa Spraw Wewnętrznych."

L["eft_weapon_pp1901"] = "PP-19-01"
L["eft_weapon_pp1901_full"] = "Pistolet maszynowy PP-19-01 „Witiaź” 9 x 19"
L["eft_weapon_pp1901_desc"] = "PP-19-01, znany również jako „Witiaź” to rosyjski pistolet maszynowy kalibru 9 × 19 opracowany w 2004 roku przez zakłady Iżmasz na podstawie platformy AK. Standardowy pistolet maszynowy w wielu jednostkach organów ścigania i jednostkach wojskowych Federacji Rosyjskiej."

L["eft_weapon_pp91"] = "PP-91 „Kedr”"
L["eft_weapon_pp91_full"] = "Pistolet maszynowy PP-91 „Kedr” 9 x 18 PM"
L["eft_weapon_pp91_desc"] = "Pistolet maszynowy PP-91 Kedr kalibru 9 × 18 mm PM zaprojektowany przez Jewgienija Dragunowa na początku lat 90. na zlecenie MSW i produkowany w ZMZ (Złatoustowskij Maszynostroitielnyj Zawod – „Złatouski Zakład Budowy Maszyn”). Ten pistolet maszynowy ma prostą, ale skuteczną konstrukcję. Jego niewielka waga sprawia, że jest wygodniejszy w noszeniu bez wpływu na jego osiągi, a także zapewnia dużą szybkostrzelność bez wpływu na odrzut. Dzięki tym cechom jest nadal używany jako broń służbowa w prawie wszystkich rosyjskich organach ścigania."

L["eft_weapon_pp9101"] = "PP-91-01 „Kedr-B”"
L["eft_weapon_pp9101_full"] = "Pistolet maszynowy PP-91-01 „Kedr-B” 9 x 18 PM"
L["eft_weapon_pp9101_desc"] = "Rzadka, wytłumiona wersja pistoletu maszynowego PP-91 Kedr, oznaczona jako PP-91-01 Kedr-B."

L["eft_weapon_ppsh41"] = "PPSz41"
L["eft_weapon_ppsh41_full"] = "Pistolet maszynowy PPSz-41 7,62 x 25"
L["eft_weapon_ppsh41_desc"] = "PPSz-41 (Pistolet-Pulemiot Szpagina 1941 goda – „pistolet maszynowy Szpagina z 1941 roku”) to radziecki pistolet maszynowy zaprojektowany przez Georgija Szpagina jako tania, niezawodna i uproszczona alternatywa dla PPD-40."

L["eft_weapon_saiga9"] = "Sajga-9"
L["eft_weapon_saiga9_full"] = "Pistolet Sajga-9 9 x 19"
L["eft_weapon_saiga9_desc"] = "Pistolet Sajga-9 został opracowany jako samopowtarzalny wariant pistoletu maszynowego PP-19-01 „Witiaź” na rynek cywilny i przeznaczony do celów strzelectwa sportowego i strzelania do celu."

L["eft_weapon_veresk"] = "SR-2M"
L["eft_weapon_veresk_full"] = "Pistolet maszynowy SR-2M Wieriesk 9 x 21"
L["eft_weapon_veresk_desc"] = "SR-2M Wieriesk to kompaktowy pistolet maszynowy zaprojektowany pod potężny przeciwpancerny kaliber 9 × 21 mm na zlecenie FSB i FSO Federacji Rosyjskiej. Ten pistolet maszynowy jest częścią zestawu pistoletów o wysokiej wydajności przeznaczonych dla sił specjalnych. Wyposażony w składany chwyt przedni. Wyprodukowany w Instytucie Badawczym Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz)."

L["eft_weapon_stm9"] = "STM-9"
L["eft_weapon_stm9_full"] = "Pistolet Sojuz-TM STM-9 Gen.2 9 x 19"
L["eft_weapon_stm9_desc"] = "Pistolet na bazie pistoletu maszynowego o doskonałych parametrach już od samego początku użytkowania. Zaprojektowany przy udziale brązowego medalisty świata w „Semi-Auto Rifle” Wadima Michajłowa. Dokładność, szybkość, komfort odrzutu. Kompatybilny z magazynkami do Glock 9 × 19 mm. Wyprodukowany przez firmę Sojuz-TM."

L["eft_weapon_ump45"] = "UMP 45"
L["eft_weapon_ump45_full"] = "Pistolet maszynowy HK UMP .45 ACP"
L["eft_weapon_ump45_desc"] = "Pistolet maszynowy Heckler & Koch UMP został zaprojektowany przez niemiecką firmę Heckler & Koch w latach 90. jako lżejszy i tańszy zamiennik do MP5. Wersja ta jest przeznaczona do strzelania nabojem kalibru .45 ACP i ma zmniejszoną szybkostrzelność do 600 strzałów/minutę."

L["eft_weapon_uzi"] = "UZI"
L["eft_weapon_uzi_full"] = "Pistolet maszynowy IWI UZI 9 x 19"
L["eft_weapon_uzi_desc"] = "Izraelski pistolet maszynowy kalibru 9 × 19 mm z systemem zamka otwartego. Bardzo innowacyjny produkt swoich czasów, który zyskał dużą popularność dzięki swojej niezawodności i prostocie konstrukcji. Mimo że jest dość przestarzały, nadal jest dość popularny na całym świecie."

L["eft_weapon_uzipro"] = "UZI PRO Pistol"
L["eft_weapon_uzipro_full"] = "Pistolet IWI UZI PRO Pistol 9 x 19"
L["eft_weapon_uzipro_desc"] = "Pistolet UZI PRO Pistol (UPP9S) to w pełni automatyczna konwersja pistoletu maszynowego 9 × 19 mm Parabellum dla organów ścigania i wojska. Ten ultrakompaktowy pistolet jest ewolucją pełnowymiarowego pistoletu maszynowego UZI, idealnego do ukrytego noszenia i charakteryzującego się dużą szybkostrzelnością. Wyprodukowany przez firmę Israel Weapon Industries."

L["eft_weapon_uziprosmg"] = "UZI PRO SMG"
L["eft_weapon_uziprosmg_full"] = "Pistolet maszynowy IWI UZI PRO SMG 9 x 19"
L["eft_weapon_uziprosmg_desc"] = "UZI PRO SMG to pistolet maszynowy przeznaczony dla organów ścigania i wojska. Ten ultrakompaktowy pistolet maszynowy jest ewolucją pełnowymiarowego pistoletu maszynowego UZI, idealnego do ukrytego noszenia i charakteryzującego się dużą szybkostrzelnością. Wyprodukowany przez firmę Israel Weapon Industries."

L["eft_weapon_vector45"] = "Vector .45ACP"
L["eft_weapon_vector45_full"] = "Pistolet maszynowy TDI KRISS Vector Gen.2 .45 ACP"
L["eft_weapon_vector45_desc"] = "Pistolet maszynowy KRISS Vector jest idealnym wyborem dla organów ścigania i wojska poszukujących kontrolowanego i kompaktowego systemu broni do walki w bliskim starciu. Niska oś lufy i system amortyzowania odrzutu Super V pozwalają na kontrolowanie strzałów podczas strzelania w ogniu ciągłym lub na szybkie samopowtarzalne strzały pomocnicze. Kompatybilny z magazynkami Glock kalibru .45 ACP."

L["eft_weapon_vector9"] = "Vector 9 × 19"
L["eft_weapon_vector9_full"] = "Pistolet maszynowy TDI KRISS Vector Gen.2 9 x 19"
L["eft_weapon_vector9_desc"] = "Pistolet maszynowy KRISS Vector jest idealnym wyborem dla organów ścigania i wojska poszukujących kontrolowanego i kompaktowego systemu broni do walki w bliskim starciu. Niska oś lufy i system amortyzowania odrzutu Super V pozwalają na kontrolowanie strzałów podczas strzelania w ogniu ciągłym lub na szybkie samopowtarzalne strzały pomocnicze. Kompatybilny z magazynkami Glock kalibru 9 × 19 mm."

/////// Pistols
L["eft_weapon_apb"] = "APB"
L["eft_weapon_apb_full"] = "Wytłumiony pistolet maszynowy APB 9 x 18 PM"
L["eft_weapon_apb_desc"] = "Pistolet APB (Awtomaticzeskij Pistolet Biesszumnyj – „wyciszony pistolet automatyczny”, indeks GRAU 6P13) to wyciszona wersja pistoletu maszynowego Stieczkina, szeroko wykorzystywana przez różne rosyjskie siły specjalne."

L["eft_weapon_aps"] = "APS"
L["eft_weapon_aps_full"] = "Pistolet maszynowy Stechkin APS 9 x 18 PM"
L["eft_weapon_aps_desc"] = "Pistolet automatyczny APS (Awtomaticzeskij pistolet Stieczkina – „automatyczny pistolet Stieczkina” indeks GAU 56-A-126) to radziecki pistolet maszynowy kalibru 9 × 18 mm PM, opracowany pod koniec 1940 roku przez Igora Stieczkina. APS przeznaczony jest do uzbrojenia oficerów biorących bezpośredni udział w działaniach bojowych, a także żołnierzy i sierżantów niektórych jednostek specjalnych."

L["eft_weapon_blicky"] = "Blicky"
L["eft_weapon_blicky_full"] = "Zabawkowy pistolet 20 x 1 mm"
L["eft_weapon_blicky_desc"] = "Plastikowy samopowtarzalny zabawkowy pistolet strzelający krążkami 20 × 1 mm. Przeznaczony dla dzieci powyżej 5 roku życia. Wyprodukowany w ZSRR."

L["eft_weapon_deaglel5357"] = "Desert Eagle L5"
L["eft_weapon_deaglel5357_full"] = "Pistolet Magnum Research Desert Eagle L5 .357"
L["eft_weapon_deaglel5357_desc"] = "Desert Eagle L5 to lekka modyfikacja sportowego pistoletu myśliwskiego kalibru .357 Magnum. Pistolet ten jest ogromny, ciężki i nie jest najbardziej praktyczny w obsłudze, ale jednocześnie jest to absolutnie wyjątkowa broń krótkolufowa, która niewątpliwie stała się częstym gościem w grach wideo ze względu na swój brutalny wygląd i imponujące rozmiary. Desert Eagle nie zdobył żadnego uznania wojskowego, ale zasłużenie stał się jednym z najbardziej znanych pistoletów na świecie. Wyprodukowany przez firmę Magnum Research."

L["eft_weapon_deaglel550ae"] = "Desert Eagle L5"
L["eft_weapon_deaglel550ae_full"] = "Pistolet Magnum Research Desert Eagle L5 .50 AE"
L["eft_weapon_deaglel550ae_desc"] = "Desert Eagle L5 to lekka modyfikacja sportowego pistoletu myśliwskiego kalibru .50 Action Express. Pistolet ten jest ogromny, ciężki i nie jest najbardziej praktyczny w obsłudze, ale jednocześnie jest to absolutnie wyjątkowa broń krótkolufowa, która niewątpliwie stała się częstym gościem w grach wideo ze względu na swój brutalny wygląd i imponujące rozmiary. Desert Eagle nie zdobył żadnego uznania wojskowego, ale zasłużenie stał się jednym z najbardziej znanych pistoletów na świecie. Wyprodukowany przez firmę Magnum Research."

L["eft_weapon_deaglel6"] = "Desert Eagle L6"
L["eft_weapon_deaglel6_full"] = "Pistolet Magnum Research Desert Eagle L6 .50 AE"
L["eft_weapon_deaglel6_desc"] = "Desert Eagle L6 to modyfikacja sportowego pistoletu myśliwskiego kalibru .50 Action Express. Pistolet ten jest ogromny, ciężki i nie jest najbardziej praktyczny w obsłudze, ale jednocześnie jest to absolutnie wyjątkowa broń krótkolufowa, która niewątpliwie stała się częstym gościem w grach wideo ze względu na swój brutalny wygląd i imponujące rozmiary. Desert Eagle nie zdobył żadnego uznania wojskowego, ale zasłużenie stał się jednym z najbardziej znanych pistoletów na świecie. Wyprodukowany przez firmę Magnum Research."

L["eft_weapon_deaglel6wts"] = "Desert Eagle L6"
L["eft_weapon_deaglel6wts_full"] = "Pistolet Magnum Research Desert Eagle L6 .50 AE (WTS)"
L["eft_weapon_deaglel6wts_desc"] = "Desert Eagle L6 to modyfikacja sportowego pistoletu myśliwskiego kalibru .50 Action Express. Pistolet ten jest ogromny, ciężki i nie jest najbardziej praktyczny w obsłudze, ale jednocześnie jest to absolutnie wyjątkowa broń krótkolufowa, która niewątpliwie stała się częstym gościem w grach wideo ze względu na swój brutalny wygląd i imponujące rozmiary. Desert Eagle nie zdobył żadnego uznania wojskowego, ale zasłużenie stał się jednym z najbardziej znanych pistoletów na świecie. Wyprodukowany przez firmę Magnum Research. Wersja White Tiger Stripes."

L["eft_weapon_deaglexix"] = "Desert Eagle Mk XIX"
L["eft_weapon_deaglexix_full"] = "Pistolet Magnum Research Desert Eagle Mk XIX .50"
L["eft_weapon_deaglexix_desc"] = "Desert Eagle (Mk XIX) to trzecia modyfikacja sportowego pistoletu myśliwskiego kalibru .50 Action Express. Pistolet ten jest ogromny, ciężki i nie jest najbardziej praktyczny w obsłudze, ale jednocześnie jest to absolutnie wyjątkowa broń krótkolufowa, która niewątpliwie stała się częstym gościem w grach wideo ze względu na swój brutalny wygląd i imponujące rozmiary. Desert Eagle nie zdobył żadnego uznania wojskowego, ale zasłużenie stał się jednym z najbardziej znanych pistoletów na świecie. Wyprodukowany przez firmę Magnum Research."

L["eft_weapon_fn57"] = "FN 5-7"
L["eft_weapon_fn57_full"] = "Pistolet FN Five-seveN MK2 5,7 x 28"
L["eft_weapon_fn57_desc"] = "FN Five-Seven, oznaczony jako Five-seveN, to samopowtarzalny pistolet zaprojektowany i produkowany przez FN Herstal w Belgii. Pistolet został opracowany na początku lat 90. i posiada kutą na zimno lufę, która jest chromowana w celu wydłużenia czasu użytkowania. Polimerowy szkielet Five-Seven oferuje działanie typu single action (pojedynczego działania), niski odczuwalny odrzut, 20-nabojowy magazynek i jest wyposażony w obustronne, montowane z przodu ręczne bezpieczniki oraz szynę akcesoryjną do montowania latarek taktycznych i laserów."

L["eft_weapon_glock17"] = "Glock 17"
L["eft_weapon_glock17_full"] = "Pistolet Glock 17 9 x 19"
L["eft_weapon_glock17_desc"] = "Glock 17 to Austriacki pistolet zaprojektowany przez firmę Glock dla potrzeb armii Austriackiej. Dzięki swoim imponującym charakterystykom bojowym oraz niezawodności zyskał szerokie uznanie i popularność również jako broń policyjna, strzelectwa sportowego oraz samoobrony."

L["eft_weapon_glock18c"] = "Glock 18C"
L["eft_weapon_glock18c_full"] = "Pistolet maszynowy Glock 18C 9 x 19"
L["eft_weapon_glock18c_desc"] = "Glock 18 to automatyczny wariant pistoletu Glock 17. Broń ta jest często używana wraz z wydłużonym 33-nabojowym magazynkiem, chociaż pasują do niego wszystkie magazynki na 10, 17 i 19 naboi z Glock 17. Posiada on też wyciętą dziurę na przedniej części zamka, podobne do tych w rodzinie Glock 17, lecz Glock 18 ma zamek standardowej długości. Owa dziura na zamku pozwala na cztery, coraz większe (zaczynając od tyłu) wcięcia kompensujące, które kieruje wylatujące gazy prochowe w górę, powalając na większą kontrolę nad tym szybkostrzelnym pistoletem."

L["eft_weapon_glock19x"] = "Glock 19X"
L["eft_weapon_glock19x_full"] = "Pistolet Glock 19X 9 x 19"
L["eft_weapon_glock19x_desc"] = "Glock 19X to austriacki pistolet oparty na Glock 19 Modular Handgun System, opracowanym przez firmę Glock. Glock 19X jest hybrydą modeli Glock 17 i Glock 19: mechanizm ryglowy i lufa z modelu 19, a długi chwyt z pierwszego modelu 17. Ponadto Glock 19X pozbawiony jest zagłębień pod palce, ale posiada pętlę na linkę zabezpieczającą. Pistolet wykonywany jest w kolorze Coyote."

L["eft_weapon_m9a3"] = "M9A3"
L["eft_weapon_m9a3_full"] = "Pistolet Beretta M9A3 9 x 19"
L["eft_weapon_m9a3_desc"] = "Beretta M9A3 to najnowszy dodatek do pistoletów z serii M9. Została zaprojektowana dla sił wojskowych i policji, jak i dla sportu i obrony domowej. Głównymi cechami generacji A3 jest ulepszona ergonomiczność i bardziej trwała powłoka FDE."

L["eft_weapon_m45a1"] = "M45A1"
L["eft_weapon_m45a1_full"] = "Pistolet Colt M45A1 .45 ACP"
L["eft_weapon_m45a1_desc"] = "Pistolet MEU(SOC), („Marine Expeditionary Unit”; „Special Operations Capable”) oficjalnie oznaczony jako M45 MEUSOC, jest zasilanym magazynkiem, działającym na zasadzie odrzutu, samopowtarzalnym pistoletem kalibru .45 ACP. Jest to wariant M1911 i od 1985 roku stanowi standardową broń boczną dla Force Recon Element jednostki Marine Expeditionary Unit Korpusu Piechoty Morskiej Stanów Zjednoczonych. Ulepszony M45A1 posiada kilka zmian w stosunku do oryginalnego projektu M1911A1. Jedną z nich jest podwójny system sprężyn powrotnych, który rozkłada siłę odrzutu pocisku .45 ACP obniżając szczytową siłę uderzenia odrzutu. Posiada również 3-punktowe trytowe przyrządy celownicze, 5-calową lufę typu National Match, obustronny bezpiecznik, szynę Picatinny oraz wykończenie Cerakote w kolorze desert tan."

L["eft_weapon_m1911a1"] = "M1911A1"
L["eft_weapon_m1911a1_full"] = "Pistolet Colt M1911A1 .45 ACP"
L["eft_weapon_m1911a1_desc"] = "Powszechnie znany jako „1911”, M1911 jest jednym z najbardziej znanych pistoletów na świecie. Przeszedł on przez obie wojny światowe jako standardowy pistolet armii amerykańskiej i pomimo zastąpienia go w 1986 roku, jego dalsze odmiany są nadal używane jako broń boczna różnych sił specjalnych USA. M1911A1 jest drugą generacją oryginalnego pistoletu M1911. Po I wojnie światowej wojskowy Model 1911 przeszedł różne zmiany, w tym krótszy spust z nacięciami na ramie, ulepszone celowniki mechaniczne, łukowata obudowa sprężyny powrotnej i przeprojektowany bezpiecznik."

L["eft_weapon_mp443"] = "MP-443 „Gracz”"
L["eft_weapon_mp443_full"] = "Pistolet Jarygina MP-443 „Gracz” 9 x 19"
L["eft_weapon_mp443_desc"] = "PJa MP-443 (Pistolet Jarygina MP-443, indeks GRAU 6P35) powszechnie znany jako „Gracz” (Gawron) to rosyjski samopowtarzalny pistolet kalibru 9 × 19 mm. Został zaprojektowany przez Władimira Jarygina w latach 90. i przyjęty jako standardowa broń boczna przez rosyjskie wojsko, organy ścigania i jednostki specjalne MSW. Posiada magazynek o dużej pojemności i może być wyposażony w montaż Zenit B-8 do instalacji dodatkowych akcesoriów pod lufą."

L["eft_weapon_p226r"] = "P226R"
L["eft_weapon_p226r_full"] = "Pistolet SIG P226R 9 x 19"
L["eft_weapon_p226r_desc"] = "P226R to pełnowymiarowy pistolet służbowy wyprodukowany przez firmę SIG Sauer. Kalibru 9 × 19 mm Parabellum, posiada montaż na szynę Picatinny na spodzie obudowy. Jest to standardowa broń służbowa Navy SEALs."

L["eft_weapon_pb"] = "PB"
L["eft_weapon_pb_full"] = "Wytłumiony pistolet PB 9 x 18 PM"
L["eft_weapon_pb_desc"] = "Pistolet PB (Pistolet Biesszumnyj – „wyciszony pistolet”, indeks GRAU 6P9) został zaprojektowany z dwuczęściowym tłumikiem, głównym tłumikiem i sekcją wbudowaną w lufę, co pozwala na bezproblemową obsługę broni nawet bez założonego głównego tłumika, ale obsługa broni w ten sposób nie usunie dźwięku wystrzału ani błysku wylotu. Przeznaczony był dla wojskowych grup rozpoznawczych oraz pracowników KGB ZSRR i wprowadzony do służby w 1967 roku. Obecnie nadal eksploatowany przez siły specjalne FSB i wojska wewnętrzne MSW."

L["eft_weapon_pl15"] = "PL-15"
L["eft_weapon_pl15_full"] = "Pistolet Lebiediewa PL-15 9 x 19"
L["eft_weapon_pl15_desc"] = "Pistolet Lebiediewa PL-15 to rosyjski pistolet samopowtarzalny w kalibrze 9 × 19 mm, opracowany przez zespół konstruktorów z koncernu Kałasznikowa pod kierownictwem Dmitrija Lebiediewa na potrzeby rosyjskich organów ścigania."

L["eft_weapon_pmt"] = "PM (g)"
L["eft_weapon_pmt_full"] = "Pistolet Makarowa (g) 9 x 18 PM"
L["eft_weapon_pmt_desc"] = "Niemalże mityczny pistolet Makarowa z wydłużoną gwintowaną lufą umożliwiającą zamontowanie tłumika dźwięku. Niektórzy twierdzą, że była to limitowana seria produkowana w Bułgarii, inni zaś obstają przy tym, że był to pistolet wschodnioniemiecki lub nawet ręcznie wykonany. W jaki sposób znalazł się w obwodzie norwińskim, tego nikt żywy nie jest w stanie powiedzieć."

L["eft_weapon_pm"] = "PM"
L["eft_weapon_pm_full"] = "Pistolet Makarowa 9 x 18 PM"
L["eft_weapon_pm_desc"] = "Sprawdzony pistolet PM (Pistolet Makarowa, indeks GAU 56-A-125). Ze względu na wszechobecność zarówno pistoletu jak i amunicji do niego, a także wyjątkową niezawodność, niewielką wagę i kompaktowe rozmiary, PM nadal znajduje szerokie zastosowanie zarówno w policji, wojsku, jak i siłach bezpieczeństwa. Jedyną wadą jest niewielkie rażenie obalające."

L["eft_weapon_gyurza"] = "SR-1MP"
L["eft_weapon_gyurza_full"] = "Pistolet Sierdiukowa SR-1MP Giurza 9 x 21"
L["eft_weapon_gyurza_desc"] = "Pistolet SR-1MP (indeks GRAU 6P53), znany również pod nazwą „Giurza” (Żmija) lub SPS (Samozariadnyj Pistolet Sierdiukowa – „sampowtarzalny pistolet Sierdiukowa”), został zaprojektowany przez P. Sierdiukowa i I. Bielajewa z silnym nabojem 9 × 21 mm w celu zastąpienia pistoletu maszynowego APS używanego przez siły specjalne Federacji Rosyjskiej. Model ten może być wyposażony w zestaw montaży do dołączenia dodatkowego wyposażenia, a także jako podstawa do instalacji tłumika."

L["eft_weapon_tt"] = "TT"
L["eft_weapon_tt_full"] = "Pistolet TT-33 7,62 x 25 TT"
L["eft_weapon_tt_desc"] = "Legendarny pistolet. Był świadkiem wielu konfliktów zbrojnych, a mimo to jest wciąż używany w niektórych częściach świata, w takim wariancie bądź innym. Klasyczny TT-33 oferuje system krótkiego odrzutu lufy Browninga, ale poza tym faktem jego konstrukcja jest unikatowa – prosty w budowie, z mechanizmem spustowym pojedynczego działania i jedynie blokadą kurka, jest w stanie wytrzymać prawie wszystko. Dzięki silnej amunicji 7,62 × 25 mm i stosunkowo długiej lufie, TT oferuje wysoką prędkość wylotową, penetrację i imponującą celność nawet na dalekich dystansach."

L["eft_weapon_ttgold"] = "TT złoty"
L["eft_weapon_ttgold_full"] = "Pistolet TT-33 7,62 x 25 TT (złoty)"
L["eft_weapon_ttgold_desc"] = "Legendarny pistolet. Był świadkiem wielu konfliktów zbrojnych, a mimo to jest wciąż używany w niektórych częściach świata, w takim wariancie bądź innym. Klasyczny TT-33 oferuje system krótkiego odrzutu lufy Browninga, ale poza tym faktem jego konstrukcja jest unikatowa – prosty w budowie, z mechanizmem spustowym pojedynczego działania i jedynie blokadą kurka, jest w stanie wytrzymać prawie wszystko. Dzięki silnej amunicji 7,62 × 25 mm i stosunkowo długiej lufie, TT oferuje wysoką prędkość wylotową, penetrację i imponującą celność nawet na dalekich dystansach. Specjalna złota wersja."

L["eft_weapon_usp45"] = "USP .45"
L["eft_weapon_usp45_full"] = "Pistolet HK USP .45 ACP"
L["eft_weapon_usp45_desc"] = "Pistolet HK USP (Universelle Selbstladepistole – „Uniwersalny pistolet samopowtarzalny”) jest kolejną zmianą pistoletów serii HK P7. Przyjęty na całym świecie jako celny i ultra niezawodny pistolet. Wykorzystując zmodyfikowany system Browninga ze specjalnym opatentowanym systemem redukcji odrzutu, USP redukuje wpływ odrzutu na elementy pistoletu, a także obniża siły odrzutu odczuwane przez strzelca. Ten konkretny wariant jest kalibru .45 ACP. Wyprodukowany przez firmę Heckler & Koch."

/////// Revolvers
L["eft_weapon_cr50ds"] = "CR 50DS"
L["eft_weapon_cr50ds_full"] = "Rewolwer Chiappa Rhino 50DS .357"
L["eft_weapon_cr50ds_desc"] = "Rewolwery Rhino, produkowane przez włoską firmę Armi Chiappa, wyróżnia rewolucyjny, opatentowany projekt i konstrukcja z nietypowym dla rewolwerów układem lufy naprzeciwko dolnej komory bębna."

L["eft_weapon_cr200ds"] = "CR 200DS"
L["eft_weapon_cr200ds_full"] = "Rewolwer Chiappa Rhino 200DS 9 x 19"
L["eft_weapon_cr200ds_desc"] = "Rewolwery Rhino, produkowane przez włoską firmę Armi Chiappa, wyróżnia rewolucyjny, opatentowany projekt i konstrukcja z nietypowym dla rewolwerów układem lufy naprzeciwko dolnej komory bębna. Krótka „kieszonkowa” wersja z 2-calową lufą w kalibrze 9 × 19 mm."

L["eft_weapon_rsh12"] = "RSz-12"
L["eft_weapon_rsh12_full"] = "Rewolwer RSz-12 12,7 x 55"
L["eft_weapon_rsh12_desc"] = "Potężny rewolwer RSz-12 (Riewolwier Szturmowoj 12 – „rewolwer szturmowy 12”), produkcji Biura Konstrukcyjnego KBP w Tule, przeznaczony do użytku przez siły specjalne. Pomimo potężnego kalibru 12,7 × 55 mm, RSz-12 ma mniejszy odrzut niż wiele innych rewolwerów i pistoletów dużego kalibru, ponieważ strzał oddawany jest z dolnej komory cylindra."

