L["eft_weapon_mp43sawedoff"] = "Obrzyn"
L["eft_weapon_mp43sawedoff_full"] = "Strzelba dwulufowa MP-43 12 ga, obcięta"
L["eft_weapon_mp43sawedoff_desc"] = "Dwulufowy obcięty klasyk. Osobista broń Ryżego. Załadowana nabojami 12 gauge."

