-- [[ ammo_9x18 ]]
L["eft_ammo_9x18_sp7.printname"] = "9 x 18 mm PM SP7 GŻ"
L["eft_ammo_9x18_sp7.compactname"] = "SP7"
L["eft_ammo_9x18_sp7.description"] = "Nabój 9 × 18 mm Makarowa SP7 GŻ z rozszerzającym pociskiem o masie 5,2 grama z ołowianym rdzeniem z plastikową zatyczką i mosiężnym półpłaszczem w łusce ze stopu i zwiększonym ładunkiem. Zaprojektowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w połowie lat 1980, by zapewnić potężną moc obalającą kosztem możliwości penetracyjnych, jednocześnie wywołując znaczne obrażenia w celu po uderzeniu, a dzięki zwiększonemu ładunkowi prochu, może osiągnąć większą prędkość wylotową bez narażenia broni czy jej użytkownika."

L["eft_ammo_9x18_psv.printname"] = "9 x 18 mm PM PSW"
L["eft_ammo_9x18_psv.compactname"] = "PSW"
L["eft_ammo_9x18_psv.description"] = "Nabój 9 × 18 mm Makarowa PSW z pociskiem z wgłębieniem wierzchołkowym o masie 7,5 grama; przeznaczony do strzelectwa sportowego i polowań. Pomimo swojej niskiej prędkości wylotowej, ma dotkliwą moc obalającą dzięki swojej wyjątkowej zdolności do ekspansji po uderzeniu w cel."

L["eft_ammo_9x18_sp8.printname"] = "9 x 18 mm PM SP8 GŻ"
L["eft_ammo_9x18_sp8.compactname"] = "SP8"
L["eft_ammo_9x18_sp8.description"] = "Nabój 9 × 18 mm Makarowa SP8 GŻ z fragmentującym pociskiem z wgłębieniem wierzchołkowym o masie 3,9 grama z ołowianym rdzeniem z plastikową zatyczką i mosiężnym półpłaszczem w łusce ze stopu i zmniejszonym ładunkiem. Zaprojektowany w połowie lat 1980 przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz), by zapewnić nabój z niską penetracją, aby ograniczyć zniszczenia i przebicia obiektów o niskiej wytrzymałości strukturalnej (na przykład podczas ataków antyterrorystycznych w samolocie) o wiąż zapewnić dotkliwą moc obalającą i powodując znaczne obrażenia w celu po uderzeniu."

L["eft_ammo_9x18_rg028.printname"] = "9 x 18 mm PM RG028 GŻ"
L["eft_ammo_9x18_rg028.compactname"] = "RG028"
L["eft_ammo_9x18_rg028.description"] = "Nabój 9 × 18 mm Makarowa RG028 z pociskiem z wgłębieniem wierzchołkowym o masie 6 gramów z cylindrycznym rdzeniem z utwardzonej stali z ołowianą okładziną i półpłaszczem ze stopu. Ten nabój został opracowany specjalnie do pistoletu PM pod koniec lat 70. na polecenie KGB w celu zapewnienia znacznej siły obalającej i zwiększenia zdolności penetracyjnych przeciwko niektórym modelom podstawowej ochrony balistycznej ciała na krótkich dystansach."

L["eft_ammo_9x18_ppe.printname"] = "9 x 18 mm PM PPe GŻ"
L["eft_ammo_9x18_ppe.compactname"] = "PPe"
L["eft_ammo_9x18_ppe.description"] = "Nabój 9 × 18 mm Makarowa PPe GŻ z pociskiem z wgłębieniem wierzchołkowym o masie 7,6 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu. Konstrukcja tego pocisku jest wzorowana na doświadczeniach uzyskanych z innych pocisków z wgłębieniem wierzchołkowym 9 × 19 mm PM. Nabój PPe ma otwór stożkowy w rdzeniu, a płaszcz ma sześć nacięć poprawiających jego rozszerzalność przy uderzeniu, w ten sposób osiągając znaczną moc obalającą."

L["eft_ammo_9x18_ppt.printname"] = "9 x 18 mm PM PPT GŻ"
L["eft_ammo_9x18_ppt.compactname"] = "PPT"
L["eft_ammo_9x18_ppt.description"] = "Nabój 9 × 18 mm Makarowa PPT GŻ (indeks GAU 57-T-181) ze smugowym pociskiem o masie 3,6 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Wraz z pojawieniem się nowych pistoletów maszynowych w latach 90. Ministerstwo Spraw Wewnętrznych zainteresowało się opracowaniem amunicji o możliwości smugowych większych niż 100 metrów, dodatkowo zapewniając moc obalającą po uderzeniu."

L["eft_ammo_9x18_pstm.printname"] = "9 x 18 mm PMM PstM GŻ"
L["eft_ammo_9x18_pstm.compactname"] = "PstM"
L["eft_ammo_9x18_pstm.description"] = "Nabój 9 × 18 mm PMM PstM GŻ (indeks GAU 57-N-181SM, indeks GRAU 7N16) z pociskiem o masie 5,6 grama ze stalowym rdzeniem i płaszczem ze stopu w kształcie ściętego stożka w łusce ze stopu. Nabój 9 × 18mm PMM jest modernizacją naboju 9 × 18 mm PM zaprojektowany z zamiarem zwiększenia jego zdolności przebijania przeciw podstawowym ochronom balistycznym ciała oraz posiada zwiększony ładunek prochu, czyniąc go niebezpiecznym do wystrzelenia z niekompatybilnych broni. Przeznaczony jest do pistoletu PMM (zmodernizowany pistolet Makarowa) oraz pistoletu maszynowego PP-9 „Klin”."

L["eft_ammo_9x18_prs.printname"] = "9 x 18 mm PM PRS GS"
L["eft_ammo_9x18_prs.compactname"] = "PRS"
L["eft_ammo_9x18_prs.description"] = "Nabój 9 × 18 mm Makarowa PRS GS z miękkim pociskiem o masie 6,1 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce. Pocisk PRS (Poniżennoj Rikoszetirujuszczej Sposobnosti – „zmniejszona zdolność do rykoszetowania”) został zaprojektowany, aby rozpadać się i gwałtownie wytracać prędkość po uderzeniu w stały obiekt w celu znacznego zmniejszenia strat ubocznych od rykoszetów podczas operacji miejskich prowadzonych przez organy ścigania i grupy z Ministerstwa Spraw Wewnętrznych."

L["eft_ammo_9x18_psppo.printname"] = "9 x 18 mm PM PS GS PPO"
L["eft_ammo_9x18_psppo.compactname"] = "PS PPO"
L["eft_ammo_9x18_psppo.description"] = "Nabój 9 × 18 mm Makarowa PS GS PPO z pociskiem o masie 6,3 grama z ołowianym rdzeniem i płaszczem w kształcie ściętego stożka i okrągłego czubka ze stopu w stalowej łusce. Nabój PS GS PPO został zaprojektowany na potrzeby Ministerstwa Spraw Wewnętrznych, by wyposażyć organy ścigania w nabój, który ma zmniejszone możliwości rykoszetowania, by zminimalizować straty uboczne podczas operacji miejskich."

L["eft_ammo_9x18_pso.printname"] = "9 x 18 mm PM PSO GŻ"
L["eft_ammo_9x18_pso.compactname"] = "PSO"
L["eft_ammo_9x18_pso.description"] = "Nabój 9 × 18 mm Makarowa PSO GŻ z pociskiem o masie 6,1 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do strzelectwa sportowego i polowań. Podstawowa konstrukcja do polowań na małą zwierzynę."

L["eft_ammo_9x18_bzht.printname"] = "9 x 18 mm PM BŻT GŻ"
L["eft_ammo_9x18_bzht.compactname"] = "BŻT"
L["eft_ammo_9x18_bzht.description"] = "Nabój 9 × 18 mm Makarowa BŻT GŻ (indeks GRAU 7N15) z pociskiem o masie 5 gramów zrobionym z twardej utwardzonej stali w łusce ze stopu. Pocisk w tym naboju ma konstrukcję ściętego stożka w celu zwiększenia jego zdolności penetracyjnych wobec niektórych modeli podstawowych ochron balistycznych ciała."

L["eft_ammo_9x18_pst.printname"] = "9 x 18 mm PM Pst GŻ"
L["eft_ammo_9x18_pst.compactname"] = "Pst"
L["eft_ammo_9x18_pst.description"] = "Nabój 9 × 18 mm Makarowa Pst GŻ (indeks GAU 57-N-181S-01) z pociskiem o masie 5,9 grama ze stalowym rdzeniem i płaszczem ze stopu w łusce ze stopu. Ten nabój został opracowany zaraz po przyjęciu pistoletu PM wzorując się na naboju 9 × 18 mm PM P GŻ, aby zapewnić skuteczniejsze rozwiązanie przeciwko wrogiej piechocie bez balistycznych osłon ciała na odległości do 50 metrów."

L["eft_ammo_9x18_p.printname"] = "9 x 18 mm PM P GŻ"
L["eft_ammo_9x18_p.compactname"] = "P"
L["eft_ammo_9x18_p.description"] = "Nabój 9 × 18 mm Makarowa P GŻ (indeks GAU 57-N-181-01) z pociskiem o masie 6,1 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu. To podstawowy nabój, który został wypuszczony wraz z przyjęciem pistoletu PM w ZSRR."

L["eft_ammo_9x18_pbm.printname"] = "9 x 18 mm PM PBM GŻ"
L["eft_ammo_9x18_pbm.compactname"] = "PBM"
L["eft_ammo_9x18_pbm.description"] = "Nabój 9 × 18 mm Makarowa PBM GŻ (indeks GRAU 7N25) z pociskiem o masie 3,7 grama z rdzeniem z utwardzonej stali węglowej i półpłaszczem ze stopu w łusce ze stopu. TTen nabój został zaprojektowany w latach 90. XX wieku, by zwiększyć możliwości penetracyjne broni kalibru 9 × 18 mm PM i dzięki jego wysokiej prędkości wylotowej, jest w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała z bliskiej odległości, kosztem niewielkiego zwiększenia odrzutu."

-- [[ ammo_9x19 ]]
L["eft_ammo_9x19_ap63.printname"] = "9 x 19 mm AP 6.3"
L["eft_ammo_9x19_ap63.compactname"] = "AP 6.3"
L["eft_ammo_9x19_ap63.description"] = "Nabój 9 × 19 mm Parabellum AP 6.3 z dwuczęściowym kontrolowanym przeciwpancernym pociskiem fragmentacyjnym z mosiężnym sabotem i penetratorem z utwardzonej stali o rozmiarze 6,3 mm. Dzięki konstrukcji tego pocisku AP (Armor-Piercing – „przeciwpancerny”), mimo posiadania przeciętnej prędkości wylotowej w porównaniu do innych nabojów tego kalibru, pocisk w tym naboju ma możliwości przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała."

L["eft_ammo_9x19_luger_cci.printname"] = "9 x 19 mm Luger CCI"
L["eft_ammo_9x19_luger_cci.compactname"] = "Luger CCI"
L["eft_ammo_9x19_luger_cci.description"] = "Nabój 9 × 19 mm Luger ze specjalnym ciężkim pociskiem; oznaczony niebieskim czubkiem, wyprodukowany przez firmę CCI. Pomimo ciężkiego pocisku w tym naboju, wciąż ma przeciętną prędkość wylotową w porównaniu do innych nabojów tego kalibru, zapewniając mu dotkliwą moc obalającą, jednocześnie wywołując ciężkie obrażenia w celu po uderzeniu kosztem zdolności penetracyjnych."

L["eft_ammo_9x19_pbp_gzh.printname"] = "9 x 19 mm PBP GŻ"
L["eft_ammo_9x19_pbp_gzh.compactname"] = "PBP"
L["eft_ammo_9x19_pbp_gzh.description"] = "Nabój 9 × 19 mm PBP GŻ (indeks GRAU 7N31) z przeciwpancernym pociskiem o masie 4,1 grama z rdzeniem z utwardzonej stali węglowej z cylindryczną aluminiową okładziną i półpłaszczem ze stopu w łusce ze stopu. Konstrukcja tego pocisku oparta jest na doświadczeniach z różnymi przeciwpancernymi nabojami pistoletowymi z końca lat 90., skierowana do unieszkodliwienia wrogiej piechoty wyposażonej w podstawowe i pośrednie osłony balistyczne ciała, dodatkowo jest w stanie przebić lekkie osłony i ma potężną prędkość wylotową."

L["eft_ammo_9x19_pso_ghz.printname"] = "9 x 19 mm PSO GŻ"
L["eft_ammo_9x19_pso_ghz.compactname"] = "PSO gzh"
L["eft_ammo_9x19_pso_ghz.description"] = "Nabój 9 × 19 mm Parabellum PSO GŻ z pociskiem o masie 7,5 grama; przeznaczony do strzelectwa sportowego i polowań. Pomimo niskiej prędkości wylotowej pocisku, ma dotkliwą moc obalającą dzięki swojej wyjątkowej zdolności do ekspansji po uderzeniu w cel."

L["eft_ammo_9x19_pst_gzh.printname"] = "9 x 19 mm Pst GŻ"
L["eft_ammo_9x19_pst_gzh.compactname"] = "Pst"
L["eft_ammo_9x19_pst_gzh.description"] = "Nabój 9 × 19 mm Parabellum Pst GŻ (RG057, indeks GRAU 7N21) z pociskiem o masie 5,4 grama z utwardzonym cieplnie stalowym rdzeniem i dwuwarstwowym półpłaszczem, polietylenowym wewnątrz i ze stopu na zewnątrz w łusce ze stopu. Ten zmodyfikowany nabój PS (Pula Stalnaja – „pocisk stalowy”) został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) we wczesnych latach 90 na bazie naboju 9 × 21 mm PS GŻ „SP10”, by zwiększyć możliwości penetracyjne rosyjskich broni kalibru 9 × 19 mm przeciwko podstawowym ochronom balistycznym ciała na dystansie do 50 metrów, dodatkowo zapewniając lepszą prędkość wylotową."

L["eft_ammo_9x19_fmj_m882.printname"] = "9 x 19 mm FMJ M882"
L["eft_ammo_9x19_fmj_m882.compactname"] = "M882"
L["eft_ammo_9x19_fmj_m882.description"] = "Amerykańska amunicja wojskowa 9 mm to jedna z najbardziej niezawodnych amunicji dostępnych na rynku, doskonała do strzelania do celów, strzelania rekreacyjnego i treningu. Nabój ten, załadowany 124-granowymi pełnopłaszczowymi pociskami „M882” o prędkości 1140 stóp na sekundę (≈347 m/s), jest uważany za amunicję +P (ale nieco mniej niż +P+). Te naboje o zwiększonym ciśnieniu przemieszczają się dalej i penetrują lepiej niż standardowe naboje 9 mm."

L["eft_ammo_9x19_quake.printname"] = "9 x 19 mm QuakeMaker"
L["eft_ammo_9x19_quake.compactname"] = "QuakeMaker"
L["eft_ammo_9x19_quake.description"] = "Nabój 9 × 19 mm Parabellum QuakeMaker z pociskiem z wgłębieniem wierzchołkowym o masie 11,9 grama zrobionym w całości z ołowiu w lekkiej stalowej łusce z czerwoną anodowaną aluminiową podstawą; przeznaczony do obrony miru domowego i treningu strzeleckiego. Ze względu na swoją konstrukcję, ten nabój zapewnia potężną moc obalającą, jednocześnie powodując ciężkie obrażenia w celu po uderzeniu i mając mniejszą prędkość wylotową w porównaniu do innych nabojów tego kalibru."

L["eft_ammo_9x19_rip.printname"] = "9 x 19 mm RIP"
L["eft_ammo_9x19_rip.compactname"] = "RIP"
L["eft_ammo_9x19_rip.description"] = "Nabój 9 × 19 mm Parabellum RIP (Radically Invasive Projectile) z fragmentującym pociskiem o masie 6 gramów zaprojektowany tak, by stworzyć wiele ran, aby szybko obezwładnić napastników. W odróżnieniu od konwencjonalnych konstrukcji z wgłębieniem wierzchołkowym pocisk „R.I.P.” posiada 8 obrobionych maszynowo miedzianych bezołowiowych płatków lub „trokarów” zaprojektowanych tak, aby szybko się rozpadały i poruszały w wielu kierunkach, w ten sposób zapewniając wysokiej klasy moc obalającą jak na swój kaliber, dodatkowo mogąc zadać znaczne obrażenia w celu po uderzeniu."

L["eft_ammo_9x19_tracer.printname"] = "9 x 19 mm zielony smugowy"
L["eft_ammo_9x19_tracer.compactname"] = "ZS"
L["eft_ammo_9x19_tracer.description"] = "Nabój 9 × 19 mm Parabellum Green Tracer. Przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: zielony). Mimo posiadania stalowego rdzenia pocisk w tym naboju wciąż ma problemy przebić podstawowe ochrony ciała, ale może zapewnić znaczną moc obalającą w celu."

