L["eft_ammo_12x70_50bmg.description"] = "Niestandardowa breneka do strzelb kalibru 12/70 ze skróconym pociskiem smugowym .50 BMG. Nikt nie wie, kto i po co tworzy te dziwne naboje w Tarkowie, ale po prostu działają… jakoś."

