L["eft_ammo_12x70_525mm.compactname"] = "5,25 mm"
L["eft_ammo_12x70_525mm.description"] = "Nabój 12/70 załadowany 15 śrucinami 5,25 mm do strzelb kalibru 12 gauge."

L["eft_ammo_12x70_pir.printname"] = "12/70 Piranha"
L["eft_ammo_12x70_pir.compactname"] = "Piranha"
L["eft_ammo_12x70_pir.description"] = "Ten nabój 12 gauge zawiera dziesiątki ostrych jak brzytwa stalowych gwoździ, które wystrzeliwane są z dużą prędkością, co praktycznie gwarantuje brak reakcji ze strony sprawcy. Każdy nabój jest wypełniony śrutem #12, co powoduje podwójny wstrząs w obszarze rany. Absolutnie nie uszkodzi strzelby. Używać nie bliżej niż 10 stóp (≈3 m) i nie dalej niż 50 stóp (≈15 m)."

