L["eft_ammo_12x70_flechette.printname"] = "Amunicja strzałkowa 12/70"
L["eft_ammo_12x70_flechette.compactname"] = "Strzałkowa"
L["eft_ammo_12x70_flechette.description"] = "Pocisk do strzelb kalibru 12/70 wypełniony ostrymi jak brzytwa strzałkami. Daleko jej do najskuteczniejszego naboju, ale uwierz – zdecydowanie nie chciałbyś być po stronie lufy załadowanej nim broni."

