-- [[ ammo_45acp ]]
L["eft_ammo_45acp_fmj.printname"] = ".45 ACP Match FMJ"
L["eft_ammo_45acp_fmj.compactname"] = "FMJ"
L["eft_ammo_45acp_fmj.description"] = "Nabój .45 ACP (11,43 × 23 mm) Match FMJ (Cartridge, Caliber .45, Ball, Match, M1911) z pociskiem z ołowianym rdzeniem o masie 14,9 grama z miedzianym płaszczem w mosiężnej łusce. Ten nabój wyprodukowano z polepszoną celnością, by sprostać potrzebom współczesnej broni kalibru .45 ACP używanej przez armię Stanów Zjednoczonych, będąc w stanie przebić podstawową ochronę balistyczną ciała, jednocześnie oferując znaczną moc obalającą."

L["eft_ammo_45acp_ap.printname"] = ".45 ACP AP"
L["eft_ammo_45acp_ap.compactname"] = "AP"
L["eft_ammo_45acp_ap.description"] = "Nabój .45 ACP (11,43 × 23 mm) AP z dwuczęściowym kontrolowanym przeciwpancernym pociskiem fragmentacyjnym z mosiężnym sabotem i penetratorem z utwardzonej stali o rozmiarze 7 mm. Dzięki konstrukcji tego pocisku AP (Armor-Piercing – „przeciwpancerny”), mimo posiadania przeciętnej prędkości wylotowej w porównaniu do innych nabojów tego kalibru, pocisk w tym naboju ma możliwości przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała i wciąż zapewnia znaczną moc obalającą."

L["eft_ammo_45acp_laser.printname"] = ".45 ACP Lasermatch FMJ"
L["eft_ammo_45acp_laser.compactname"] = "Lasermatch"
L["eft_ammo_45acp_laser.description"] = "Nabój .45 ACP (11,43 × 23 mm) Lasermatch FMJ z pociskiem o masie 14,5 grama z ołowianym rdzeniem i miedzianym płaszczem w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten nabój został zaprojektowany, by dodać możliwości smugowe do pistoletów maszynowych kalibru .45 ACP podczas ognia ciągłego, jak również oferując dotkliwą moc obalającą i być w stanie przebić podstawowe ochrony balistyczne ciała."

L["eft_ammo_45acp_hydra.printname"] = ".45 ACP Hydra-Shok"
L["eft_ammo_45acp_hydra.compactname"] = "HydraShok"
L["eft_ammo_45acp_hydra.description"] = "Nabój .45 ACP (11,43 × 23 mm) Hydra-Shok z ołowianym pociskiem z centralnym wgłębieniem wierzchołkowym o masie 14,9 grama z ołowianym rdzeniem i miedzianym półpłaszczem w mosiężnej łusce. Pomimo posiadania lekko mniejszej prędkości wylotowej jak na ten kaliber, ten nabój zapewnia jedną z najlepszych wymian energii w kalibrze .45 ACP i ma potężną moc obalającą i może spowodować ciężkie obrażenia w celu po uderzeniu, kosztem zdolności penetracyjnych."

L["eft_ammo_45acp_rip.printname"] = ".45 ACP RIP"
L["eft_ammo_45acp_rip.compactname"] = "RIP"
L["eft_ammo_45acp_rip.description"] = "Nabój .45 ACP (11,43 × 23 mm) RIP (Radically Invasive Projectile) z fragmentującym pociskiem o masie 10,5 grama zaprojektowany tak, by stworzyć wiele ran, aby szybko obezwładnić napastników. W odróżnieniu od konwencjonalnych konstrukcji z wgłębieniem wierzchołkowym pocisk „R.I.P.” posiada 8 obrobionych maszynowo miedzianych bezołowiowych płatków lub „trokarów” zaprojektowanych tak, aby szybko się rozpadały i poruszały w wielu kierunkach, w ten sposób zapewniając wysokiej klasy moc obalającą jak na swój kaliber, dodatkowo mogąc zadać ciężkie obrażenia w celu po uderzeniu."

