L["eft_ammo_556_warma.printname"] = "5,56 x 45 mm Warmageddon"
L["eft_ammo_556_warma.compactname"] = "Warmage"
L["eft_ammo_556_warma.description"] = "Nabój .223 Remington (5,56 × 45 mm) Warmageddon z pociskiem grzybkującym o masie 3,6 grama z ołowianym rdzeniem z polimerowym wierzchołkiem i płaszczem ze stopu miedzi w mosiężnej łusce; przeznaczony do polowań. Ten pocisk posiada balistyczny wierzchołek, który działa przy uderzeniu jak klin na ołowiany rdzeń, pozwalając pociskowi na rozszerzenie się w celu i zadanie znaczących obrażeń w celu po uderzeniu, pomimo braku pełnej energii pocisku pośredniego."

L["eft_ammo_556_hp.printname"] = "5,56 x 45 mm HP"
L["eft_ammo_556_hp.compactname"] = "HP"
L["eft_ammo_556_hp.description"] = "Nabój .223 Remington (5,56 × 45 mm) HP z pociskiem z wgłębieniem wierzchołkowym o masie 3,6 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Pomimo braku pełnej energii pocisku pośredniego, pocisk w tym naboju ma dotkliwą moc obalającą i może spowodować znaczne obrażenia w celu po uderzeniu, kosztem zdolności penetracyjnych, nawet przeciw podstawowym ochronom balistycznym."

L["eft_ammo_556_sost.printname"] = "5,56 x 45 mm MK 318 Mod 0 (SOST)"
L["eft_ammo_556_sost.compactname"] = "SOST"
L["eft_ammo_556_sost.description"] = "Nabój 5,56 × 45 mm NATO MK 318 Mod 0 (SOST) z pociskiem o masie 4 gramów z otwartym wierzchołkiem z ołowianym rdzeniem z miedzianą podstawą i miedzianym płaszczem w mosiężnej łusce. Nabój ten skonstruowano specjalnie dla Korpusu Piechoty Morskiej Stanów Zjednoczonych, pod nazwą SOST (Special Operations Science and Technology – „specjalne operacje, nauka i technologia”), aby zapewnić penetrację obiektów o niskiej wytrzymałości strukturalnej i zapewnia dotkliwą moc obalającą, będąc nawet w stanie przebić podstawowe ochrony balistyczne ciała."

L["eft_ammo_556_rrlp.printname"] = "5,56 x 45 mm MK 255 Mod 0 (RRLP)"
L["eft_ammo_556_rrlp.compactname"] = "RRLP"
L["eft_ammo_556_rrlp.description"] = "Nabój 5,56 × 45 mm NATO MK 255 Mod 0 (RRLP) z pociskiem o masie 4 gramów z rdzeniem z kompozytu miedzi/polimerów i miedzianym płaszczem w mosiężnej łusce. Nabój ten skonstruowano pod nazwą RRLP (Reduced Ricochet Limited Penetration – „zmniejszony rykoszet i ograniczona penetracja”) w celu znacznego zmniejszenia strat ubocznych wynikających z rykoszetów i przebić podczas szkoleń i operacji w bliskim kontakcie, a także zapewnienia znaczną moc obalającą."

L["eft_ammo_556_m856.printname"] = "5,56 x 45 mm M856"
L["eft_ammo_556_m856.compactname"] = "M856"
L["eft_ammo_556_m856.description"] = "Nabój 5,56 × 45 mm NATO M856 z pociskiem smugowym o masie 4,1 grama z ołowianym rdzeniem i miedzianym płaszczem w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten nabój został zaprojektowany w latach 80. XX wieku, by dodać możliwości smugowe do broni kalibru 5,56 × 45 mm NATO używanej przez Armię Stanów Zjednoczonych w połączeniu z nabojem M855. Pomimo braku stalowego penetratora w porównaniu do M855, pocisk w tym naboju jest w stanie przebić podstawową ochronę balistyczną ciała, ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_m856a1.printname"] = "5,56 x 45 mm M856A1"
L["eft_ammo_556_m856a1.compactname"] = "M856A1"
L["eft_ammo_556_m856a1.description"] = "Nabój 5,56 × 45 mm NATO M856A1 z pociskiem smugowym o masie 3,6 grama z rdzeniem ze stopu miedzi i miedzianym płaszczem w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten nabój został zaprojektowany, by dodać możliwości smugowe, w połączeniu z nabojem 5,56 × 45 mm NATO M855A1 i miał podobne osiągi balistyczne, będąc w stanie przebić podstawową ochronę balistyczną ciała i zapewniając świetne wyniki przeciw modelom pośrednim, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_m855a1.printname"] = "5,56 x 45 mm M856A1"
L["eft_ammo_556_m855a1.compactname"] = "M856A1"
L["eft_ammo_556_m855a1.description"] = "Nabój 5,56 × 45 mm NATO M856A1 z pociskiem smugowym o masie 3,6 grama z rdzeniem ze stopu miedzi i miedzianym płaszczem w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten nabój został zaprojektowany, by dodać możliwości smugowe, w połączeniu z nabojem 5,56 × 45 mm NATO M855A1 i miał podobne osiągi balistyczne, będąc w stanie przebić podstawową ochronę balistyczną ciała i zapewniając świetne wyniki przeciw modelom pośrednim, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_fmj.printname"] = "5,56 x 45 mm FMJ"
L["eft_ammo_556_fmj.compactname"] = "FMJ"
L["eft_ammo_556_fmj.description"] = "Nabój .223 Remington (5,56 × 45 mm) FMJ z pociskiem o masie 3,6 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Pomimo swojej podstawowej konstrukcji i braku pełnej energii pocisku pośredniego, pocisk w tym naboju jest w stanie przebić podstawowe ochrony balistyczne ciała."

L["eft_ammo_556_ssaap.printname"] = "5,56 x 45 mm SSA AP"
L["eft_ammo_556_ssaap.compactname"] = "SSA AP"
L["eft_ammo_556_ssaap.description"] = "Nabój 5,56 × 45 mm NATO SSA AP z dwuczęściowym przeciwpancernym pociskiem, pocisk składa się z sabotu i penetratora z węglika wolframu w mosiężnej łusce. Ten pocisk zaprojektowano do przewyższenia tego stosowanego w amunicji 5,56 × 45 mm NATO M995 pod względem zdolności penetracyjnych, dzięki prędkości wylotowej i osobliwej konstrukcji jest w stanie przebić podstawowe i pośrednie ochrony balistycznych ciała, dodatkowo zapewniając świetne rezultaty przeciwko niektórym współczesnym specjalistycznym modelom, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_m855.printname"] = "5,56 x 45 mm M855"
L["eft_ammo_556_m855.compactname"] = "M855"
L["eft_ammo_556_m855.description"] = "Nabój 5,56 × 45 mm NATO M855 z pociskiem o masie 4 gramów ze stalowym penetratorem w części wierzchołkowej z ołowianym rdzeniem i miedzianym płaszczem w mosiężnej łusce. Ten nabój został zaprojektowany w latach 80. XX wieku jako odpowiednik naboju FN SS109 do broni kalibru 5,56 × 45 mm NATO używanej przez Armię Stanów Zjednoczonych. Dzięki swojej konstrukcji pocisk w tym naboju jest w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała, jednak ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_m855a1.printname"] = "5,56 x 45 mm M855A1"
L["eft_ammo_556_m855a1.compactname"] = "M855A1"
L["eft_ammo_556_m855a1.description"] = "Nabój 5,56 × 45 mm NATO M855A1 z przeciwpancernym pociskiem o masie 4 gramów ze stalowym penetratorem w części wierzchołkowej z rdzeniem ze stopu miedzi i miedzianym półpłaszczem w mosiężnej łusce. Nabój ten został zaprojektowany w celu poprawy zdolności penetracyjnych naboju 5,56 × 45 mm NATO M855 armii Stanów Zjednoczonych, będąc w stanie przebić podstawową i pośrednią ochronę balistyczną ciała, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_m995.printname"] = "5,56 x 45 mm M995"
L["eft_ammo_556_m995.compactname"] = "M995"
L["eft_ammo_556_m995.description"] = "Nabój 5,56 × 45 mm NATO M995 z przeciwpancernym pociskiem o masie 3,4 grama z penetratorem z węglika wolframu z aluminiową podstawą i miedzianym płaszczem w mosiężnej łusce. Ten nabój został zaprojektowany w latach 90. XX wieku, by zapewnić piechocie armii Stanów Zjednoczonych zdolności do przebijania lekkich osłon i lekkich pojazdów, jak również podstawowych i pośrednich ochron balistycznych ciała, dodatkowo zapewniając świetne rezultaty przeciwko niektórym specjalistycznym modelom. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_556_bb.printname"] = "6 mm kulka airsoftowa"
L["eft_ammo_556_bb.compactname"] = "Kulka 6mm"
L["eft_ammo_556_bb.description"] = "Airsoftowa kulka 6 mm o wadze 0,2 grama."

-- [[ ammo_762x51 ]]
L["eft_ammo_762x51_bpzfmj.printname"] = "7,62 x 51 mm BCP FMJ"
L["eft_ammo_762x51_bpzfmj.compactname"] = "BCP FMJ"
L["eft_ammo_762x51_bpzfmj.description"] = "Nabój 7,62 × 51 mm BCP FMJ z pociskiem o masie 10,9 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego, produkowany przez Barnaul Cartridge Plant. Pomimo swojej podstawowej konstrukcji, ten nabój jest w stanie zapewnić potężną moc obalającą, jednocześnie będąc w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała."

L["eft_ammo_762x51_m61.printname"] = "7,62 x 51 mm M61"
L["eft_ammo_762x51_m61.compactname"] = "M61"
L["eft_ammo_762x51_m61.description"] = "Nabój 7,62 × 51 mm NATO M61 z przeciwpancernym pociskiem o masie 9,8 grama z utwardzonym stalowym rdzeniem z ołowianą okładziną na wierzchołku i płaszczem ze stopu w mosiężnej łusce. Ten nabój zaprojektowano w latach 50. XX wieku na bazie naboju .30-06 Springfield AP M2, aby zapewnić siłom zbrojnym Stanów Zjednoczonych pocisk przeciwpancerny do broni automatycznej kalibru 7,62 × 51 mm NATO, przebić większość specjalistycznych ochron balistycznych ciała, dodatkowo zapewniając znaczną moc obalającą. Jednak ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x51_m62t.printname"] = "7,62 x 51 mm M62 smugowy"
L["eft_ammo_762x51_m62t.compactname"] = "M62"
L["eft_ammo_762x51_m62t.description"] = "Nabój 7,62 × 51 mm NATO M62 z pociskiem smugowym o masie 9,2 grama z rdzeniem z ołowiano-antymonowego stopu i płaszczem ze stopu w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: zielony). Ten nabój został zaprojektowany, by dodać możliwości smugowe do broni automatycznej kalibru 7,62 × 51 mm NATO używanych przez United States Armed Forces, będąc w stanie przebić przez podstawowe i pośrednie modele ochrony balistycznej, dodatkowo zapewniając dotkliwą moc obalającą. Jednak ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x51_m80.printname"] = "7,62 x 51 mm M80"
L["eft_ammo_762x51_m80.compactname"] = "M80"
L["eft_ammo_762x51_m80.description"] = "Nabój 7,62 × 51 mm NATO M80 z pociskiem o masie 9,5 grama z rdzeniem z ołowiano-antymonowego stopu i płaszczem ze stopu w mosiężnej łusce. Nabój ten został przyjęty w siłach zbrojnych Stanów Zjednoczonych jako zamiennik naboju 7,62 × 51 mm NATO M59 po wojnie wietnamskiej jako standardowa amunicja, jako że zapewnia dotkliwą moc obalającą, jednocześnie będąc w stanie przebić podstawową i pośrednią ochronę balistyczną ciała. Ma jednak duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x51_m80a1.printname"] = "7.62x51mm M80A1"
L["eft_ammo_762x51_m80a1.compactname"] = "M80A1"
L["eft_ammo_762x51_m80a1.description"] = "A 7.62x51mm NATO M80A1 cartridge with a 124 grain armor-piercing copper jacket bullet with an exposed hardened steel penetrator, in a stainless steel casing. Designed as a replacement for the M80 cartridge to improve the armor penetration and ballistics of the cartridge as part of a program to eliminate the use of lead in small arms ammunition in the U.S. Army."

L["eft_ammo_762x51_m993.printname"] = "7,62 x 51 mm M993"
L["eft_ammo_762x51_m993.compactname"] = "M993"
L["eft_ammo_762x51_m993.description"] = "Nabój 7,62 × 51 mm NATO M993 z przeciwpancernym pociskiem o masie 8,2 grama z penetratorem z węglika wolframu z aluminiową podstawą i miedzianym płaszczem w mosiężnej łusce. Ten nabój został zaprojektowany w latach 90. XX wieku, by zapewnić piechocie armii Stanów Zjednoczonych zdolności do przebijania lekkich osłon i lekkich pojazdów opancerzonych, dodatkowo zapewniając świetne rezultaty przeciwko większości współczesnych specjalistycznych ochron balistycznych ciała."

L["eft_ammo_762x51_tpzsp.printname"] = "7,62 x 51 mm TCW SP"
L["eft_ammo_762x51_tpzsp.compactname"] = "TCW SP"
L["eft_ammo_762x51_tpzsp.description"] = "Nabój 7,62 × 51 mm z pociskiem z wierzchołkiem odkrytym (SP) o masie 10,7 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego, produkowany przez Tula Cartridge Works. Dzięki swojej uniwersalności ten nabój skierowano do amatorów, zarówno polowań, rekreacji, jak i strzelectwa sportowego, dzięki swojej wszechstronności, jednocześnie mogąc przebić podstawowe ochrony balistyczne ciała i zapewniając świetne wyniki przeciw pośrednim modelom, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x51_ultranosler.printname"] = "7,62 x 51 mm Ultra Nosler"
L["eft_ammo_762x51_ultranosler.compactname"] = "Ultra Nosler"
L["eft_ammo_762x51_ultranosler.description"] = "Nabój 7,62 × 51 mm Ultra Nosler z pociskiem z wierzchołkiem odkrytym o masie 10,6 grama z dwoma ołowianymi rdzeniami oddzielonymi od siebie litą przegrodą do miedzianego półpłaszcza i miedzianym półpłaszczem w stalowej łusce; przeznaczony do polowania i treningu strzeleckiego. Dzięki swojej konstrukcji ten nabój zapewnia jeden z najlepszych współczynników wymiany energii jak na swój kaliber, mogąc wywołać ciężkie obrażenia w celu po uderzeniu ze względu na tylny rdzeń, w ten sposób oferując potężną moc obalającą."

-- [[ ammo_762x54r ]]
L["eft_ammo_762x54r_bs_gzh.printname"] = "7,62 x 54 mm R BS GS"
L["eft_ammo_762x54r_bs_gzh.compactname"] = "BS"
L["eft_ammo_762x54r_bs_gzh.description"] = "Nabój 7,62 × 54 mm R BS GS (indeks GRAU 7N37) z przeciwpancernym pociskiem o masie 12,2 grama z zaostrzonym rdzeniem z węglika wolframu z ołowianą podstawą i płaszczem ze stopu w stalowej łusce. Ten pocisk BS (Broniebojnyj Sierdiecznik – „przebijający pancerz rdzeń”) został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w latach 2010, by znacznie zwiększyć możliwości penetracyjne broni wyborowych typu SWD i jej wariantów, będąc w stanie przebić większość specjalistycznych ochron balistycznych ciała, dodatkowo będąc w stanie przebijać lekkie osłony i lekkie pojazdy opancerzone, mimo posiadania względnie niskiej prędkości wylotowej w porównaniu do innych nabojów. Jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x54r_bt_gzh.printname"] = "7,62 x 54 mm R BT GŻ"
L["eft_ammo_762x54r_bt_gzh.compactname"] = "BT"
L["eft_ammo_762x54r_bt_gzh.description"] = "Nabój 7,62 × 54 mm R BT GŻ (indeks GRAU 7BT1) ze smugowym przeciwpancernym pociskiem o masie 9,2 grama z zaostrzonym utwardzonym cieplnie stalowym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: zielony). Ten pocisk BT (Broniebojnaja Trassirujuszczaja – „przebijający pancerz smugowy”) jest ulepszoną wersją używanego w 7,62 × 54 mm R T-46M naboju, dlatego, że ołowiany rdzeń zamieniono w utwardzoną cieplnie stal, zapewniając broniom automatycznym zdolności penetracyjne przeciw podstawowym, pośrednim i specjalistycznym ochronom balistycznym ciała i zapewnia znaczną moc obalającą."

L["eft_ammo_762x54r_fmj.printname"] = "7,62 x 54 mm R FMJ"
L["eft_ammo_762x54r_fmj.compactname"] = "FMJ"
L["eft_ammo_762x54r_fmj.description"] = "Pocisk z pełnym płaszczem. Standardowy rdzeń ołowiany z metalowym płaszczem. Najlepszy do treningów i strzelań do tarczy."

L["eft_ammo_762x54r_hpbt.printname"] = "7,62 x 54 mm R HP BT"
L["eft_ammo_762x54r_hpbt.compactname"] = "HP BT"
L["eft_ammo_762x54r_hpbt.description"] = "HPBT (Hollow Point Boat Tail) – pocisk typu HP z opływowym lub zwężającym się ogonem. HP (Hollow Point – z wgłębieniem wierzchołkowym) – pocisk półpłaszczowy z otworem w nosie."

L["eft_ammo_762x54r_lps_gzh.printname"] = "7,62 x 54 mm R ŁPS GŻ"
L["eft_ammo_762x54r_lps_gzh.compactname"] = "ŁPS"
L["eft_ammo_762x54r_lps_gzh.description"] = "Nabój 7,62 × 54 mm R ŁPS GŻ (indeks GRAU 57-N-323S) z pociskiem o masie 9,6 grama ze stalowym rdzeniem z ołowianą okładziną na wierzchołku i płaszczem ze stopu w łusce ze stopu. Pocisk ŁPS (Łegkaja Pula so Stalnym sierdiecznikom – „lekki pocisk ze stalowym rdzeniem”) został wprowadzony do służby w 1953 roku dla radzieckiej broni kalibru 7,62 × 54 mm R i przez lata przechodził liczne zmiany w materiałach użytych do jego budowy. Dzięki swojemu stalowemu rdzeniowi ma możliwość przebicia przez podstawowe i pośrednie ochrony balistyczne ciała, dodatkowo zapewniając dotkliwą moc obalającą, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_762x54r_ps_gzh.printname"] = "7,62 x 54 mm R PS GŻ"
L["eft_ammo_762x54r_ps_gzh.compactname"] = "PS"
L["eft_ammo_762x54r_ps_gzh.description"] = "Nabój 7,62 × 54 mm R PS GŻ (indeks GRAU 7N1) z pociskiem o masie 9,8 grama z zaostrzonym stalowym rdzeniem z ołowianą podstawą i płaszczem ze stopu w łusce ze stopu. Ten pocisk PS (Pula so Stalnym sierdiecznikom – „pocisk ze stalowym rdzeniem”) został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w środku lat 1960 z pocisku 7,62 × 54 mm R ŁPS GŻ, szczególnie, by zwiększyć jego celność, podczas strzelania z karabinów wyborowych, takich jak SWD i jego warianty, będąc w stanie przebić się przez podstawowe i pośrednie ochrony balistyczne ciała i zapewniając potężną moc obalającą."

L["eft_ammo_762x54r_snb_gzh.printname"] = "7,62 x 54 mm R SNB GŻ"
L["eft_ammo_762x54r_snb_gzh.compactname"] = "SNB"
L["eft_ammo_762x54r_snb_gzh.description"] = "Nabój 7,62 × 54 mm R SNB GŻ (indeks GRAU 7N14) z przeciwpancernym pociskiem o masie 9,8 grama z zaostrzonym utwardzonym cieplnie stalowym rdzeniem z ołowianą podstawą i płaszczem ze stopu w łusce ze stopu. Ten pocisk SNB (SNajpierskij s Boniebojnoj pulej – „snajperski z przebijającym pancerz pociskiem”) został opracowany w środku lat 1990 jako modernizacja pocisku 7,62 × 54 mm R PS GŻ, by zwiększyć jego możliwości przebijające, podczas strzelania z karabinów wyborowych, pozwalając przebić specjalistyczne ochrony balistyczne ciała i zapewniając znaczną moc obalającą."

L["eft_ammo_762x54r_spbt.printname"] = "7,62 x 54 mm R SP BT"
L["eft_ammo_762x54r_spbt.compactname"] = "SP BT"
L["eft_ammo_762x54r_spbt.description"] = "Naboje z pociskiem z wierzchołkiem odkrytym Boat Tail o masie 180 granów przeznaczone są do polowań na jelenie, duże świnie i inną grubą zwierzynę, gdzie wymagana jest większa siła powalająca."

L["eft_ammo_762x54r_t46m_gzh.printname"] = "7,62 x 54 mm R T-46M GŻ"
L["eft_ammo_762x54r_t46m_gzh.compactname"] = "T-46M"
L["eft_ammo_762x54r_t46m_gzh.description"] = "Nabój 7,62 × 54 mm R T-46M GŻ (indeks GRAU 7T2M) ze smugowym pociskiem o masie 9,6 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten pocisk smugowy jest ulepszoną wersją modelu T-46 (indeks GRAU 7T2), ponieważ zapewnia możliwości smugowe na większej odległości i ma podobną efektywność balistyczną do pocisku ŁPS GŻ (indeks GRAU 57-N-323S), pomimo podstawowej konstrukcji pocisku, jest w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała dodatkowo zapewniając dotkliwą moc obalającą, jednak ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

-- [[ ammo_76239 ]]
L["eft_ammo_76239_hp.printname"] = "7,62 x 39 mm HP"
L["eft_ammo_76239_hp.compactname"] = "HP"
L["eft_ammo_76239_hp.description"] = "Nabój 7,62 × 39 mm z pociskiem z wgłębieniem wierzchołkowym (HP) o masie 8 gramów z ołowianym rdzeniem i półpłaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Pocisk w tym naboju ma doskonałą ekspansję i energię uderzenia, które nadają mu potężną moc obalającą i może zadać znaczne obrażenia w celu po uderzeniu, czyniąc go dobrym wyborem do polowań."

L["eft_ammo_76239_t45m1.printname"] = "7,62 x 39 mm T-45M1 GŻ"
L["eft_ammo_76239_t45m1.compactname"] = "T-45M1"
L["eft_ammo_76239_t45m1.description"] = "Nabój 7,62 × 39 mm T-45M1 GŻ (indeks GAU 57-T-231PM1) ze smugowym pociskiem o masie 7,6 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten pocisk smugowy jest ulepszoną wersją modelu T-45 (indeks GAU 57-T-231), ponieważ zapewnia możliwości smugowe na większej odległości. I pomimo podstawowej konstrukcji pocisku, jest w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała dodatkowo zapewniając dotkliwą moc obalającą, jednak ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_76239_fmj.printname"] = "7,62 x 39 mm FMJ"
L["eft_ammo_76239_fmj.compactname"] = "FMJ"
L["eft_ammo_76239_fmj.description"] = "Ołowiany pocisk z metalowym płaszczem. Doskonały do strzelania praktycznego i rekreacyjnego."

L["eft_ammo_76239_sp.printname"] = "7,62 x 39 mm SP"
L["eft_ammo_76239_sp.compactname"] = "SP"
L["eft_ammo_76239_sp.description"] = "Gwintowana amunicja 7,62 × 39 mm z pociskiem SP o masie 123 granów (8 g) doskonale nadaje się do treningu i strzelania rekreacyjnego."

L["eft_ammo_76239_us.printname"] = "7,62 x 39 mm US GŻ"
L["eft_ammo_76239_us.compactname"] = "US"
L["eft_ammo_76239_us.description"] = "Nabój 7,62 × 39 mm US GŻ (indeks GAU 57-N-231U) z pociskiem poddźwiękowym o masie 12,6 grama z zaostrzonym utwardzonym cieplnie stalowym rdzeniem z ołowianą podstawą i płaszczem ze stopu w stalowej łusce z osłabionym ładunkiem. Ten nabój US (Umien’szennoj Skorosti – „zmniejszona prędkość”) został zaprojektowany w latach 50. XX wieku do użytku razem z tłumikiem, zapewniając, że broń będzie strzelać z amunicją kalibru 7,62 × 39 mm i osiągnie doskonałą redukcję hałasu i, dzięki swojej konstrukcji, pocisk jest w stanie przebić podstawowe ochrony balistyczne ciała, ale ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_76239_pp.printname"] = "7,62 x 39 mm PP GŻ"
L["eft_ammo_76239_pp.compactname"] = "PP"
L["eft_ammo_76239_pp.description"] = "Nabój 7N27 z pociskiem o zwiększonej penetracji. Pocisk „PP” składa się ze stalowego płaszcza pokrytego tombakiem ze ściętym wierzchołkiem, ostrego rdzenia z hartowanej stali, spłonki z cienkiej metalowej folii pokrytej zielonym lakierem oraz ołowianego płaszcza. Folia zapobiega zużyciu broni i magazynka podczas wprowadzania nabojów."

L["eft_ammo_76239_bp.printname"] = "7,62 x 39 mm BP GŻ"
L["eft_ammo_76239_bp.compactname"] = "BP"
L["eft_ammo_76239_bp.description"] = "Nabój 7,62 × 39 mm BP GŻ (indeks GRAU 7N23) z przeciwpancernym pociskiem o masie 7,9 grama z rdzeniem z utwardzonej stali węglowej z ołowianą okładziną na wierzchołku i płaszczem ze stopu w łusce ze stopu. Pocisk BP (Broniebojnaja Pula – „pocisk przebijający pancerz”) został opracowany w latach 90. XX wieku na bazie naboju 7,62 × 39 mm PS GŻ w celu ulepszenia jego konstrukcji i zdolności penetracyjnych, jako że wybrano dłuższy i węższy rdzeń ze wzmocnionej stali, pozwalając mu przebić się przez podstawowe i pośrednie modele ochrony balistycznej ciała, dodatkowo zapewniając znaczną moc obalającą, jednak ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_76239_ps.printname"] = "7,62 x 39 mm PS GŻ"
L["eft_ammo_76239_ps.compactname"] = "PS"
L["eft_ammo_76239_ps.description"] = "Nabój 7,62 × 39 mm PS GŻ (indeks GAU 57-N-231) z pociskiem o masie 7,9 grama z utwardzonym cieplnie stalowym rdzeniem z ołowianą okładziną na wierzchołku i płaszczem ze stopu w łusce ze stopu. Pocisk PS (Pula so Stalnym sierdiecznikom – „pocisk ze stalowym rdzeniem”) został wprowadzony do służby w 1949 roku dla radzieckiej broni kalibru 7,62 × 39 mm i przez lata przechodził liczne zmiany w materiałach użytych do jego budowy. Dzięki hartowanemu stalowemu rdzeniowi w tym modelu ma możliwość przebicia przez podstawowe i niektóre pośrednie ochrony balistyczne ciała, dodatkowo zapewniając znaczną moc obalającą, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_76239_maiap.printname"] = "7,62 x 39 mm MAI AP"
L["eft_ammo_76239_maiap.compactname"] = "MAI AP"
L["eft_ammo_76239_maiap.description"] = "Nabój 7,62 × 39 mm MAI AP z dwuczęściowym przeciwpancernym pociskiem, pocisk składa się z sabotu i penetratora z węglika wolframu w stalowej łusce. Ten pocisk został zaprojektowany przez MAI w celu zwiększenia zdolności penetracyjnych kalibru 7,62 × 39 mm, dzięki swojej prędkości kagańcowej i osobliwej konstrukcji, jest w stanie przebić podstawowe i pośrednie ochrony balistycznych ciała, dodatkowo zapewniając świetne rezultaty przeciwko niektórym współczesnym specjalistycznym modelom, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

