L["eft_ar_buffertube_siadv.printname"] = "Prowadnica kolby do AR-15 Strike Industries Advanced Receiver Extension"
L["eft_ar_buffertube_siadv.compactname"] = "Prowadnica kolby Advanced"
L["eft_ar_buffertube_siadv.description"] = "Zaawansowana prowadnica kolby, dzięki standardowej średnicy pasuje do każdego karabinku i karabinu opartego na AR-15. Ta prowadnica kolby posiada charakterystyczne wyżłobienia, które zmniejszają tarcie z kolbą i redukują wagę, jednocześnie zachowując wytrzymałość w miejscach, które są najbardziej obciążone. Wyprodukowana przez firmę Strike Industries."

