L["eft_ar_buffertube_siadvred.compactname"] = "Prowadnica kolby Advanced"
L["eft_ar_buffertube_siadvred.description"] = "Zaawansowana prowadnica kolby, dzięki standardowej średnicy pasuje do każdego karabinku i karabinu opartego na AR-15. Ta prowadnica kolby posiada charakterystyczne wyżłobienia, które zmniejszają tarcie z kolbą i redukują wagę, jednocześnie zachowując wytrzymałość w miejscach, które są najbardziej obciążone. Wyprodukowana przez firmę Strike Industries. Wersja anodowana czerwona."

L["eft_ar_buffertube_socom.printname"] = "Kolba do AR-15 DoubleStar ACE SOCOM Gen.4"
L["eft_ar_buffertube_socom.compactname"] = "ACE SOCOM"
