L["eft_muzzle_12g_gk02.printname"] = "Hamulec wylotowy GK-02 12 ga"
L["eft_muzzle_12g_gk02.compactname"] = "GK-02"
L["eft_muzzle_12g_gk02.description"] = "Hamulec wylotowy IIjin GK-02 to zmodernizowana i ulepszona wersja urządzenia projektu Jarosława Iljina, która charakteryzuje się zwiększoną redukcją odrzutu i podrzutu."

L["eft_muzzle_12g_hexasup.printname"] = "Tłumik dźwięku Hexagon 12K 12 ga"
L["eft_muzzle_12g_hexasup.compactname"] = "Hexagon 12K"
