L["eft_scope_zeuspro.description"] = "Celownik termiczny Zeus-Pro 640 z 2-krotnym i 8-krotnym powiększeniem. Wyprodukowany przez firmę Armasight."

L["eft_scope_30mm_tango6t.printname"] = "Luneta SIG TANGO6T 1-6x24 30 mm"
L["eft_scope_30mm_tango6t.compactname"] = "TANGO6T"
L["eft_scope_30mm_tango6t.description"] = "TANGO6T to wytrzymały i dobrze skonstruowany celownik optyczny o zmiennej mocy. Model ten charakteryzuje się powiększeniem od 1× do 6× i siatką pierwszej płaszczyzny ogniskowej. Ta luneta jest idealna na krótkie i średnie dystanse, a także do polowań w terenie. Wyprodukowana przez firmę SIG Sauer."

L["eft_scope_dovetail_ekp1s03.printname"] = "Celownik kolimatorowy Axion Kobra EKP-1S-03 (jaskółczy ogon)"
L["eft_scope_dovetail_ekp1s03.compactname"] = "EKP-1S-03"
L["eft_scope_dovetail_ekp1s03.description"] = "Kobra to bardzo popularny celownik typu „red dot” wśród organów ścigania i strzelców cywilnych. Został opracowany dla Sił Zbrojnych Federacji Rosyjskiej. EKP-1S-03 zyskał reputację niezawodnego w najtrudniejszych warunkach terenowych wśród myśliwych, strzelców sportowych, żołnierzy i kolekcjonerów. Celownik przeznaczony jest do instalacji na montażu typu jaskółczy ogon. Wyprodukowany przez firmę Axion."

L["eft_scope_35mm_5hd.printname"] = "Luneta Nightforce ATACR 7-35x56 34 mm"
L["eft_scope_35mm_5hd.compactname"] = "ATACR 7-35x56"
L["eft_scope_35mm_5hd.description"] = "Wszechstronna luneta ATACR 7-35x56 o obszernym zakresie powiększenia i szerokim polu widzenia w całym zakresie, co ułatwia dostrzeżenie i zaangażowanie celów. Wyprodukowana przez firmę Nightforce."

