L["eft_hg_ak_goliaf_mlok.printname"] = "Łoże do AKS-74U Alfa Arms Goliaf M-LOK"
L["eft_hg_ak_goliaf_mlok.compactname"] = "Goliaf M-LOK"
L["eft_hg_ak_goliaf_mlok.description"] = "To maszynowo obrobione łoże wykonane i może być zainstalowane zamiast standardowego łoża w AKS-74U. Jest wyposażone w miejsca na szyny M-LOK po trzech stronach, które umożliwiają instalację dodatkowych akcesoriów takich jak chwyty taktyczne, latarki i celowniki laserowe."

-- [[ ammo_366 ]]
L["eft_ammo_366_geksa.printname"] = ".366 TKM Geksa"
L["eft_ammo_366_geksa.compactname"] = "Geksa"
L["eft_ammo_366_geksa.description"] = "Nabój .366 TKM (9,55 × 39 mm) Geksa z pociskiem z wierzchołkiem odkrytym (SP) o masie 15,5 grama z ołowianym rdzeniem i mosiężnym półpłaszczem w stalowej łusce; przeznaczony do strzelectwa sportowego i polowań. Ten pocisk charakteryzuje się dobrą początkową ekspansją przy uderzeniu dzięki odsłonięciu ołowianego rdzenia w wierzchołku, zapewniając mu wysokiej klasy moc obalającą jak na swój kaliber, dodatkowo mogąc zadać znaczne obrażenia w celu po uderzeniu. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach do AK 7,62 × 39 mm."

L["eft_ammo_366_fmj.printname"] = ".366 TKM FMJ"
L["eft_ammo_366_fmj.compactname"] = "FMJ"
L["eft_ammo_366_fmj.description"] = "Nabój .366 TKM (9,55 × 39 mm) FMJ z pociskiem o masie 13 gramów z ołowianym rdzeniem i mosiężnym płaszczem w stalowej łusce; przeznaczony do strzelectwa sportowego i polowań. Mimo że ten nabój przeznaczony jest do polowań na małą zwierzynę, jego konstrukcja pozwala przebić podstawowe ochrony balistyczne ciała, dodatkowo zapewniając potężną moc obalającą i być w stanie spowodować ciężkie obrażenia w celu po uderzeniu. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach do AK 7,62 × 39 mm."

L["eft_ammo_366_apm.printname"] = ".366 TKM AP-M"
L["eft_ammo_366_apm.compactname"] = "AP-M"
L["eft_ammo_366_apm.description"] = "Nabój .366 TKM (9,55 × 39 mm) AP-M z przeciwpancernym pociskiem o masie 16 gramów z naboju 9 × 39 mm SP-6 GS, składającym się z rdzenia z utwardzonej stali węglowej i dwuwarstwego półpłaszcza, ołowianego wewnątrz i ze stopu na zewnątrz, w zmodyfikowanej stalowej łusce. Ten pomysłowo zaimprowizowany nabój został stworzony przez Mechanika ze względu na niepewną sytuację swoich klientów w Tarkowie, w wyniku czego powstał nabój, który może przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała i zapewnia dotkliwą moc obalającą, jednak jego własna konstrukcja zmienia jego tor lotu, przez co jest mniej celny. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach do AK 7,62 × 39 mm."

L["eft_ammo_366_eko.printname"] = ".366 TKM EKO"
L["eft_ammo_366_eko.compactname"] = "EKO"
L["eft_ammo_366_eko.description"] = "Nabój .366 TKM (9,55 × 39 mm) EKO z pociskiem o masie 6 gramów zrobionym w całości z cynku w stalowej łusce; przeznaczony do strzelectwa sportowego i polowań. Mimo że ten nabój przeznaczony jest do polowań na małą zwierzynę, jego konstrukcja pozwala przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała, dodatkowo zapewniając znaczną moc obalającą i być w stanie spowodować ciężkie obrażenia w celu po uderzeniu. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach do AK 7,62 × 39 mm."

-- [[ ammo_545 ]]
L["eft_ammo_545_hp.printname"] = "5,45 x 39 mm HP"
L["eft_ammo_545_hp.compactname"] = "HP"
L["eft_ammo_545_hp.description"] = "Nabój 5,45 × 39 mm z pociskiem z wgłębieniem wierzchołkowym (HP) o masie 3,6 grama z ołowianym rdzeniem i półpłaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Pocisk w tym naboju ma doskonałą ekspansję i energię uderzenia, które nadają mu potężną moc obalającą i może zadać znaczne obrażenia w celu po uderzeniu, czyniąc go dobrym wyborem do polowań."

L["eft_ammo_545_sp.printname"] = "5,45 x 39 mm SP"
L["eft_ammo_545_sp.compactname"] = "SP"
L["eft_ammo_545_sp.description"] = "Nabój 5,45 × 39 mm z pociskiem z wierzchołkiem odkrytym (SP) o masie 3,6 grama z ołowianym rdzeniem i półpłaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Ten pocisk charakteryzuje się dobrą początkową ekspansją przy uderzeniu dzięki odsłonięciu ołowianego rdzenia w wierzchołku, zapewniając mu dotkliwą moc obalającą kosztem zdolności penetracyjnych, nawet przeciwko podstawowym ochronom balistycznym, jednocześnie mogąc wywołać znaczne obrażenia w celu po uderzeniu."

L["eft_ammo_545_us.printname"] = "5,45 x 39 mm US GS"
L["eft_ammo_545_us.compactname"] = "US"
L["eft_ammo_545_us.description"] = "Nabój 5,45 × 39 mm US GS (indeks GRAU 7U1) z pociskiem poddźwiękowym o masie 5,1 grama z zaostrzonym rdzeniem z węglika wolframu z ołowianą podstawą i płaszczem ze stopu w stalowej łusce z osłabionym ładunkiem. Ten nabój US (Umien’szennoj Skorosti – „zmniejszona prędkość”) został zaprojektowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w połowie lat 80. XX wieku do użytku z modelami AKS-74UB i AKS-74UBN razem z tłumikiem, zapewniając, że broń będzie strzelać i osiągnie doskonałą redukcję hałasu, dodatkowo dając dotkliwą moc obalającą, ale mimo składu pocisku, ma problem z przebiciem podstawowej ochrony ciała ze względu na swoją konstrukcję i ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_prs.printname"] = "5,45 x 39 mm PRS GS"
L["eft_ammo_545_prs.compactname"] = "PRS"
L["eft_ammo_545_prs.description"] = "Nabój 5,45 × 39 mm PRS GS z miękkim pociskiem o masie 3,9 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce. Ten pocisk PRS (Poniżennoj Rikoszetirujuszczej Sposobnosti – „zmniejszona zdolność do rykoszetowania”) został zaprojektowany na początku lat 2000, aby rozpadać się i gwałtownie wytracać prędkość po uderzeniu w stały obiekt w celu znacznego zmniejszenia strat ubocznych od rykoszetów podczas operacji miejskich prowadzonych przez organy ścigania i grupy z Ministerstwa Spraw Wewnętrznych, w ten sposób osiągając dotkliwą moc obalającą celu kosztem zdolności penetracyjnych, nawet przeciw podstawowym ochronom balistycznym."

L["eft_ammo_545_t.printname"] = "5,45 x 39 mm T GS"
L["eft_ammo_545_t.compactname"] = "T"
L["eft_ammo_545_t.description"] = "Nabój 5,45 × 39 mm T GS (indeks GRAU 7T3) ze smugowym pociskiem o masie 3,2 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten pocisk T (Trassirujuszczij – „smugowy”) został wprowadzony w 1974 roku razem z nabojem PS GS (indeks GRAU 7N6), by dodać możliwości smugowe do broni radzieckiego kalibru 5,45 × 39 mm, jednocześnie będąc w stanie przebić podstawowe ochrony balistyczne ciała, poza tym mając znaczną moc obalającą. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_fmj.printname"] = "5,45 x 39 mm FMJ"
L["eft_ammo_545_fmj.compactname"] = "FMJ"
L["eft_ammo_545_fmj.description"] = "Nabój 5,45 × 39 mm z pełnopłaszczowym (FMJ) pociskiem o masie 3,9 grama z ołowianym rdzeniem w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego. Pomimo swojej podstawowej konstrukcji, jest w stanie przebić podstawowe ochrony balistyczne ciała, mając poza tym znaczną moc obalającą."

L["eft_ammo_545_7n40.printname"] = "5,45 x 39 mm 7N40"
L["eft_ammo_545_7n40.compactname"] = "7N40"
L["eft_ammo_545_7n40.description"] = "Najnowszy legendarny nabój o zwiększonej celności 7N40. Wykonany w ramach programu Ratnik wraz z 7N39 PPBS „Igolnik”."

L["eft_ammo_545_ps.printname"] = "5,45 x 39 mm PS GS"
L["eft_ammo_545_ps.compactname"] = "PS"
L["eft_ammo_545_ps.description"] = "Nabój 5,45 × 39 mm PS GS (indeks GRAU 7N6) z pociskiem o masie 3,4 grama ze stalowym rdzeniem z ołowianą okładziną na wierzchołku i płaszczem ze stopu w stalowej łusce. Pocisk PS (Pula so Stalnym sierdiecznikom – „pocisk ze stalowym rdzeniem”) został wprowadzony do użytku w 1974 roku razem z radzieckim nabojem 5,45 × 39 mm, dając Armii Radzieckiej możliwość przebić podstawowe ochrony balistyczne ciała, jednak ze względu na swoją konstrukcję, ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_bp.printname"] = "5,45 x 39 mm BP GS"
L["eft_ammo_545_bp.compactname"] = "BP"
L["eft_ammo_545_bp.description"] = "Nabój 5,45 × 39 mm BP GS (indeks GRAU 7N22) z przeciwpancernym pociskiem o masie 3,7 grama z rdzeniem z utwardzonej stali węglowej z ołowianą okładziną na wierzchołku i płaszczem ze stopu w stalowej łusce. Pocisk BP (Broniebojnaja Pula – „pocisk przebijający pancerz”) został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w 1998 roku na bazie naboju 5,45 × 39 mm PP GS w celu ulepszenia jego konstrukcji i zdolności penetracyjnych, co zaowocowało poprawą w przebijaniu niektórych pośrednich modeli ochrony balistycznej ciała, jednak ze względu na swoją konstrukcję ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_pp.printname"] = "5,45 x 39 mm PP GS"
L["eft_ammo_545_pp.compactname"] = "PP"
L["eft_ammo_545_pp.description"] = "Nabój 5,45 × 39 mm PP GS (indeks GRAU 7N10) z pociskiem o masie 3,5 grama z utwardzonym cieplnie stalowym rdzeniem z ołowianą okładziną na wierzchołku i płaszczem ze stopu w stalowej łusce. Pocisk PP (Powyszennoj Probiwajemosti – „zwiększona penetracja”) został opracowany przez w latach 90. XX wieku jako ulepszona wersja tego stosowanego w naboju 5,45 × 39 mm PS GS, jako że wybrano dłuższy i cieńszy rdzeń ze stali hartowanej, pozwalając mu przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała, jednak ze względu na swoją konstrukcję, ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_bt.printname"] = "5,45 x 39 mm BT GS"
L["eft_ammo_545_bt.compactname"] = "BT"
L["eft_ammo_545_bt.description"] = "Nabój 5,45 × 39 mm BT GS (indeks GRAU 7BT4) ze smugowym przeciwpancernym pociskiem o masie 3,1 grama z utwardzonym cieplnie stalowym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten pocisk BT (Broniebojnaja Trassirujuszczaja – „przebijający pancerz smugowy”) jest ulepszoną wersją używanego w 5,45 × 39 mm T GS naboju (indeks GRAU 7T3), dlatego, że ołowiany rdzeń zamieniono w utwardzoną cieplnie stal, zapewniając broniom automatycznym zdolności penetracyjne przeciw podstawowym ochronom balistycznym ciała i świetne wyniki przeciw modelom pośrednim, jednak ze względu na swoją konstrukcję ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_bs.printname"] = "5,45 x 39 mm BS GS"
L["eft_ammo_545_bs.compactname"] = "BS"
L["eft_ammo_545_bs.description"] = "Nabój 5,45 × 39 mm BS GS (indeks GRAU 7N24) z przeciwpancernym pociskiem o masie 4,1 grama z zaostrzonym rdzeniem z węglika wolframu z ołowianą podstawą i płaszczem ze stopu w stalowej łusce. Ten pocisk BS (Broniebojnyj Sierdiecznik – „przebijający pancerz rdzeń”) został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) w 1998 roku, by znacznie zwiększyć możliwości penetracyjne rosyjskich broni kalibru 5,45 × 39 mm, będąc w stanie przebić podstawowe i pośrednie modele ochrony balistycznej ciała, dodatkowo zapewniając świetne rezultaty przeciwko niektórym specjalistycznym modelom, mimo posiadania względnie niskiej prędkości wylotowej w porównaniu do innych nabojów. Jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_545_ppbs.printname"] = "5,45 x 39 mm PPBS GS „Igolnik”"
L["eft_ammo_545_ppbs.compactname"] = "PPBS"
L["eft_ammo_545_ppbs.description"] = "Nabój 5,45 × 39 mm PPBS GS (indeks GRAU 7N39) z przeciwpancernym pociskiem o masie 4 gramów z zaostrzonym rdzeniem z węglika wolframu i dwuwarstwowym płaszczem, ołowianym wewnątrz i ze stopu na zewnątrz w stalowej łusce. Ten eksperymentalny nabój został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) i TechKomplekt pod nazwą PPBS (Powyszennoj Probiwajemosti, Broniebojnyj Sierdiecznik – „zwiększona penetracja, przeciwpancerny rdzeń”) „Igolnik” („Igielnik”) na bazie naboju 5,45 × 39 mm BS GS w celu zwiększenia jego zdolności penetracyjnych, zapewniając świetne wyniki przeciwko większości współczesnych specjalistycznych ochron balistycznych ciała, dodatkowo będąc w stanie przebijać lekkie osłony i lekkie pojazdy opancerzone, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

-- [[ charge_ak ]]
L["eft_charge_ak_css.printname"] = "Nakładka na suwadło do AK CSS, profilowana"
L["eft_charge_ak_css.compactname"] = "CSS AK"
L["eft_charge_ak_css.description"] = "Profilowana nakładka na suwadło CSS daje użytkownikowi ulepszony powiększony chwyt do łatwiejszego operowania bronią. Chwyt ten działa na wszystkich karabinkach i strzelbach Wiepr i Sajga oraz na większości broni opartych na platformie AK."

L["eft_charge_ak_rp1.printname"] = "Nakładka na suwadło do AK Zenit RP-1"
L["eft_charge_ak_rp1.compactname"] = "RP-1"
L["eft_charge_ak_rp1.description"] = "Nakładka na suwadło RP-1 to maszynowo obrobiona nakładka wykonana ze stopu aluminium D16T z czarną powłoką. Jest kompatybilna z wszystkimi modelami karabinków z rodziny AK. RP-1 jest większa i wygodniejsza niż standardowe suwadło, co poprawia ergonomię broni i czyni obsługę bardziej komfortową. RP-1 instalowana jest na podstawowym suwadle poprzez dołączone do zestawu śruby. Wyprodukowana przez firmę Zenit."

-- [[ gas_ak ]]
L["eft_gas_ak_6p1.printname"] = "Rura gazowa do AKM (6P1 Sb.1-2)"
L["eft_gas_ak_6p1.compactname"] = "6P1 Sb.1-2"
L["eft_gas_ak_6p1.description"] = "Standardowa rura gazowa do karabinka automatycznego AKM. Rury gazowe wpływają na kierunek przemieszczania się tłoka gazowego."

L["eft_gas_ak_6p20.printname"] = "Rura gazowa do AK-74 (6P20 Sb.1-2)"
L["eft_gas_ak_6p20.compactname"] = "6P20 Sb.1-2"
L["eft_gas_ak_6p20.description"] = "Standardowa rura gazowa do karabinka automatycznego AK-74. Rury gazowe wpływają na kierunek przemieszczania się tłoka gazowego."

L["eft_gas_ak_m1b.printname"] = "Rura gazowa i łoże do AK UltiMAK M1-B"
L["eft_gas_ak_m1b.compactname"] = "M1-B"
L["eft_gas_ak_m1b.description"] = "Rura gazowa UltiMAK M1-B do karabinków automatycznych AK przekierowuje gazy wylotowe, które wprawiają tłoczysko w ruch, a także pozwala na zainstalowanie celowników i akcesoriów taktycznych."

L["eft_gas_ak_molot.printname"] = "Rura gazowa typu AKM Molot Arms"
L["eft_gas_ak_molot.compactname"] = "Mołot gaz"
L["eft_gas_ak_molot.description"] = "Rura gazowa do karabinków typu AKM i Wiepr. Wyprodukowana przez firmę Molot Arms. Rury gazowe wpływają na kierunek przemieszczania się tłoka gazowego."

L["eft_gas_ak_troy.printname"] = "Rura gazowa i łoże z szyną o pełnej długości do AK TROY"
L["eft_gas_ak_troy.compactname"] = "TROY Combo"
L["eft_gas_ak_troy.description"] = "Rura gazowa i łoże z szyną o pełnej długości. Otwory chłodzące pozwalają na chłodne działanie szyny, nawet po przedłużonym strzelaniu. Wykonane z utwardzonego aluminium lotniczego z elementami ze stali nierdzewnej i wykończone anodowaniem twardą powłoką. Wyposażone w 5-calową górną szynę do instalacji optyki i urządzeń taktycznych. Wyprodukowana przez firmę TROY Industries."

L["eft_gas_ak_vdmcs.printname"] = "Rura gazowa do AK Kiba Arms VDM CS"
L["eft_gas_ak_vdmcs.compactname"] = "VDM CS"
L["eft_gas_ak_vdmcs.description"] = "Niestandardowa rura gazowa do specyficznych nakładek lufy karabinków z rodziny AK."

L["eft_gas_ak_vs24vs33.printname"] = "Rura gazowa i łoże do AK Wieżliwyj Striełok VS-24 + VS-33c"
L["eft_gas_ak_vs24vs33.compactname"] = "VS Combo"
L["eft_gas_ak_vs24vs33.description"] = "Połączony zestaw łoża VS-24 i rury gazowej VS-33c, może być zainstalowany na karabinkach z rodziny AK kalibru 5,45 × 45 mm, 5,45 × 39 mm oraz 7,62 × 39 mm. Wyprodukowany przez firmę Wieżliwyj Striełok."

L["eft_gas_ak_vs24vs33_w.printname"] = "Rura gazowa i łoże do AK Wieżliwyj Striełok VS-24 + VS-33c (białe)"
L["eft_gas_ak_vs24vs33_w.compactname"] = "WS kombo"
L["eft_gas_ak_vs24vs33_w.description"] = "Połączony zestaw łoża VS-24 i rury gazowej VS-33c. może być montowany na karabinkach z rodziny AK kalibru 5,45 × 45 mm, 5,45 × 39 mm oraz 7,62 × 39 mm. Wyprodukowany przez firmę Wieżliwyj Striełok. Wersja biała."

L["eft_gas_rd704_ionlite.printname"] = "Rura gazowa i łoże z szyną do RD-704 SLR ION Lite"
L["eft_gas_rd704_ionlite.compactname"] = "ION Lite 9″"
L["eft_gas_rd704_ionlite.description"] = "Połączony zestaw 9-calowego łoża ION Lite z rurą gazową, może być zainstalowany na karabinku automatycznym RD-704. Wyprodukowany przez firmę SLR."

-- [[ grip_ak ]]
L["eft_grip_ak_6p1sb8.printname"] = "Chwyt pistoletowy do AK, polimerowy (6P1 Sb.8)"
L["eft_grip_ak_6p1sb8.compactname"] = "6P1 Sb.8"
L["eft_grip_ak_6p1sb8.description"] = "Polimerowy chwyt pistoletowy do karabinków automatycznych AK i kompatybilnych zaprojektowany, by zastąpić stary bakelitowy chwyt. Wyprodukowany przez zakłady Iżmasz."

L["eft_grip_ak_6p1sb8v.printname"] = "Chwyt pistoletowy do AK, bakelitowy (6P1 Sb.8V)"
L["eft_grip_ak_6p1sb8v.compactname"] = "64P Sb.8V"
L["eft_grip_ak_6p1sb8v.description"] = "Bakelitowy chwyt pistoletowy do karabinków automatycznych AK i kompatybilnych. Wyprodukowany przez zakłady Iżmasz."

L["eft_grip_ak_6p4sb9.printname"] = "Chwyt pistoletowy do AK, bakelitowy (6P4 Sb.9)"
L["eft_grip_ak_6p4sb9.compactname"] = "6P4 Sb.9"
L["eft_grip_ak_6p4sb9.description"] = "Bakelitowy chwyt pistoletowy do karabinków automatycznych AK i kompatybilnych. Wyprodukowany przez zakłady Iżmasz."

L["eft_grip_ak_aeroknox.printname"] = "Chwyt pistoletowy do AK Aeroknox Scorpius"
L["eft_grip_ak_aeroknox.compactname"] = "Scorpius"
