L["eft_hg_ak_6p20sb6.printname"] = "Łoże do AK-74, drewniane (6P20 Sb.6)"
L["eft_hg_ak_6p20sb6.compactname"] = "6P20 Sb.6"
L["eft_hg_ak_6p20sb6.description"] = "Standrowe łoże do karabinka automatycznego AK-74. Wyprodukowane przez zakłady Iżmasz."

L["eft_hg_ak_6p20sb9.printname"] = "Łoże do AK-74, polimerowe (6P20 Sb.9)"
L["eft_hg_ak_6p20sb9.compactname"] = "6P20 Sb.9"
L["eft_hg_ak_6p20sb9.description"] = "Polimerowe łoże do karabinka automatycznego AK-74, która zamieniła klasyczną drewnianą. Wyprodukowane przez zakłady Iżmasz."

L["eft_hg_ak_6p20sb9p.printname"] = "Łoże do AK-74 6P20 Sb.9, polimerowe (śliwka)"
L["eft_hg_ak_6p20sb9p.compactname"] = "6P20 Sb.9 śl"
L["eft_hg_ak_6p20sb9p.description"] = "Polimerowe łoże do karabinka automatycznego AK-74. Wyprodukowane przez zakłady Iżmasz. Zrobione z polimeru w kolorze śliwkowym, co dało mu przydomek „Sliwoj” („śliwka”)."

L["eft_hg_ak_agressor.printname"] = "Łoże do AK 5.45 Design Aggressor"
L["eft_hg_ak_agressor.compactname"] = "Aggressor"
L["eft_hg_ak_agressor.description"] = "Łoże z szynami Aggressor do karabinków automatycznych AK i kompatybilnych. Wyprodukowane przez firmę 5.45 Design. Posiada 4 boczne szyny do instalacji urządzeń taktycznych i 2 długie szyny do instalacji różnego rodzaju optyki i chwytów przednich."

L["eft_hg_ak_ak100.printname"] = "Łoże do serii AK-100, polimerowe"
L["eft_hg_ak_ak100.compactname"] = "AK100"
L["eft_hg_ak_ak100.description"] = "Polimerowe łoże do karabinków automatycznych AK serii 100. Wyprodukowane przez zakłady Iżmasz. Dalsza modyfikacja polimerowego łoża AK-74M. Posiada dolny montaż do instalacji chwytów taktycznych."

L["eft_hg_ak_akm_l.printname"] = "Łoże do AK TDI AKM-L"
L["eft_hg_ak_akm_l.compactname"] = "AKM-L"
L["eft_hg_ak_akm_l.description"] = "TDI Arms AKM-L może być zainstalowane na broni kompatybilnej z systemami AKM/AK-74. Wyposażone w montaż M-LOK do instalacji dodatkowych urządzeń lub szyn."

L["eft_hg_ak_akm_l_ab.printname"] = "Łoże do AK TDI AKM-L (anodowany brązowy)"
L["eft_hg_ak_akm_l_ab.compactname"] = "AKM-L"
L["eft_hg_ak_akm_l_ab.description"] = "TDI Arms AKM-L może być zainstalowane na broni kompatybilnej z systemami AKM/AK-74. Wyposażone w montaż M-LOK do instalacji dodatkowych urządzeń lub szyn. Wersja anodowana brązowa."

L["eft_hg_ak_akm_l_ar.printname"] = "Łoże do AK TDI AKM-L (anodowany czerwony)"
L["eft_hg_ak_akm_l_ar.compactname"] = "AKM-L"
L["eft_hg_ak_akm_l_ar.description"] = "TDI Arms AKM-L może być zainstalowane na broni kompatybilnej z systemami AKM/AK-74. Wyposażone w montaż M-LOK do instalacji dodatkowych urządzeń lub szyn. Wersja anodowana czerwona."

L["eft_hg_ak_b10.printname"] = "Łoże do AK Zenit B-10"
L["eft_hg_ak_b10.compactname"] = "B-10"
L["eft_hg_ak_b10.description"] = "Obrobione mechanicznie łoże B-10 jest wykonane ze stopu aluminium D16T z czarną powłoką i może być zainstalowane zamiast standardowego łoża w AK. Wyposażone w szyny Picatinny po obu stronach, które umożliwiają instalację dodatkowych akcesoriów, takich jak chwyty taktyczne, latarki czy celowniki laserowe. Wyprodukowane przez firmę Zenit."

L["eft_hg_ak_b10mb19.printname"] = "Łoże do AK Zenit B-10M z montażem górnym B-19"
L["eft_hg_ak_b10mb19.compactname"] = "B10M+B19"
L["eft_hg_ak_b10mb19.description"] = "Obrobione mechanicznie łoże B-10M jest wykonane ze stopu aluminium D16T z czarną powłoką i może być zainstalowane zamiast standardowego łoża w AK serii 103, 104, 105, 74S, 74M, AKM i AKMS. Montaż B-19 to w zasadzie montaż optyki w postaci nakładki rury gazowej. Również obrobiony mechanicznie ze stopu aluminium D16T z czarną powłoką, może być zainstalowany na łożach B-10M lub B-21M. Wyprodukowane przez firmę Zenit."

L["eft_hg_ak_b11.printname"] = "Łoże do AKS-74U Zenit B-11"
L["eft_hg_ak_b11.compactname"] = "B-11"
L["eft_hg_ak_b11.description"] = "Obrobione mechanicznie łoże B-11 jest wykonane ze stopu aluminium D16T z czarną powłoką i może być zainstalowane zamiast standardowego łoża w AKS-74U. Wyposażone w szyny Picatinny po trzech stronach, które umożliwiają montaż akcesoriów, takich jak chwyty taktyczne, latarki czy celowniki laserowe. Wyprodukowane przez firmę Zenit."

L["eft_hg_ak_b30b31s.printname"] = "Łoże do AK Zenit B-30 z górną szyną B-31S"
L["eft_hg_ak_b30b31s.compactname"] = "B-30+B-31S"
L["eft_hg_ak_b30b31s.description"] = "W całości maszynowo obrobione łoże wykonane ze stopu aluminium D16T z czarną powłoką przeznaczone do instalacji zamiast standardowego łoża na karabinkach automatycznych AK z serii 103, 104, 105, 74S, 74M, AKM i AKMS. Szyna montażowa B-31S nad rurą gazową jest w całości maszynowo obrobionym mocowaniem wykonanym ze stopu aluminium D16T z czarną powłoką, zamontowana na łożu B-30. Wyprodukowane przez firmę Zenit."

L["eft_hg_ak_cmrd.printname"] = "Łoże do AK Vltor CMRD KeyMod"
L["eft_hg_ak_cmrd.compactname"] = "CMRD"
L["eft_hg_ak_cmrd.description"] = "Lekkie łoże CMDR, kompatybilne z karabinkami automatycznymi AK-74 i serią AKM, posiada gniazda KeyMod do instalacji szyny. Wyprodukowane przez firmę Vltor."

L["eft_hg_ak_cncguns.printname"] = "Łoże do AK CNC Guns OV GP"
L["eft_hg_ak_cncguns.compactname"] = "OV GP"
L["eft_hg_ak_cncguns.description"] = "Łoże OV GP do karabinów automatycznych serii AK, wyposażony w interfejs KeyMod umożliwiający montaż dodatkowych urządzeń i akcesoriów. Wyprodukowany przez firmę CNC Guns."

L["eft_hg_ak_goliaf.printname"] = "Łoże do AKS-74U Alfa Arms Goliaf"
L["eft_hg_ak_goliaf.compactname"] = "Goliaf"
L["eft_hg_ak_goliaf.description"] = "To maszynowo obrobione łoże wykonane jest ze stopu aluminium D16T z brązową powłoką koloru coyote brown i może być zainstalowane zamiast standardowego łoża w AKS-74U. Jest wyposażone w szyny Picatinny po trzech stronach, które umożliwiają instalację dodatkowych akcesoriów takich jak chwyty taktyczne, latarki i celowniki laserowe."

L["eft_hg_ak_hexagon.printname"] = "Łoże cylindryczne do AK Hexagon"
L["eft_hg_ak_hexagon.compactname"] = "Hexagon AK"
L["eft_hg_ak_hexagon.description"] = "Cylindryczne łoże do karabinów automatycznych z rodziny AK. Wyprodukowane przez firmę Hexagon."

L["eft_hg_ak_hexagon_r.printname"] = "Łoże cylindryczne do AK Hexagon (anodowany czerwony)"
L["eft_hg_ak_hexagon_r.compactname"] = "Hexagon AK"
L["eft_hg_ak_hexagon_r.description"] = "Cylindryczne łoże do karabinów automatycznych z rodziny AK. Wyprodukowane przez firmę Hexagon. Wersja anodowana czerwona. DA RED GOEZ FASTA!"

L["eft_hg_ak_moe.printname"] = "Łoże do AK Magpul MOE AKM (czarne)"
L["eft_hg_ak_moe.compactname"] = "MOE AKM"
L["eft_hg_ak_moe.description"] = "Łoże MOE AKM jest instalowane na systemach broni kompatybilnych z AKM/AK-74. Jest wyposażone w licencjonowane punkty montażowe M-LOK do instalacji dodatkowych urządzeń lub szyn. Wyprodukowane przez firmę Magpul. Wersja czarna."

L["eft_hg_ak_moe_fde.printname"] = "Łoże do AK Magpul MOE AKM (FDE)"
L["eft_hg_ak_moe_fde.compactname"] = "MOE AKM"
L["eft_hg_ak_moe_fde.description"] = "Łoże MOE AKM jest instalowane na systemach broni kompatybilnych z AKM/AK-74. Jest Wyposażone w licencjonowane punkty montażowe M-LOK do instalacji dodatkowych urządzeń lub szyn. Wyprodukowane przez firmę Magpul. Wersja Flat Dark Earth."

L["eft_hg_ak_moe_olv.printname"] = "Łoże do AK Magpul MOE AKM (Olive Drab)"
L["eft_hg_ak_moe_olv.compactname"] = "MOE AKM"
L["eft_hg_ak_moe_olv.description"] = "Łoże MOE AKM jest instalowane na systemach broni kompatybilnych z AKM/AK-74. Jest Wyposażone w licencjonowane punkty montażowe M-LOK do instalacji dodatkowych urządzeń lub szyn. Wyprodukowane przez firmę Magpul. Wersja Olive Drab."

L["eft_hg_ak_moe_plm.printname"] = "Łoże do AK Magpul MOE AKM (śliwka)"
L["eft_hg_ak_moe_plm.compactname"] = "MOE AKM"
L["eft_hg_ak_moe_plm.description"] = "Łoże MOE AKM jest instalowane na systemach broni kompatybilnych z AKM/AK-74. Jest Wyposażone w licencjonowane punkty montażowe M-LOK do instalacji dodatkowych urządzeń lub szyn. Wyprodukowane przez firmę Magpul. Wersja z polimeru w kolorze śliwkowym."

L["eft_hg_ak_moe_sg.printname"] = "Łoże do AK Magpul MOE AKM (Stealth Grey)"
L["eft_hg_ak_moe_sg.compactname"] = "MOE AKM"
L["eft_hg_ak_moe_sg.description"] = "Łoże MOE AKM jest instalowane na systemach broni kompatybilnych z AKM/AK-74. Jest Wyposażone w licencjonowane punkty montażowe M-LOK do instalacji dodatkowych urządzeń lub szyn. Wyprodukowane przez firmę Magpul. Wersja Stealth Grey."

L["eft_hg_ak_rs47.printname"] = "Łoże do AK CAA RS47"
L["eft_hg_ak_rs47.compactname"] = "RS47"
L["eft_hg_ak_rs47.description"] = "Lekkie polimerowe łoże, pasuje do większości karabinków i subkarabinków opartych na AK. Wyposażone w dwie krótkie i dwie długie szyny montażowe do instalacji dodatkowego sprzętu. Wyprodukowane przez firmę Command Arms."

L["eft_hg_ak_trax1.printname"] = "Łoże do AK Strike Industries TRAX 1"
L["eft_hg_ak_trax1.compactname"] = "TRAX 1"
L["eft_hg_ak_trax1.description"] = "TRAX 1 jest wymiennym modułowym łożem z systemem szyn, wszechstronne, lekkie i trwałe. Zapewnia użytkownikowi elastyczną platformę do montażu akcesoriów. Może być łączone z szyną TRAX 2 dla maksymalnej modularności. Wyprodukowane przez firmę Strike Industries."

L["eft_hg_ak_trax2.printname"] = "Rozszerzenie łoża do AK Strike Industries TRAX 2"
L["eft_hg_ak_trax2.compactname"] = "TRAX 2"
L["eft_hg_ak_trax2.description"] = "TRAX 2 jest przednią szyną, która zasłania rurę gazową. Dodaje dodatkowe miejsca na montaż akcesoriów. Wymaga szyny TRAX Bridge zamontowanej na łożu TRAX 1. Wyprodukowana przez firmę Strike Industries."

L["eft_hg_ak_trax_bridge.printname"] = "Szyna Strike Industries TRAX Bridge"
L["eft_hg_ak_trax_bridge.compactname"] = "TRAX Bridge"
L["eft_hg_ak_trax_bridge.description"] = "TRAX Bridge jest szyną, którą montuje się na łożu TRAX 1, by zainstalować dodatkowe rozszerzenie łoża TRAX 2. Wyprodukowana przez firmę Strike Industries."

L["eft_hg_ak_ufm.printname"] = "Łoże do AK Krebs Custom UFM KeyMod"
L["eft_hg_ak_ufm.compactname"] = "UFM"
L["eft_hg_ak_ufm.description"] = "Lekkie aluminiowe łoże Krebs Custom UFM KeyMod System do karabinków automatycznych z rodziny AK z gniazdami KeyMod do instalacji szyn montażowych. Do instalacji wymagana jest rura gazowa Kiba Arms VDM CS."

L["eft_hg_ak_vpo136.printname"] = "Łoże do WPO-136 „Wiepr-KM”, drewniane"
L["eft_hg_ak_vpo136.compactname"] = "WPO136"
L["eft_hg_ak_vpo136.description"] = "Standardowe drewniane łoże do karabinka WPO-136 „Wiepr-KM”. Wyprodukowane przez firmę Molot Arms."

L["eft_hg_ak_vpo209.printname"] = "Łoże do WPO-209, drewniane"
