L["eft_muzzle_ar15_warcomp.printname"] = "Tłumik płomieni do AR-15 SureFire WarComp 5,56 x 45"
L["eft_muzzle_ar15_warcomp.compactname"] = "WarComp 556"
L["eft_muzzle_ar15_warcomp.description"] = "Tłumik płomieni WarComp do broni opartych o platformę AR-15. Wyprodukowany przez firmę SureFire."

L["eft_muzzle_ar15_ferfrans.printname"] = "Hamulec wylotowy do AR-15 Ferfrans CQB 5,56 x 45"
L["eft_muzzle_ar15_ferfrans.compactname"] = "CQB 556"
L["eft_muzzle_ar15_ferfrans.description"] = "Hamulec wylotowy CQB, może być też wyposażony w modułowe urządzenie do redukcji wstrząsów. Wyprodukowany przez firmę Ferfrans."

L["eft_muzzle_ar15_glok.printname"] = "Tłumik płomieni do AR-15 Griffin Armament Gate-LOK Hammer 5,56 x 45"
L["eft_muzzle_ar15_glok.compactname"] = "G-LOK"
L["eft_muzzle_ar15_glok.description"] = "Gate-LOK Hammer zmniejsza odrzut i zapewnia maksymalną żywotność tłumika. Wyprodukowany przez firmę Griffin Armament."

L["eft_muzzle_ar15_st6012.printname"] = "Hamulec wylotowy do AR-15 Bulletec ST-6012 5,56 x 45"
L["eft_muzzle_ar15_st6012.compactname"] = "ST6012 556"
L["eft_muzzle_ar15_st6012.description"] = "ST-6012 jest skutecznym hamulcem wylotowym do broni opartej o platformę AR-15 i kompatybilnych. Wyprodukowany przez firmę Bulletec."

L["eft_muzzle_ar15_psr556.printname"] = "Hamulec wylotowy do AR-15 AWC PSR 5,56 x 45"
L["eft_muzzle_ar15_psr556.compactname"] = "PSR 556"
L["eft_muzzle_ar15_psr556.description"] = "PRS jest skutecznym hamulcem wylotowym kalibru 5,56 × 45 mm NATO. Ogranicza odrzut i kontruje podrzut lufy. Ten hamulec wylotowy jest gwintowany i kompatybilny z tłumikami dźwięku AWC PSR THOR. Wyprodukowany przez firmę AWC Silencers."

L["eft_muzzle_ar15_annih.printname"] = "Tłumik płomieni do Yankee Hill Annihilator, wielokalibrowy"
L["eft_muzzle_ar15_annih.compactname"] = "Annihilator"
L["eft_muzzle_ar15_annih.description"] = "Wielokalibrowy tłumik płomienia zaprojektowany do platformy AR-15, pasuje do luf kalibru 7,62 × 51 mm, 5,56 × 45 mm i 9 × 19 mm. Wyprodukowany przez firmę Yankee Hill."

L["eft_muzzle_ar15_usgia2.printname"] = "Tłumik płomieni do AR-15 Colt USGI A2 5,56 x 45"
L["eft_muzzle_ar15_usgia2.compactname"] = "USGI A2"
L["eft_muzzle_ar15_usgia2.description"] = "Tłumik płomieni USGI A2 (znany także jako „bird cage”) zaprojektowany do montażu na broni kalibru 5,56 × 45 mm opartej na systemie AR-15, ale może być instalowany na innej broni tego samego kalibru, jeżeli lufa ma ten sam rodzaj gwintu na urządzenia wylotowe. Standardowe urządzenie wylotowe do karabinka automatycznego M4A1. Wyprodukowany przez firmę Colt."

L["eft_muzzle_ar15_adar.printname"] = "Tłumik płomieni do AR-15 ADAR 2-15 5,56 x 45"
L["eft_muzzle_ar15_adar.compactname"] = "ADAR"
L["eft_muzzle_ar15_adar.description"] = "Standardowy tłumik płomieni do karabinka ADAR 2-15 kalibru 5,56 × 45 mm."

L["eft_muzzle_ar15_aac51t.printname"] = "Tłumik płomieni do AR-15 AAC Blackout 51T 5,56 x 45"
L["eft_muzzle_ar15_aac51t.compactname"] = "51T 556"
L["eft_muzzle_ar15_aac51t.description"] = "Blackout 51T jest skutecznym tłumikiem płomieni, który służy również jako platforma do dołączania tłumika dźwięku 762-SDN-6. Może być instalowany na opartej na systemie AR-15. Wyprodukowany przez firmę Advanced Armament Corporation (AAC)."

L["eft_muzzle_ar15_blitz.printname"] = "Tłumik płomieni do AR-15 HK BLITZ 5,56 x 45"
L["eft_muzzle_ar15_blitz.compactname"] = "BLITZ 556"
L["eft_muzzle_ar15_blitz.description"] = "Tłumik płomieni do użycia na broni w stylu AR-15. Hamulec wylotowy BLITZ jest jedną z najskuteczniejszych dostępnych konstrukcji i świetną modernizacją dla podstawowego AR-15."

L["eft_muzzle_ar15_wave.printname"] = "Hamulec wylotowy do AR-15 Daniel Defense WAVE 5,56 x 45"
L["eft_muzzle_ar15_wave.compactname"] = "WAVE 556"
L["eft_muzzle_ar15_wave.description"] = "Hamulec wylotowy WAVE zaprojektowany, by bezpiecznie mocować tłumik dźwięku do broni palnej, ale działa też dobrze bez niego. Wyprodukowany ze stali nierdzewnej 17-4 PH stosowanej w przemyśle powietrznym i pod koniec azotowany w kąpieli solnej dla zminimalizowania korozji. Wyprodukowany przez firmę Daniel Defense."

L["eft_muzzle_ar15_mdr.printname"] = "Tłumik płomieni Desert Tech 5,56 x 45"
L["eft_muzzle_ar15_mdr.compactname"] = "MDR 556"
L["eft_muzzle_ar15_mdr.description"] = "Tłumik płomieni zaprojektowany specjalnie do karabinka automatycznego MDR kalibru 5,56 × 45 mm. Wyprodukowany przez firmę Desert Tech."

L["eft_muzzle_ar15_kacqdc.printname"] = "Tłumik płomieni do AR-15 KAC QDC 5,56 x 45"
L["eft_muzzle_ar15_kacqdc.compactname"] = "QDC 556"
L["eft_muzzle_ar15_kacqdc.description"] = "Hamulec wylotowy z tłumikiem płomieni KAC 5,56 QD jest skutecznym urządzeniem wylotowym, służącym również jako platforma do mocowania tłumika dźwięku QDSS-NT4 z systemem szybkiego odłączania KAC. Instalowana na broni opartej na platformie AR-15."

L["eft_muzzle_ar15_kx3.printname"] = "Tłumik płomieni do AR-15 Noveske KX3 5,56 x 45"
L["eft_muzzle_ar15_kx3.compactname"] = "KX3 5,56"
L["eft_muzzle_ar15_kx3.description"] = "Tłumik płomieni Noveske KX3, znany także jako „Płonąca świnia”, został zaprojektowany, aby zwiększyć niezawodność krótkolufowych członków rodziny AR-15, zwiększając ciśnienie wsteczne oraz kierując błysk z lufy w przód. Mimo że zaprojektowany został dla krótkolufowych wersji AR-15, będzie on działał na lufie każdej długości i z wieloma systemami montażu. Ten KX3 może zostać użyty na lufie 5,56 mm z gwintem 1/2x28."

L["eft_muzzle_ar15_crd.printname"] = "Urządzenie do redukcji wstrząsów Ferfrans CRD 5,56 x 45"
L["eft_muzzle_ar15_crd.compactname"] = "CRD 556"
L["eft_muzzle_ar15_crd.description"] = "Urządzenie wylotowe Concussion Reduction Device („urządzenie do redukcji wstrząsów”) kalibru 5,56 × 45 mm. Wyprodukowane przez firmę Ferfrans."

L["eft_muzzle_ar15_corvette.printname"] = "Hamulec wylotowy do AR-15 Nordic Components Corvette 5,56 x 45"
L["eft_muzzle_ar15_corvette.compactname"] = "Vette 556"
L["eft_muzzle_ar15_corvette.description"] = "Hamulec wylotowy Corvette kalibru 5,56 × 45 mm ogranicza odrzut i skręt lufy poprzez odprowadzanie gazów na górę i do boku. Wyprodukowany przez firmę Nordic Components."

L["eft_muzzle_ar15_sf3p.printname"] = "Tłumik płomieni do AR-15 SureFire SF3P 5,56 x 45"
L["eft_muzzle_ar15_sf3p.compactname"] = "SF3P-556"
L["eft_muzzle_ar15_sf3p.description"] = "Zaawansowany 3-bolcowy tłumik płomieni SF3P-556 pasujący do broni M4/M16 i kompatybilnych znacząco ogranicza błysk wystrzału. SF3P-556 jest także solidnym adapterem montażowym dla serii tłumików dźwięku SureFire SOCOM 5,56 mm Fast-Attach. Wyprodukowany przez firmę SureFire."

L["eft_muzzle_ar15_asr.printname"] = "Tłumik płomieni do AR-15 SilencerCo ASR 5,56 x 45"
L["eft_muzzle_ar15_asr.compactname"] = "ASR 556"
L["eft_muzzle_ar15_asr.description"] = "Tłumik płomieni ASR 5,56 × 45 mm jest skutecznym tłumikiem płomieni, który służy również jako platforma do dołączania tłumiku dźwięku SilencerCo Saker 556. Może być zainstalowany na broni opartej na systemie AR-15. Wyprodukowany przez firmę SilencerCo."

L["eft_muzzle_ar15_223cb.printname"] = "Hamulec wylotowy do AR-15 Thunder Beast Arms 223CB 5,56 x 45"
L["eft_muzzle_ar15_223cb.compactname"] = "223CB"
L["eft_muzzle_ar15_223cb.description"] = "223CB jest skutecznym hamulcem wylotowym, który służy również jako platforma do dołączania tłumika dźwięku z systemem szybkiego odłączania Ultra 5. Wyprodukowany przez firmę Thunder Beast Arms."

L["eft_muzzle_ar15_fh556rc.printname"] = "Tłumik płomieni do AR-15 SureFire SF4P 5,56 x 45"
L["eft_muzzle_ar15_fh556rc.compactname"] = "SF4P-556"
L["eft_muzzle_ar15_fh556rc.description"] = "Zaawansowany tłumik płomieni FH556RC-556, pasujący do broni M4/M16 i kompatybilnych, znacznie ogranicza błysk wystrzału. Pozwala montować tłumiki dźwięku z systemem szybkiego odłączania SOCOM556. Wyprodukowany przez firmę SureFire."

L["eft_muzzle_ar15_zk23.printname"] = "Hamulec wylotowy do AR-15 TAA ZK-23 5,56 x 45"
L["eft_muzzle_ar15_zk23.compactname"] = "ZK-23"
L["eft_muzzle_ar15_zk23.description"] = "ZK-23 to jednokomorowy bardzo skuteczny skośny hamulec wylotowy do broni opartych o platformę AR-15. Przód jest dość spiczasty i służy zarówno jako środek odstraszający w walce w zwarciu oraz jako broń do delikatnych celów. Nie jest zalecany w sytuacjach, w których istnieje obawa wystąpienia dużych wstrząsów. Wyprodukowany przez firmę Tactical Advantage Armory."

L["eft_muzzle_ar15_vp09.printname"] = "Hamulec wylotowy do AR-15 Vendetta Precision VP-09 Interceptor 5,56 x 45"
L["eft_muzzle_ar15_vp09.compactname"] = "VP-09"
L["eft_muzzle_ar15_vp09.description"] = "Hamulec wylotowy VP-09 Interceptor zaprojektowany szczególnie na rynek cywilny. Wykonany z odpornego na korozję tytanu i zabezpieczony powłoką Altin PVD, Vendetta Precision VP-09 Interceptor to idealne połączenie wyglądu i niezawodności. Wyprodukowany przez firmę Vendetta Precision."

L["eft_muzzle_ar15_qdc3.printname"] = "Tłumik płomieni KAC QDC Flash Eliminator 5,56 x 45, 3-bolcowy"
L["eft_muzzle_ar15_qdc3.compactname"] = "QDC-3 556"
L["eft_muzzle_ar15_qdc3.description"] = "3-bolcowy tłumik płomieni QDC kalibru 5,56 × 45 mm jest skutecznym tłumikiem płomieni, który służy również jako platforma do dołączania tłumika dźwięku QDC kalibru 5,56 × 45 mm. Może być instalowany na broni opartej na systemie AR-15. Wyprodukowany przez firmę Knight’s Armament Company."

L["eft_muzzle_ar15_claymore.printname"] = "Hamulec wylotowy do AR-15 TROY Claymore 5,56 x 45"
L["eft_muzzle_ar15_claymore.compactname"] = "Claymore"
L["eft_muzzle_ar15_claymore.description"] = "Claymore jest skutecznym hamulcem wylotowym do broni opartych na systemie AR-15. wyprodukowany przez firmę TROY."

L["eft_muzzle_ar15_warden.printname"] = "Tłumik płomieni do AR-15 SureFire Warden 5,56 x 45"
L["eft_muzzle_ar15_warden.compactname"] = "War 556"
L["eft_muzzle_ar15_warden.description"] = "Tłumik płomieni Warden w obudowie ze stali nierdzewnej, która poprawia ogólny wygląd, jednocześnie chroniąc wewnętrzne części przed uszkodzeniem. Ten tłumik płomieni zapobiega powstawaniu wewnętrznych uszkodzeń przez brud, kurz, gruz itp. Wyprodukowany przez firmę SureFire."

L["eft_muzzle_ar15_alien.printname"] = "Hamulec wylotowy do AR-15 AlienTech 5,56 x 45"
L["eft_muzzle_ar15_alien.compactname"] = "AlienTech"
L["eft_muzzle_ar15_alien.description"] = "Zawodowy stalowy hamulec wylotowy z jednym zamkniętym i pięcioma otwartymi portami zaprojektowany przez George’a Gubicha, sześciokrotnego mistrza w strzelaniu praktycznym w Rosji. Montowany na broni z rodziny AR-15."

L["eft_muzzle_ar15_jailbreak.printname"] = "Urządzenie wylotowe do AR-15 SAI JailBrake 5,56 x 45"
L["eft_muzzle_ar15_jailbreak.compactname"] = "JailBrake"
L["eft_muzzle_ar15_jailbreak.description"] = "Urządzenie wylotowe JailBrake, może być zainstalowane tylko na kompatybilnych łożach SAI do karabinków AR-15. Wyprodukowane przez firmę Salient Arms International."

L["eft_silencer_thorpsr.printname"] = "Tłumik dźwięku AWC Thor PSR XL, wielokalibrowy"
L["eft_silencer_thorpsr.compactname"] = "Thor PSR"
L["eft_silencer_thorpsr.description"] = "Tłumik dźwięku Thor PSR XL zaprojektowany do użycia z nabojami kalibru 7,62 × 51 mm NATO, ale jest też kompatybilny z kilkoma innymi kalibrami. Wymaga hamulca wylotowego AWC PSR, by zainstalować. Wyprodukowany przez firmę AWC Silencers."

L["eft_silencer_ar15_qdc556.printname"] = "Tłumik dźwięku KAC QDC 5,56 x 45"
L["eft_silencer_ar15_qdc556.compactname"] = "QDC 556"
