-- [[ ammo_338 ]]
L["eft_ammo_338_ap.printname"] = ".338 Lapua Magnum AP"
L["eft_ammo_338_ap.compactname"] = "AP"
L["eft_ammo_338_ap.description"] = "Nabój .338 Lapua Magnum (8,6 × 70 mm) AP z dwuczęściowym przeciwpancernym pociskiem o masie 15,4 grama, pocisk składa się z sabotu i penetratora z węglika wolframu w mosiężnej łusce. Ten nabój został zaprojektowany w celu zwiększenia, w ograniczonym zakresie, zdolności przeciwpancernych karabinów kalibru .338 Lapua Magnum, będąc w stanie przebić się przez lekkie pojazdy opancerzone, nie wspominając o świetnych wynikach przeciwko najnowocześniejszym specjalistycznym ochronom balistycznym ciała, a także dotkliwej sile obalającej i jest w stanie zadać niszczące obrażenia w celu po uderzeniu. Jednak ze względu na swoją konstrukcję ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_338_fmj.printname"] = ".338 Lapua Magnum FMJ"
L["eft_ammo_338_fmj.compactname"] = "FMJ"
L["eft_ammo_338_fmj.description"] = "Nabój .338 Lapua Magnum (8,6 × 70 mm) FMJ z pociskiem o masie 16,2 grama z ołowianym rdzeniem i płaszczem ze stopu w mosiężnej łusce. Pomimo swojej podstawowej konstrukcji, pocisk ten posiada zdolności do przebijania podstawowych i pośrednich ochron balistycznych ciała, ponadto posiada dotkliwą moc obalającą i jest w stanie zadać krytyczne obrażenia w celu po uderzeniu. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_338_tacx.printname"] = ".338 Lapua Magnum TAC-X"
L["eft_ammo_338_tacx.compactname"] = "TAC-X"
L["eft_ammo_338_tacx.description"] = "Nabój .338 Lapua Magnum (8,6 × 70 mm) TAC-X z pociskiem grzybkującym o masie 18,4 grama zrobionym w całości z miedzi w mosiężnej łusce. Pocisk w tym naboju zapewnia dobrą celność na długich dystansach i został zaprojektowany do polowań na grubą zwierzynę, jako że jego wysokiej klasy moc obalająca jak na ten kaliber jest w stanie wywołać krytyczne obrażenia w celu po uderzeniu, ale mimo dużej energii kalibru .388 Lapua Magnum ze względu na konstrukcję pocisku TAC-X, ma problem z przebiciem podstawowej ochrony balistycznej ciała i ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_338_upz.printname"] = ".338 Lapua Magnum UCW"
L["eft_ammo_338_upz.compactname"] = "UCW"
L["eft_ammo_338_upz.description"] = "Nabój .338 Lapua Magnum (8,6 × 70 mm) UCW z pociskiem o masie 16,2 grama z ołowianym rdzeniem i mosiężnym płaszczem w mosiężnej łusce, przeznaczony do polowań i treningu strzeleckiego, wyprodukowany przez Uljanowski Zakład Amunicji. Ten nabój zaprojektowano do polowań na grubą zwierzynę, jako że pomimo swojej podstawowej konstrukcji, pocisk posiada potężną moc obalającą i jest w stanie zadać ciężkie obrażenia w celu po uderzeniu i może nawet przebijać się przez podstawowe i niektóre pośrednie ochrony balistyczne ciała. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

