L["eft_sr2m_optic.description"] = "Celownik kolimatorowy KP-SR2 zaprojektowano do zwiększenia efektywności strzelania z pistoletu maszynowego SR-2M Wieriesk. Celownik ułatwia proces celowania broni do celu, zwłaszcza w warunkach słabego oświetlenia, oraz pozwala na zwiększenie szybkostrzelności. Wyprodukowany w Instytucie Badawczym Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz)."

