L["eft_ammo_9x21_7u4.printname"] = "9 x 21 mm 7U4"
L["eft_ammo_9x21_7u4.compactname"] = "7U4"
L["eft_ammo_9x21_7u4.description"] = "Nabój 9 × 21 mm 7U4 (indeks GRAU 7U4) o zmniejszonej prędkości pocisku, przeznaczony do strzelania bezpłomieniowego i cichego. Nabój charakteryzuje się ściętą krawędzią na przednim końcu rdzenia, utworzoną przez dwie płaskie krawędzie i zwiększoną masą."

L["eft_ammo_9x21_7n42.printname"] = "9 x 21 mm 7N42 „Zubiło”"
L["eft_ammo_9x21_7n42.compactname"] = "7N42"
L["eft_ammo_9x21_7n42.description"] = "Nabój 9 × 21 mm PP (indeks GRAU 7N42) z pociskiem o zwiększonej penetracji jest przeznaczony do walki z opancerzonym personelem. Część głowicowa rdzenia na ściętą krawędź. Taka konstrukcja zapewnia rozerwanie włókien materiałowej podstawy pancerza i znacznie zwiększa penetrację pocisku. Rdzeń wystaje z płaszcza, co zwiększa jego zdolność penetracji. Głowica pocisku jest koloru czarnego."

L["eft_ammo_9x21_bt.printname"] = "9 x 21 mm BT GŻ"
L["eft_ammo_9x21_bt.compactname"] = "BT"
L["eft_ammo_9x21_bt.description"] = "Nabój 9 × 21 mm Giurza BT GŻ (SP13, indeks GRAU 7BT3) ze smugowym przeciwpancernym pociskiem o masie 7,3 grama ze stalowym rdzeniem i dwuwarstwowym półpłaszczem, ołowianym wewnątrz i ze stopu na zewnątrz ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten pocisk BT (Broniebojnaja Trassirujuszczaja – „przebijający pancerz smugowy”) został zaprojektowany do pistoletów maszynowych kalibru 9 × 21 mm przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) na bazie naboju 9 × 21 mm PS GŻ „SP10” i ma ulepszone właściwości, będąc w stanie przebić przez podstawowe i pośrednie balistyczne ochrony ciała i ma dotkliwą moc obalającą, ale ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_9x21_ps.printname"] = "9 x 21 mm PS GŻ"
L["eft_ammo_9x21_ps.compactname"] = "PS"
L["eft_ammo_9x21_ps.description"] = "Nabój 9 × 21 mm Giurza PS GŻ (SP10, indeks GRAU 7N29) z przeciwpancernym pociskiem o masie 6,7 grama z utwardzonym cieplnie stalowym rdzeniem i dwuwarstwowym półpłaszczem, polietylenowym wewnątrz i ze stopu na zewnątrz w łusce ze stopu. Ten nabój został zaprojektowany w latach 90. XX wieku przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz), by zapewnić wysokiej klasy zdolności penetracyjne w porównaniu do standardowych odpowiedników kalibru 9 × 19 mm, będąc w stanie przebić podstawowe i niektóre pośrednie modele, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_9x21_p.printname"] = "9 x 21 mm P GŻ"
L["eft_ammo_9x21_p.compactname"] = "P"
L["eft_ammo_9x21_p.description"] = "Nabój 9 × 21 mm Giurza P GŻ (SP11, indeks GRAU 7N28) z pociskiem o masie 7,5 grama z miękkim ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu. Ten nabój został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) ze względu na potrzebę utworzenia tańszego naboju 9 × 21 mm PS GŻ „SP10” do strzałów treningowych podczas eksperymentowania z bronią tego kalibru. Z tego powodu nabój musiał spełniać podobne kryteria, takie jak odrzut, prędkość wylotowa i trajektoria. Wynik był na tyle zadowalający, że został przyjęty przez FSB ze względu na jego dotkliwą moc obalającą."

L["eft_ammo_9x21_pe.printname"] = "9 x 21 mm PE GŻ"
L["eft_ammo_9x21_pe.compactname"] = "PE"
L["eft_ammo_9x21_pe.description"] = "Nabój 9 × 21 mm Giurza PE GŻ (SP12) z pociskiem grzybkującym o masie 5,7 grama z ołowianym rdzeniem z polimerowym wierzchołkiem i półpłaszczem ze stopu w łusce ze stopu. Ten nabój został opracowany przez Instytut Badawczy Precyzyjnej Inżynierii Maszynowej (CNIIToczMasz) ze względu na potrzeby FSB, aby wyposażyć swoje siły specjalne w nabój zdolny do zapewnienia potężnej siły obalającej na dystansie do 200 metrów i zachowujący podobne kryteria jak jego odpowiedniki w tym samym kalibrze, takie jak odrzut, prędkość pocisku i trajektoria."

