-- [[ ashrsh12 ]]
L["eft_ammo_12755_ps12.printname"] = "12,7 x 55 mm PS12"
L["eft_ammo_12755_ps12.compactname"] = "PS12"
L["eft_ammo_12755_ps12.description"] = "Specjalny nabój 12,7 × 55 mm PS12 z ciężkim poddźwiękowym pociskiem o masie 33 gramów z ołowianym rdzeniem i płaszczem ze stopu w mosiężnej łusce. Ten nabój został zaprojektowany na początku lat 2010 do karabinu automatycznego ASz-12 i pomimo swojej podstawowej konstrukcji, nabój jest w stanie przebić podstawowe ochrony balistyczne ciała, dodatkowo zapewniając dotkliwą moc obalającą i mogąc zadać ciężkie obrażenia w celu po uderzeniu. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_12755_ps12a.printname"] = "12,7 x 55 mm PS12A"
L["eft_ammo_12755_ps12a.compactname"] = "PS12A"
L["eft_ammo_12755_ps12a.description"] = "Specjalny nabój 12,7 × 55 mm PS12A z lekkim poddźwiękowym pociskiem o masie 7 gramów z aluminiowym rdzeniem i dwuwarstwowym półpłaszczem, ołowianym wewnątrz i ze stopu na zewnątrz, w mosiężnej łusce. Pocisk w tym naboju został zaprojektowany tak, aby rozpadał się i gwałtownie tracił prędkość po uderzeniu w stały obiekt w celu zmniejszenia prawdopodobieństwa rykoszetów podczas operacji miejskich kosztem zdolności penetracyjnych, co w konsekwencji daje mu potężną moc obalającą dzięki swojemu kalibrowi i możliwość zadania krytycznych obrażeń w celu po uderzeniu."

L["eft_ammo_12755_ps12b.printname"] = "12,7 x 55 mm PS12B"
L["eft_ammo_12755_ps12b.compactname"] = "PS12B"
L["eft_ammo_12755_ps12b.description"] = "Specjalny nabój 12,7 × 55 mm PS12B z poddźwiękowym przeciwpancernym pociskiem o masie 18 gramów z utwardzonym cieplnie stalowym rdzeniem i dwuwarstwowym półpłaszczem, ołowianym wewnątrz i ze stopu na zewnątrz w mosiężnej łusce. Ten nabój został zaprojektowany na początku lat 2010 do karabinu automatycznego ASz-12 z możliwością neutralizacji wrogiej piechoty wyposażonej w podstawowe i pośrednie ochrony balistyczne ciała, dodatkowo zapewniając znaczną moc obalającą ze względu na swój kaliber i mogąc zadać znaczne obrażenia w celu po uderzeniu. Jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

