-- [[ ammo_57 ]]
L["eft_ammo_57_l191.printname"] = "5,7 x 28 mm L191"
L["eft_ammo_57_l191.compactname"] = "L191"
L["eft_ammo_57_l191.description"] = "Nabój 5,7 × 28 mm FN L191 z przeciwpancernym pociskiem smugowym o masie 2,1 grama ze stalowym penetratorem, aluminiowym rdzeniem i wzmocnionym miedzianym płaszczem w mosiężnej łusce; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Ten nabój został zaprojektowany, by dodać możliwości smugowe do pistoletów maszynowych kalibru 5,7 × 28 mm podczas ognia ciągłego, w szczególności do pistoletu maszynowego FN P90 wraz z nabojem 5,7 × 28 mm FN SS190, dodatkowo będąc w stanie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała i zapewniając świetne wyniki przeciw modelom pośrednim, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_57_r37f.printname"] = "5,7 x 28 mm R37.F"
L["eft_ammo_57_r37f.compactname"] = "R37.F"
L["eft_ammo_57_r37f.description"] = "Nabój 5,7 × 28 mm FN R37.F z fragmentującym pociskiem o masie 2,4 grama zrobionym w całości z miedzi w mosiężnej łusce; wyprodukowany przez R&R Weapon Systems. Pocisk został zaprojektowany tak, aby przy uderzeniu rozpadał się na trzy ostre jak brzytwa płatki, w ten sposób zapewniając wysokiej klasy moc obalającą jak na swój kaliber i wywołując znaczne obrażenia w celu po uderzeniu, kosztem zdolności penetracyjnych, nawet przeciw podstawowym ochronom balistycznym."

L["eft_ammo_57_r37x.printname"] = "5,7 x 28 mm R37.X"
L["eft_ammo_57_r37x.compactname"] = "R37.X"
L["eft_ammo_57_r37x.description"] = "Nabój 5,7 × 28 mm FN R37.X z pociskiem o masie 2,4 grama z otwartym wierzchołkiem zrobionym w całości z miedzi w mosiężnej łusce; wyprodukowany przez R&R Weapon Systems. Pocisk został zaprojektowany tak, aby rozszerzyć się przy uderzeniu, zmieniając wierzchołek pocisku w kształt trójramiennej gwiazdy, której płatki są ostre jak brzytwa, co zapewnia potężną moc obalającą i wywołuje znaczne obrażenia w celu po uderzeniu, kosztem zdolności penetracyjnych, nawet przeciw podstawowym ochronom balistycznym."

L["eft_ammo_57_sb193.printname"] = "5,7 x 28 mm SB193"
L["eft_ammo_57_sb193.compactname"] = "SB193"
L["eft_ammo_57_sb193.description"] = "Nabój 5,7 × 28 mm FN SB193 z pociskiem poddźwiękowym o masie 4 gramów z ołowianym rdzeniem powlekanym miedzią w mosiężnej łusce z osłabionym ładunkiem. Ładunek prochowy w tym naboju jest dostosowany do zapewnienia, że broń będzie strzelać podczas strzelania z pistoletu FN Five-seveN i pistoletu maszynowego FN P90, osiągając doskonałą redukcję hałasu w połączeniu z tłumikiem i pomimo niskiej prędkości wylotowej, pocisk ma możliwości balistyczne zdolne przebić podstawowe ochrony balistyczne ciała i zapewnia świetne wyniki przeciwko pośrednim modelom, jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_57_ss190.printname"] = "5,7 x 28 mm SS190"
L["eft_ammo_57_ss190.compactname"] = "SS190"
L["eft_ammo_57_ss190.description"] = "Nabój 5,7 × 28 mm FN SS190 z przeciwpancernym pociskiem o masie 2 gramów ze stalowym penetratorem, aluminiowym rdzeniem i wzmocnionym miedzianym płaszczem w mosiężnej łusce. Dzięki swojej prędkości wylotowej i konstrukcji ten nabój jest w stanie przebić podstawowe ochrony balistyczne ciała i zapewnia świetne wyniki przeciw modelom pośrednim, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_57_ss197sr.printname"] = "5,7 x 28 mm SS197SR"
L["eft_ammo_57_ss197sr.compactname"] = "SS197SR"
L["eft_ammo_57_ss197sr.description"] = "Nabój 5,7 × 28 mm FN SS197SR z pociskiem grzybkującym o masie 2,6 grama z ołowianym rdzeniem z polimerowym wierzchołkiem i miedzianym płaszczem w mosiężnej łusce. Ten pocisk posiada balistyczny wierzchołek, który działa przy uderzeniu jak klin na ołowiany rdzeń, pozwalając pociskowi na rozszerzenie się i zadanie znaczących obrażeń w celu po uderzeniu i mimo osobliwości swojej konstrukcji oraz małej prędkości w porównaniu z innymi nabojami tego kalibru, jest w stanie przebić podstawowe ochrony balistyczne ciała."

L["eft_ammo_57_ss198lf.printname"] = "5,7 x 28 mm SS198LF"
L["eft_ammo_57_ss198lf.compactname"] = "SS198LF"
L["eft_ammo_57_ss198lf.description"] = "Nabój 5,7 × 28 mm FN SS198LF z pociskiem o masie 1,8 grama z aluminiowym rdzeniem z otwartym wierzchołkiem i miedzianym płaszczem w mosiężnej łusce. Ten nabój został zaprojektowany do użytku przez policję, osiągając większą prędkość wylotową w porównaniu do innych pocisków tego samego kalibru i zapewniając dotkliwą moc obalającą, ale jego własna konstrukcja zmniejszyła jego możliwości przebicia nawet podstawowych ochron balistycznych ciała."

