L["eft_optic_m2a1.compactname"] = "M2A1 [Z]"
L["eft_optic_m2a1.description"] = "<color=255,100,100>WARNING</color>: Due to ARC9 technical issues, it is impossible to create an attachment that have attachment slots that follow bone model rotations. Therefore, this attachment has been split into two; this one supports <color=255,200,100>zeroing</color>.\n\nCelownik M2A1 został zaprojektowany tak, aby kompensować naturalny dryf granatu 40 mm. Wbudowany czujnik światła przyciemnia siatkę w ciągu dnia i pozwala na jej rozjaśnienie podczas operacji nocnych. Celownik kolimatorowy M2A1 zwiększa ogólne możliwości i zastosowanie MSGL-ów MUSA."

