L["eft_pm_mag_8.printname"] = "8-nabojowy magazynek do PM 9 x 18 PM 90-93"
L["eft_pm_mag_8.compactname"] = "PM 8"
L["eft_pm_mag_8.description"] = "Standardowy 8-nabojowy magazynek do pistoletów Makarowa produkowanych przez zakłady Iżmech. Posiada boczny otwór do obserwacji zawartości."

L["eft_pm_mag_84.printname"] = "84-nabojowy prowizoryczny magazynek bębnowy do PM 9 x 18 PM"
L["eft_pm_mag_84.compactname"] = "PM bęb. 84"
L["eft_pm_mag_84.description"] = "Prowizoryczny 84-nabojowy magazynek do PM. Pierwotnie skonstruowany przez nieznanego geniusza przez połączenie magazynków od PM i PPSz. Zaprojektowany jest do używania w ciasnych przestrzeniach przy użyciu tarcz balistycznych. Chociaż nigdy nie był produkowany seryjnie, nawet w małych ilościach, może być zrobiony z łatwością, pod warunkiem że masz odpowiednie magazynki i zdolne ręce."

L["eft_pm_thread.printname"] = "Pistolet Makarowa (g) 9 x 18 PM"
L["eft_pm_thread.compactname"] = "PM (g)"
L["eft_pm_thread.description"] = "Niemalże mityczny pistolet Makarowa z wydłużoną gwintowaną lufą umożliwiającą zamontowanie tłumika dźwięku. Niektórzy twierdzą, że była to limitowana seria produkowana w Bułgarii, inni zaś obstają przy tym, że był to pistolet wschodnioniemiecki lub nawet ręcznie wykonany. W jaki sposób znalazł się w obwodzie norwińskim, tego nikt żywy nie jest w stanie powiedzieć."

