-- [[ 762x25tt ]]
L["eft_ammo_762x25tt_lrnpc.printname"] = "7,62 x 25 mm TT LRNPC"
L["eft_ammo_762x25tt_lrnpc.compactname"] = "LRNPC"
L["eft_ammo_762x25tt_lrnpc.description"] = "Nabój 7,62 × 25 mm TT z pociskiem z ołowianym okrągłym czubkiem, powlekanym polimerem (Lead Round Nose Polymer Coated, LRNPC); przeznaczony do strzelectwa sportowego i polowań. Ten nabój zapewnia potężną moc obalającą, w porównaniu do innych nabojów tego kalibru używanych przez wojsko, z racji tego, że może powodować znaczne obrażenia w celu po uderzeniu, ale jego prędkość wylotowa jest niższa, nie wspominając o słabych zdolnościach penetracyjnych."

L["eft_ammo_762x25tt_lrn.printname"] = "7,62 x 25 mm TT LRN"
L["eft_ammo_762x25tt_lrn.compactname"] = "LRN"
L["eft_ammo_762x25tt_lrn.description"] = "Nabój 7,62 × 25 mm TT z pociskiem z ołowianym okrągłym czubkiem (Lead Round Nose, LRN); przeznaczony do strzelectwa sportowego i polowań. Konstrukcja tego naboju zapewnia dotkliwą moc obalającą, jednocześnie powodując ciężkie obrażenia w celu po uderzeniu, kosztem zdolności penetracyjnych, poza tym ma niską prędkość wylotową."

L["eft_ammo_762x25tt_fmj.printname"] = "7,62 x 25 mm TT FMJ43"
L["eft_ammo_762x25tt_fmj.compactname"] = "FMJ43"
L["eft_ammo_762x25tt_fmj.description"] = "Nabój 7,62 × 25 mm TT do strzelectwa rekreacyjnego i polowań zaprojektowany do użytku z cywilną samopowtarzalną bronią. Ten nabój nie może się pochwalić świetną siłą penetracji, ale ma znaczną moc obalającą, w porównaniu do innych nabojów tego kalibru używanych przez wojsko."

L["eft_ammo_762x25tt_p.printname"] = "7,62 x 25 mm TT P GŁ"
L["eft_ammo_762x25tt_p.compactname"] = "P"
L["eft_ammo_762x25tt_p.description"] = "Nabój 7,62 × 25 mm TT P GŁ (indeks GAU 57-N-132) z pociskiem o masie 5,5 grama z ołowianym rdzeniem i płaszczem ze stopu w mosiężnej łusce. To podstawowy nabój, który został wypuszczony wraz z przyjęciem pistoletu TT w ZSRR."

L["eft_ammo_762x25tt_akbs.printname"] = "7,62 x 25 mm TT AKBS"
L["eft_ammo_762x25tt_akbs.compactname"] = "AKBS"
L["eft_ammo_762x25tt_akbs.description"] = "Nabój 7,62 × 25 mm TT z niemagnetycznym pociskiem o masie 5,5 grama w mosiężnej łusce; przeznaczony do strzelectwa sportowego i polowań. Ten nabój jest produkowany z najwyższą dbałością o szczegóły, dając strzelcowi więcej korzyści w stosunku do innych nabojów tego samego kalibru, używanych przez wojsko, takich jak zmniejszenie odrzutu bez zmiany jego prędkości wylotowej i zadając znaczne obrażenia celowi, co czyni go idealnym do polowań."

L["eft_ammo_762x25tt_pt.printname"] = "7,62 x 25 mm TT PT GŻ"
L["eft_ammo_762x25tt_pt.compactname"] = "PT"
L["eft_ammo_762x25tt_pt.description"] = "Nabój 7,62 × 25 mm TT PT GŻ (indeks GAU 57-T-133) ze smugowym pociskiem o masie 5,8 grama z ołowianym rdzeniem i płaszczem ze stopu w łusce ze stopu; przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony). Choć ten nabój ma zasięg skuteczny 100 metrów, to jego zdolność smugowa znacznie przekracza ten dystans, przeznaczony do stosowania w pistoletach maszynowych PPD, PPS i PPSz wraz z nabojem 7,62 × 25 mm TT Pst GŻ i zapewniający podobną moc obalającą."

L["eft_ammo_762x25tt_pst.printname"] = "7,62 x 25 mm TT Pst GŻ"
L["eft_ammo_762x25tt_pst.compactname"] = "Pst"
L["eft_ammo_762x25tt_pst.description"] = "Nabój 7,62 × 25 mm TT Pst GŻ (indeks GAU 57-N-134S) z pociskiem o masie 5,4 grama ze stalowym rdzeniem z ołowianą okładziną i płaszczem ze stopu w łusce ze stopu. Choć ten nabój został stworzony z myślą o neutralizowaniu wrogiej piechoty za obiektami o niskiej wytrzymałości strukturalnej, to obecnie jest w stanie skutecznie przebić podstawowe i niektóre pośrednie ochrony balistyczne ciała na bliskim dystansie."

