L["eft_rpd_n.printname"] = "Karabinek maszynowy Diegtiariowa RPDN 7,62 x 39"
L["eft_rpd_n.compactname"] = "RPDN"
L["eft_rpd_n.description"] = "Ręczny karabinek maszynowy Diegtiariowa kalibru 7,62 × 39 mm. Ten karabin maszynowy został przyjęty przez Armię Radziecką i był używany jako środek wzmocnienia oddziałów i plutonów piechoty od końca lat czterdziestych do początku lat sześćdziesiątych. RPD jest elegancko zaprojektowany, dzięki czemu jest kompaktową, niezawodną i dość potężną bronią wsparcia ogniowego. Wariant RPDN jest wyposażony w odchylany montaż typu jaskółczy ogon do instalacji optyki. Wyprodukowany przez zakłady W.A. Diegtiariowa."

