L["eft_tt33_gold.printname"] = "Pistolet TT-33 7,62 x 25 TT (złoty)"
L["eft_tt33_gold.compactname"] = "TT złoty"
L["eft_tt33_gold.description"] = "Legendarny pistolet. Był świadkiem wielu konfliktów zbrojnych, a mimo to jest wciąż używany w niektórych częściach świata, w takim wariancie bądź innym. Klasyczny TT-33 oferuje system krótkiego odrzutu lufy Browninga, ale poza tym faktem jego konstrukcja jest unikatowa – prosty w budowie, z mechanizmem spustowym pojedynczego działania i jedynie blokadą kurka, jest w stanie wytrzymać prawie wszystko. Dzięki silnej amunicji 7,62 × 25 mm i stosunkowo długiej lufie, TT oferuje wysoką prędkość wylotową, penetrację i imponującą celność nawet na dalekich dystansach. Specjalna złota wersja."

