L["eft_ammo_4630_actionsx.printname"] = "4,6 x 30 mm Action SX"
L["eft_ammo_4630_actionsx.compactname"] = "Action SX"
L["eft_ammo_4630_actionsx.description"] = "Nabój 4,6 × 30 mm HK Action SX z pociskiem z wgłębieniem wierzchołkowym o masie 2 gramów zrobionym w całości z mosiądzu w mosiężnej łusce. Ten nabój zaprojektowano do skutecznego obezwładnienia napastnika podczas działań w bliskim kontakcie, dzięki swojej dotkliwej sile obalającej, dodatkowo zapobiegając przebiciom, ale ze względu na swoją konstrukcję ma znaczne prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_4630_subsonicsx.printname"] = "4,6 x 30 mm Subsonic SX"
L["eft_ammo_4630_subsonicsx.compactname"] = "Subsonic SX"
L["eft_ammo_4630_subsonicsx.description"] = "Nabój 4,6 × 30 mm HK Subsonic SX z pociskiem poddźwiękowym o masie 5 gramów z rdzeniem ze stopu wolframu powlekanym miedzią w mosiężnej łusce z osłabionym ładunkiem. Ładunek prochowy w tym naboju poddźwiękowym jest dostosowany do działania z rodziną pistoletów maszynowych MP7, zapewniając, że broń będzie strzelać i osiągnie doskonałą redukcję hałasu w połączeniu z tłumikiem. Pomimo niskiej prędkości wylotowej, pocisk ma możliwości balistyczne zdolne przebić podstawowe ochrony balistyczne ciała i zapewnia świetne wyniki przeciwko pośrednim modelom, jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_4630_jsp.printname"] = "4,6 x 30 mm JSP SX"
L["eft_ammo_4630_jsp.compactname"] = "JSP SX"
L["eft_ammo_4630_jsp.description"] = "Nabój Fibonacci 40 gr Jacketed Soft Point do kalibru 4,6 × 30 mm HK. Nabój ten został zaprojektowany na wzór naboju 5,7 × 28 mm. Pocisk z płaszczem z wierzchołkiem odkrytym sprawia, że jest to skuteczny nabój na szkodniki i drobną zwierzynę. Nadaje się do H&K MP7. Amunicja ma mosiężną łuskę, spłonkę Boxer i nie koroduje."

L["eft_ammo_4630_fmjsx.printname"] = "4,6 x 30 mm FMJ SX"
L["eft_ammo_4630_fmjsx.compactname"] = "FMJ SX"
L["eft_ammo_4630_fmjsx.description"] = "Nabój 4,6 × 30 mm HK FMJ SX z pociskiem o masie 2,6 grama z rdzeniem z ołowiano-antymonowego stopu z mosiężnym pełnym płaszczem (FMJ) w mosiężnej łusce. Ten nabój został opracowany do ogólnego użytku wojskowego, ale właściwości balistyczne jego pocisku pozwalają mu przebić podstawową i pośrednią ochronę balistyczną ciała, jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_4630_apsx.printname"] = "4,6 x 30 mm AP SX"
L["eft_ammo_4630_apsx.compactname"] = "AP SX"
L["eft_ammo_4630_apsx.description"] = "Nabój 4,6 × 30 mm HK AP SX z przeciwpancernym pociskiem o masie 2 gramów z powlekanym miedzią stalowym rdzeniem w mosiężnej łusce. Nabój AP SX zapewnia najwyższą zdolność penetracji spośród kalibru 4,6 × 30 mm, pozwalając strzelającemu przebić podstawowe i pośrednie ochrony balistyczne ciała, dodatkowo zapewniając świetne rezultaty przeciwko niektórym specjalistycznym modelom, jednak ze względu na swoją konstrukcję ma wysokie prawdopodobieństwo odbicia się od różnych powierzchni."

