L["eft_ammo_300blk_ap.printname"] = ".300 Blackout AP"
L["eft_ammo_300blk_ap.compactname"] = "AP"
L["eft_ammo_300blk_ap.description"] = "Nabój .300 Blackout (7,62 × 35 mm) AP z przeciwpancernym pociskiem o masie 8,4 grama z naboju 7,62 × 51 mm NATO M80A1, składającym się ze stalowego penetratora w części wierzchołkowej, ołowianego rdzeniu i miedzianego półpłaszcza w mosiężnej łusce. Pomimo własnych właściwości pocisku w przypadku zastosowania w naboju o pełnej mocy, ulegają one pogorszeniu po przeniesieniu na nabój pośredni, jednakże pocisk ten nadal posiada zdolności do przebijania podstawowych i pośrednich ochron balistycznych ciała, dodatkowo jest w stanie wywołać znaczne obrażenia w celu po uderzeniu. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach STANAG 5,56 × 45 mm NATO."

L["eft_ammo_300blk_m62.printname"] = ".300 Blackout M62 smugowy"
L["eft_ammo_300blk_m62.compactname"] = "M62"
L["eft_ammo_300blk_m62.description"] = "Nabój .300 Blackout z pociskiem smugowym, przeznaczony do oznaczania celów i regulowania ognia w walce (kolor smugi: czerwony)."

L["eft_ammo_300blk_bcp.printname"] = ".300 Blackout BCP FMJ"
L["eft_ammo_300blk_bcp.compactname"] = "BCP FMJ"
L["eft_ammo_300blk_bcp.description"] = "Nabój .300 Blackout (7,62 × 35 mm) BCP FMJ z pociskiem o masie 9,4 grama z ołowianym rdzeniem i płaszczem ze stopu w stalowej łusce; przeznaczony do polowań, obrony miru domowego i treningu strzeleckiego, produkowany przez Barnaul Cartridge Plant. Dzięki swojej podstawowej konstrukcji nabój ten jest jedną z najbardziej ekonomicznych opcji jak na swój kaliber, a mimo to pocisk w tym naboju ma możliwości przebicia podstawowych ochron balistycznych ciała, a także niektórych modeli pośrednich do tego dodatkowo zapewniając dotkliwą moc obalającą, ma jednak znaczne prawdopodobieństwo odbicia się od różnych powierzchni. Jego konstrukcja pozwala również na bezproblemowe stosowanie go w magazynkach STANAG 5,56 × 45 mm NATO."

L["eft_ammo_300blk_cbj.printname"] = ".300 Blackout CBJ"
L["eft_ammo_300blk_cbj.compactname"] = "CBJ"
L["eft_ammo_300blk_cbj.description"] = "Eksperymentalny nabój przeciwpancerny firmy CBJ Tech. Zawiera pocisk z wolframowym rdzeniem o masie 6,1 g wewnątrz plastikowego sabota o masie 1 g. Ma ulepszone zdolności penetracji pancerza i zwiększoną prędkość."

L["eft_ammo_300blk_vmax.printname"] = ".300 Blackout V-Max"
L["eft_ammo_300blk_vmax.compactname"] = "V-Max"
L["eft_ammo_300blk_vmax.description"] = "Specjalny wysoce precyzyjny nabój z wierzchołkiem odkrytym zaprojektowany do polowań na małą zwierzynę."

L["eft_ammo_300blk_whisper.printname"] = ".300 Whisper"
L["eft_ammo_300blk_whisper.compactname"] = "Whisper"
L["eft_ammo_300blk_whisper.description"] = "Nabój Whisper to lekka konstrukcja o dużej prędkości, wykorzystująca aluminiowy rdzeń i wcześniej naprężony płaszcz. Aluminiowy rdzeń rozpoczyna ekspansję chwilę po trafieniu, wciskając się z powrotem w naprężony płaszcz i uruchamiając gwałtowny, obezwładniający transfer energii. Nabój ten jest idealny do bliskiej wymiany ognia z nieopancerzonymi i/lub lekko opancerzonymi celami. Nie mylić z .300 Blackout, ponieważ Whisper został opracowany prawie 20 lat przed nim."

