L["eft_ammo_9x39_fmj.printname"] = "9 x 39 mm FMJ"
L["eft_ammo_9x39_fmj.compactname"] = "FMJ"
L["eft_ammo_9x39_fmj.description"] = "Nabój 9 × 39 mm TCW FMJ przeznaczony jest do strzelania z broni cywilnej. Nabój nie traci swoich właściwości podczas użytkowania w różnych warunkach klimatycznych i meteorologicznych, niezależnie od pory roku."

L["eft_ammo_9x39_sp6.printname"] = "9 x 39 mm SP-6 GS"
L["eft_ammo_9x39_sp6.compactname"] = "SP-6"
L["eft_ammo_9x39_sp6.description"] = "Specjalny nabój 9 × 39 mm SP-6 GS (indeks GRAU 7N9) z poddźwiękowym przeciwpancernym pociskiem o masie 16 gramów z utwardzonym cieplnie stalowym rdzeniem i dwuwarstwowym półpłaszczem, ołowianym wewnątrz i ze stopu na zewnątrz w mosiężnej łusce. Ten nabój został zaprojektowany w środku lat 1980, by wyposażyć wytłumiony karabinek automatyczny AS Wał w możliwości zneutralizowania wrogiej piechoty wyposażonej w podstawowe i pośrednie ochrony balistyczne ciała, dodatkowo zapewniając znaczną moc obalającą, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_9x39_bp.printname"] = "9 x 39 mm BP GS"
L["eft_ammo_9x39_bp.compactname"] = "BP"
L["eft_ammo_9x39_bp.description"] = "Specjalny nabój 9 × 39 mm BP GS (indeks GRAU 7N12) z poddźwiękowym przeciwpancernym pociskiem o masie 15,5 grama z rdzeniem z utwardzonej stali węglowej i dwuwarstwowym półpłaszczem, ołowianym wewnątrz i ze stopu na zewnątrz, w stalowej łusce. Ten pocisk BP (Broniebojnaja Pula – „pocisk przebijający pancerz”) został opracowany na początku lat 2000 na bazie naboju 9 × 39 mm SP-6 w celu ulepszenia jego konstrukcji i zdolności penetracyjnych, co skutkuje poprawą w przebijaniu większości modeli specjalistycznych ochron balistycznych ciała, dodatkowo zapewniając znaczną moc obalającą. Jednak ze względu na swoją konstrukcję, ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_9x39_spp.printname"] = "9 x 39 mm SPP GS"
L["eft_ammo_9x39_spp.compactname"] = "SPP"
L["eft_ammo_9x39_spp.description"] = "Specjalny nabój 9 × 39 mm SPP GS (indeks GRAU 7N9) z poddźwiękowym przeciwpancernym pociskiem o masie 15,7 grama z rdzeniem z utwardzonej stali węglowej z ołowianą podstawą i półpłaszczem ze stopu w stalowej łusce. Ten nabój został opracowany na początku XXI wieku na bazie naboju 9 × 39 mm SP-5 GS w celu ulepszenia jego konstrukcji i zdolności penetracyjnych, co zaowocowało poprawą w przebijaniu podstawowych i pośrednich ochron balistycznych ciała, dodatkowo zapewniając świetne wyniki przeciwko niektórym specjalistycznym modelom ochrony ciała i mając dotkliwą moc obalającą. Jednak ze względu na swoją konstrukcję, ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

L["eft_ammo_9x39_pab9.printname"] = "9 x 39 mm PAB-9 GS"
L["eft_ammo_9x39_pab9.compactname"] = "PAB-9"
L["eft_ammo_9x39_pab9.description"] = "Nabój PAB-9 GS (Patron Awtomatnyj Broniebojnyj – „nabój przeciwpancerny do karabinów automatycznych”) to modyfikacja naboju SP-6. Cięższy pocisk z prędkością wylotową większą niż 300 m/s umożliwił nieznaczne zwiększenie obrażeń i zdolności penetracyjnej ze względu na pogorszenie celności. W szeregach sił specjalnych Federacji Rosyjskiej nie jest zalecany do stosowania ze względu na zwiększony negatywny wpływ na zużycie broni."

L["eft_ammo_9x39_sp5.printname"] = "9 x 39 mm SP-5 GS"
L["eft_ammo_9x39_sp5.compactname"] = "SP-5"
L["eft_ammo_9x39_sp5.description"] = "Specjalny nabój 9 × 39 mm SP-5 (indeks GRAU 7N8) z poddźwiękowym pociskiem o masie 16 gramów z zaostrzonym stalowym rdzeniem z ołowianą podstawą i płaszczem ze stopu w stalowej łusce. Ten pocisk został zaprojektowany w środku lat 1980, bazując na naboju 7,62 × 39 mm US GŻ do użytku ze specjalnym karabinem wyborowym WSS Wintoriez, będąc w stanie przebić podstawowe ochrony balistyczne ciała i zapewniając świetne rezultaty przeciwko niektórym pośrednim modelom, w dodatku mając dotkliwą moc obalającą, jednak ze względu na swoją konstrukcję ma duże prawdopodobieństwo odbicia się od różnych powierzchni."

