-- [[ 50ae_357 ]]
L["eft_ammo_50ae_copper.printname"] = ".50 AE Copper Solid"
L["eft_ammo_50ae_copper.compactname"] = "Copper"
L["eft_ammo_50ae_copper.description"] = "Nabój .50 Action Express Hawk Copper Solid (12,7 × 33 mm) z 400-granowym precyzyjnym pociskiem zaprojektowanym do kierowania ogromnej ilości energii w cel. .50 AE jest jednym z najpotężniejszych jednoelementowych nabojów pistoletowych na świecie i ma wysoką śmiertelność."

L["eft_ammo_50ae_fmj.printname"] = ".50 AE FMJ"
L["eft_ammo_50ae_fmj.compactname"] = "FMJ"
L["eft_ammo_50ae_fmj.description"] = "Nabój .50 Action Express FMJ (12,7 × 33 mm) z 300-granowym pociskiem z płaskim nosem, który zapewnia ogromną moc obalającą. .50 AE jest jednym z najpotężniejszych jednoelementowych nabojów pistoletowych na świecie i ma wysoką śmiertelność."

L["eft_ammo_50ae_jsp.printname"] = ".50 AE Hawk JSP"
L["eft_ammo_50ae_jsp.compactname"] = "Hawk JSP"
L["eft_ammo_50ae_jsp.description"] = "Nabój .50 Action Express Hawk JSP (12,7 × 33 mm) z 400-granowym pociskiem z płaszczem z wierzchołkiem odkrytym, zaprojektowany do penetracji i kierowania ogromnej ilości energii do celu. .50 AE jest jednym z najpotężniejszych jednoelementowych nabojów pistoletowych na świecie i ma wysoką śmiertelność."

L["eft_ammo_50ae_jhp.printname"] = ".50 AE JHP"
L["eft_ammo_50ae_jhp.compactname"] = "JHP"
L["eft_ammo_50ae_jhp.description"] = "Nabój .50 Action Express JHP (12,7 × 33 mm) z 300-granowym pociskiem w płaszczu z wgłębieniem wierzchołkowym, który zapewnia ogromną moc obalającą. .50 AE jest jednym z najpotężniejszych jednoelementowych nabojów pistoletowych na świecie i ma wysoką śmiertelność."

L["eft_ammo_357_fmj.printname"] = ".357 Magnum FMJ"
L["eft_ammo_357_fmj.compactname"] = "FMJ"
L["eft_ammo_357_fmj.description"] = "Amerykański nabój rewolwerowy dużej mocy .357 Magnum produkowany przez firmę Smith & Wesson."

L["eft_ammo_357_jhp.printname"] = ".357 Magnum JHP"
L["eft_ammo_357_jhp.compactname"] = "JHP"
L["eft_ammo_357_jhp.description"] = "Nabój .357 Magnum (9 × 33 mm R) JHP z 8-gramowym pociskiem z ołowianym rdzeniem z wgłębieniem wierzchołkowym i płaszczem ze stopu w łusce ze stali, produkowany przez firmę Smith & Wesson. Pocisk w tym naboju został zaprojektowany tak, aby rozprężał się wkrótce po uderzeniu w cel, pozwalając mu przebić podstawowe ochrony balistyczne ciała i zapewniając dotkliwą moc obalającą i być w stanie spowodować ciężkie obrażenia w celu po uderzeniu."

L["eft_ammo_357_hp.printname"] = ".357 Magnum Hollow Point"
L["eft_ammo_357_hp.compactname"] = "HP"
L["eft_ammo_357_hp.description"] = "Nabój .357 Magnum (9 × 33 mm R) Hollow Point z 9-gramowym pociskiem wykonanym z litej miedzi w mosiężnej łusce; przeznaczony do polowań i obrony miru domowego, produkowany przez firmę Smith & Wesson. Pocisk w tym naboju ma potężną moc obalającą dzięki wyjątkowej zdolności do rozprężania się po uderzeniu, a także jest w stanie wywołać poważne negatywne skutki dla celu po uderzeniu. Podobnie, jego konstrukcja zwiększa zdolność penetracji niektórych modeli podstawowej ochrony balistycznej ciała."

L["eft_ammo_357_sp.printname"] = ".357 Magnum Soft Point"
L["eft_ammo_357_sp.compactname"] = "SP"
L["eft_ammo_357_sp.description"] = "Nabój .357 Magnum (9 × 33 mm R) Soft Point z 7-gramowym ołowianym rdzeniem z wierzchołkiem odkrytym i półpłaszczem ze stopu w stalowej łusce; przeznaczony do polowań i obrony miru domowego, produkowany przez firmę Smith & Wesson. Pocisk w tym naboju ma doskonałą ekspansję i energię uderzenia, co daje mu wysokiej klasy moc obalającą jak na swój kaliber, być w stanie spowodować ciężkie obrażenia w celu po uderzeniu i zapewnić redukcję odrzutu, co czyni go doskonałym wyborem na polowania."

